INSERT INTO `jokes` VALUES (34,2,'The Fowl-Mouthed Parrot!','A woman was walking down the street past a pet shop, and when she looked in the window there was a gorgeous parrot for sale with a sign that said \"$50.00\".\r<BR>\n\r<BR>\nShe had always wanted a parrot, but had found them to be too expensive, so she rushed in and asked the proprietor, \"Why is this parrot so cheap?\"\r<BR>\n\r<BR>\n\"Well,\" he replied, \"You see, that parrot was in a brothel for awhile, and learned some bad language, so nobody seems to want it.\"\r<BR>\n\r<BR>\nHow bad could it be?, the woman thought.\r<BR>\nFinally, she decided to buy it anyway, as it was such a beautiful bird. She took it home in a cage and put it on the table.\r<BR>\n\r<BR>\nThe parrot looked around and said \"Awk! New House, New Madam!\"\r<BR>\n\"Well,\" the woman thought, \"That\'s not so bad.\"\r<BR>\n\r<BR>\nThen the woman\'s two daughters came home from school.\r<BR>\n\"Awk!\", the parrot said, \"New Madam, New Whores!\"\r<BR>\n\r<BR>\nWell, that upset them a bit, but they tried to laugh it off, and decided that wasn\'t so bad either. Then the woman\'s husband came home from work.\r<BR>\n\r<BR>\n\"Awk!\" The parrot said, \"New Madam, New Whores, Same old faces! Hi George!\"',NULL,0.77,13,3300,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (30,2,'The Little Boy Who Was Stomping','One day, a little boy, was outside in the backyard stomping on honeybees.\r\n\r\nWhen his father came out and saw what the little boy was doing, he made him stop right away and told the little boy, \"That\'s it for you. No honey for a week.\"\r\n\r\nWell, then the little boy went to the front yard of the house and started stomping on butterflies. When his father saw what Teddy was doing, he made him stop right away and said, \"Stomping on butterflies is a terrible thing to do. Just for that, no butter for a week.\"\r\n\r\nAfter that, little boy and his father went into the kitchen and saw the little boy\'s mother stomping on cockroaches.\r\n\r\nThe little boy turned to his father and said, \"Should I tell her or should you?\"',NULL,0.29,7,1421,1,1,2,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (27,2,'The Road Runner','The Roadrunner was feeling very amorous one day, and since there were no other female roadrunners around, he decided to look around.\r<BR>\n\r<BR>\nHe happened to spot a lovely dove. Bzzzzzz... down he goes and feathers are flying, lots of dust in the air and the dazed dove is lying there with a smile and says, \"I\'m a dove and I\'ve been loved!\"\r<BR>\n\r<BR>\nThe Roadrunner is still not satisfied. He spots a Lark flying around and zooms down on her. Again, feathers are flying around and dust is in the air and the dazed Lark is lying there and said, \"I\'m a Lark and I\'ve been sparked\"\r<BR>\n\r<BR>\nThe Roadrunner is still not satisfied and spots a Duck. He zooms down and again feathers are flying and a lot of squawkings and dust flying in the air, and the roadrunner takes off.\r<BR>\n\r<BR>\nThe Duck is lying there really pissed off, and says \"I\'m a Drake and there\'s been a mistake!\"',NULL,2.50,4,977,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (24,2,'Three Dogs','There were three dogs at the vet talking to each other when one says,\"I chewed up all my masters shoes, and that\'s why I\'m here\". \r<BR>\n\r<BR>\nThe next dog said,\"I peed on my masters $1,000 rug\". \r<BR>\n\r<BR>\nThe next dog then comes in and say\'s,\"My master is a female and she likes to clean house in the nude, so when she bent over to pick up something, I went for the ride of a life time!\". \r<BR>\n\r<BR>\n\"And that\'s why you\'re here?\" asked the other dogs. \"No, I\'m getting my nails clipped.\"',NULL,2.50,4,3127,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (114,2,'Hungry Rooster','A Rolls Royce pulls up in front of a really expensive restaurant and a really rich sheik gets out from it followed by a harem of women, and a rooster. The \"party\" is escorted to a table and given a menu.\r<BR>\n\r<BR>\nWhen time to order the sheik orders for himself and the harem, and also asks for a basket of apples for the rooster. The waiter thinks it a bit strange, but does as is asked, and brings the apples for the rooster. One by one, the rooster eats all of the apples. Having\r<BR>\nnoticed this, the sheik orders another basket of apples for the rooster. Again the rooster eats all the apples.\r<BR>\n\r<BR>\nWhen summoned again, the waiter asks the sheik about the voracious appetite of the rooster.\r<BR>\n\r<BR>\nThe sheik explains:\r<BR>\n\"I was in the desert one day and found a lamp.\r<BR>\nIt was a bit dirty so I rubbed it to clean it.\r<BR>\nJust as I did, out came a Genie and granted me three wishes...\r<BR>\n\r<BR>\nMy first wish was to have an endless supply of money. \r<BR>\nMy second wish was to have many beatiful women.\r<BR>\nAnd my third wish was to have an insatiable cock!\"',NULL,0.50,2,556,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (115,2,'Huey, Dewy, and Puddles','A young girl is wandering through a park in the pouring rain, when she comes across 3 dogs. Being a bit of an animal lover, she approaches them, bends down and starts to stroke one of them: \"Ah, you\'re lovely, aren\'t you?\" she says to the first dog. \"What\'s your name?\" To her surprise, the dog actually answers her, \"My name\'s Huey, and I\'ve had a great day going in and out of puddles.\"\r<BR>\n\r<BR>\nDelighted with this discovery, she moves on to the next dog. \"And what\'s your name then?\" Again, unbelievably, the 2nd dog answers her, \"My name\'s Lewy, and I\'ve had a great day going in and out of puddles.\" And so she moves on to the last dog. \"Let me guess,\" she says. \"your name\'s Dewy, and you\'ve had a great day going in and out of puddles.\"\r<BR>\n\r<BR>\n\"No,\" replies the last dog. \"My name\'s Puddles, and I\'ve had an awful day!\"',NULL,0.00,NULL,378,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (60,2,'Horny Rooster','A farmer wanted to have his hens serviced, so he went to the market looking for a rooster. He was hoping he could get a special rooster - one that would service all of his many hens. \r<BR>\n\r<BR>\nWhen he told this to the market vendor, the vendor replied, \"I have just the rooster for you. Henry here is the horniest rooster you will ever see!\"\r<BR>\n\r<BR>\nSo the farmer took Henry back to the farm. Before setting him loose in the hen house though, he gave Henry a little pep talk. \"Henry\", he said, \"I\'m counting on you to do your stuff.\" And without a word, Henry then strutted into the hen house.\r<BR>\n\r<BR>\nHenry was as fast as he was furious, mounting each hen like a thunderbolt. There was much squawking and many feathers flying, till Henry had finished having his way with each hen. But Henry didn\'t stop there, he went in to the barn and mounted all the horses, one by one and still at the same frantic pace. Then he went to the pig house where he did the same. \r<BR>\n\r<BR>\nThe farmer, watching all of this with disbelief, cried out, \"Stop, Henry, you\'ll kill yourself.\" But Henry continued, seeking out each farm animal in the same manner.\r<BR>\n\r<BR>\nWell the next morning, the farmer looked out and saw Henry lying there on his lawn. His legs were up in the air, his eyes rolled back, and his long tongue hanging out. A buzzard was already circling above Henry.\r<BR>\n\r<BR>\nThe farmer walked up to Henry saying, \"Oh you poor thing, look what you did, you\'ve gone and killed yourself. I warned you big buddy.\"\r<BR>\n\r<BR>\n\"Shhhhh,\" Henry whispered, \"The buzzard is getting closer.\"',NULL,3.00,3,2509,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (63,2,'Elephant Experiment','Three scientists were one day discussing what would happen if they rammed a cork up an elephant\'s backside and force fed it for 2 weeks. But because the experiment had never been documented and the idea was hard to comprehend they decided to have a go.\r<BR>\n\r<BR>\nA week after the experiment had started they began to realize WHY the idea had never been tried: they were stuck for someone to pull the cork out.\r<BR>\n\r<BR>\nOne of the scientists came up with the bright idea of training a monkey to do the job, so they spent the next week training it to pull out corks once a buzzer had rung, then push it back in for another go. When the big day arrived they set up all the monitoring equipment and moved out to a safe distance.\r<BR>\n\r<BR>\nThe first scientist went 1 mile away, the second went 2 miles away and the third went 3 miles. When they were all ready the first scientist pushed the button to sound the buzzer. BBBAAANNNGGG!!!!!!!\r<BR>\n\r<BR>\nThe third scientist (3 miles away) was up to his ankles in shit, the second (2 miles away) was up to his knees and the first (1 mile away) was up to his waist. When the others joined the scientist who was 1 mile away they noticed that he was in fits of laughter.\r<BR>\n\r<BR>\n\"What the %$*& is so funny?\" asked one of the scientist.\r<BR>\n\r<BR>\n\"You should have seen the monkey\'s face trying to get the cork back in!!!\"',NULL,10.00,1,1349,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (122,2,'Duck shopper','A duck walks in to a drug store and asks for a condom.\r<BR>\n\r<BR>\nThe sales person comes back with the condom and says \"Put this on your bill sir\" to which the duck replies \"what do you think I\'M a dickhead!\"',NULL,0.00,NULL,374,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (64,2,'Donald Duck','Donald Duck walked into a drugstore & asked for a packet of condoms.\r<BR>\n\r<BR>\n\"Certainly, sir\" said the lady behind the counter, \"shall I put them on your bill?\"\r<BR>\n\r<BR>\n\"NO WAY!\" replied Donald Duck, \"What do you think I am, a Dickhead?!\" ',NULL,1.00,1,473,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (124,2,'Dog story','A veterinarian got a phone call at midnight one night.\r<BR>\n\r<BR>\nThe woman on the other end of the phone said, \"My wee puppy is together with the dog from next door and I can\'t get them apart.\"\r<BR>\n\r<BR>\nThe vet asked her if she tried throwing a bucket of water on them.\r<BR>\nShe said \"Yes, but it didn\'t work.\"\r<BR>\n\r<BR>\nHe said, \"Did you try hitting them with a broom.\"\r<BR>\nShe said, \"Yes, but that didn\'t work either.\"\r<BR>\n\r<BR>\nHe then said, \"Well Ma\'am here\'s what you do. Hang up. I\'ll call you back. When the phone rings, they will separate.\"\r<BR>\n\r<BR>\nShe said, \"Do you really think that will work?\"\r<BR>\nHe said, \"Well it just did for me!\"',NULL,0.00,NULL,434,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (125,2,'Circus Elephant','There was this guy who bought an elderly circus elephant. Alas, he couldn\'t afford to feed it. He\'d never seen an elephant jump with all 4 feet off the ground. So he started a contest: entry was $10, and the first person to get the elephant to jump with all 4 feet off the ground would get $50,000.\r<BR>\n\r<BR>\nAll sorts of people tried, but nobody could get the elephant to jump. Finally, this little guy arrives in a limousine. He\'s carrying a baseball bat. He walks up to the elephant, swings the bat, and crunches the elephants balls pretty badly. Needless to say, the elephant jumps, and the owner pays out the $50,000. Unfortunately, the owner had barely collected enough to cover the prize, so he ran another contest.\r<BR>\n\r<BR>\nHe\'d never seen an elephant swing its head back and forth as if to say, \"no.\" Same deal as before: $10 per entry, $50,000 prize. Lots of people try and fail. Then the little guy shows up in his limousine again, pulls out his bat, and walks up to the elephant. He says, \"Remember me?\" The elephant nods yes.\r<BR>\n\r<BR>\nThe man then holds up his bat and says, \"Want me to use this again?\" The elephant nods his head rather emphatically no....',NULL,0.00,NULL,380,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (67,2,'Chicken and the Egg','There was a chicken and a egg laying in bed together.\r<BR>\n\r<BR>\nThe chicken has a satisfied look on her face... The egg looks a her and he say\'s \"Well I guess we settled that question now didn\'t we.\"',NULL,0.33,3,1049,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (127,2,'Whales','A male whale and a female whale were swimming off the coast of Japan when they noticed a whaling ship. The male whale recognized it as the same ship that had harpooned his father many years earlier.\r<BR>\n\r<BR>\nHe said to the female whale, \"Let\'s both swim under the ship and blow out of our air holes at the same time and it should cause the ship to turn over and sink.\" They tried it and sure enough, the ship turned over and quickly sank.\r<BR>\n\r<BR>\nSoon however, the whales realized the sailors had jumped overboard and were swimming to the safety of shore. The male was enraged that they were going to get away and told the female \"lets swim after them and gobble them up before they reach the shore.\"\r<BR>\n\r<BR>\nAt this point, he realized the female was becoming reluctant to follow him. \"Look,\" she said, \"I went along with the blow job, but I absolutely refuse to swallow the seamen!\"',NULL,2.50,2,652,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (140,3,'Bad News','This man walks in a bar and says to the bartender, \"Hey Joe, how about fixing me up with 8 shots of whiskey and 8 bottles of beer?\"\r<BR>\n\r<BR>\n\r<BR>\nThe Man says, \"Well, my son has just come home from college and I found out he\'s gay.\"\r<BR>\n\r<BR>\nJoe says, \"Man that\'s terrible,\" and gives the man his whiskey and beer.\r<BR>\n\r<BR>\nTwo weeks go by and the same man goes to the bar... He walks in and says, \"Hey Joe, how about fixing me up with 8 shots of whiskey and 8 bottles of beer?\"\r<BR>\n\r<BR>\nJoe says, \"Well hell, what\'s the matter this time?\"\r<BR>\n\r<BR>\nThe man says, \"Well my other boy just come home from college and I found out that HE\'S gay.\"\r<BR>\n\r<BR>\nJoe says, \"Man, that\'s a damn shame,\" and fixes him up with the beer and whiskey.\r<BR>\n\r<BR>\nThree weeks go by and the man comes bursting through the doors and says, \"Joe, I want you to fix me up with every f*cking drink you got in the house!\"\r<BR>\n\r<BR>\nJoe says, \"Geez, doesn\'t anyone in your family love women?\"\r<BR>\n\r<BR>\nThe man says, \"Yeah, I just found out my wife does...\"',NULL,1.00,10,2663,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (85,3,'The Crying Horse','One day a guy walks into a bar. The bartender says \"if you can make that horse over there laugh you can have free drinks for the rest of the night\". \r<BR>\n\r<BR>\nSo he says \"ok\" and walks over to the horse and whispers something in his ear and he starts laughing and the bartender gives him free drinks for the rest of the night. \r<BR>\n\r<BR>\nThe next night the same guy comes back in and the bartender says \"if you can make that horse over there cry i will give you free drinks for the rest of the night. \r<BR>\n\r<BR>\nSo he walks over there and does something and the horse starts crying, and the bartender gives him free drinks. Then the bartender asks what the man did to make the horse laugh and what he did to make him cry.\r<BR>\n\r<BR>\nThe man says \"To make him laugh I told him I had a bigger dick than he does and to make him cry I showed him\".',NULL,2.50,4,767,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (129,3,'Suzy\'s Legs','There were three guys in a new bar that just openened and the bartender asked them what he should call his new bar.\r<BR>\n\r<BR>\nOne guy said, \"just name it a pub.\"\r<BR>\nAnother said, \"just name it the bar.\"\r<BR>\nThe thrid guy said, \"name it Suzy\'s Legs\".\r<BR>\n\r<BR>\nThe owner like that one so he called his bar Suzy\'s Legs.\r<BR>\n\r<BR>\nThe next morning, this same guy and his dog were sitting in front of the bar waiting for it to open when a cop drove by and asked what he was doing?\r<BR>\n\r<BR>\nHe replied...nothing officer...\"just waiting for Suzy\'s Legs to open so I can get a drink!\"',NULL,0.33,3,674,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (141,3,'I Blew Chunks','3 guys go into a bar. The booze begins to flow pretty heavily in the course of the evening and the guys get split up. Next morning they\'re all at work discussing what went on after they lost one other...\r<BR>\n\r<BR>\nThe first guy says, \"Man I was so trashed last night I went home and blew chunks!\"\r<BR>\n\r<BR>\nThe second goes, \"Shit that\'s nothing I was so tanked that I drove my damn car into a tree. Totaled it. I have no idea what the cops are going to do!\"\r<BR>\n\r<BR>\nThe third guy says, \"That\'s nothing I was so drunk that I went home and starting cussing my girlfriend out and in the process knocked over a candle and it caught the whole damn apartment on fire - the insurance won\'t cover it, plus my girlfriend left me.\"\r<BR>\n\r<BR>\nThe first guy leans back in and whispers, \"I don\'t think you guys understand, Chunks is my dog.\"',NULL,2.50,4,573,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (155,3,'Snail Beer','A snail goes into a bar and orders a beer.\r<BR>\n\r<BR>\nThe barman says \'Sorry we don\'t serve snails\' and throws him out.\r<BR>\n\r<BR>\nA couple of weeks later the snail goes into the bar again and says...\r<BR>\n\'What did you do that for!\'',NULL,0.00,NULL,397,1,1,1,'',NULL,NULL);
