INSERT INTO `jokes` VALUES (204,3,'The Golden Toilet','There was this guy, let\'s call him bob. One night Bob went to about 5 bars, and he drank, like, 17 beers.\r<BR>\n\r<BR>\nAfter he was done with that, like any normally functioning person, he really had to go. So he asked the bartender where the bathroom was, and he went to where he thought it was.\r<BR>\n\r<BR>\nLater that night, Bob was laying in bed trying to go to sleep, and he was thought, \"wait a minute.. there was a golden toilet!!\" Right then he got up and went out to find the special toilet. He had hit 5 bars that night, so he went to the first one, asked where the bathroom was, when he went and looked, there was no golden toilet.\r<BR>\n\r<BR>\nThis continued until he got to the last bar, he was really tired by then, and rather then going to look for the toilet himself, he asked the bartender, \"do you by any chance have a golden toilet here?\" and the bartender said to another person that was there, \"hey! I think I found the guy who crapped in the tuba!!!\"',NULL,0.00,NULL,455,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (395,4,'Pronounce it please!','Two tourists were driving through Louisiana. As they were approaching Natchitoches, they started arguing about the pronunciation of the town. They argued back and forth until they stopped for lunch. \r<BR>\n\r<BR>\nAs they stood at the counter, one tourist asked the \"blonde\" employee: \"Before we order, could you please settle an argument for us? Would you please pronounce where we are at... VERY SLOWLY?\" \r<BR>\n\r<BR>\nThe blonde girl leaned over the counter and said...\r<BR>\n\"Burrrrrrrr, Gerrrrrrr, Kiiiiing\"',NULL,1.43,7,1152,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (396,4,'Show Me Your License','A police officer stops a blonde for speeding and asks her very nicely if he could see her license.\r<BR>\nShe replied in a huff, \"I wish you guys could get your act together. \r<BR>\n\r<BR>\nJust yesterday one of you takes away my license and then today you expect me to show it to you!!\"',NULL,0.50,2,958,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (400,4,'The Blonde and the Alligator','A young blonde was on vacation in the depths of Louisiana. She wanted a pair of genuine alligator shoes in the worst way, but was very reluctant to pay the high prices the local vendors were asking.\r<BR>\n\r<BR>\nAfter becoming very frustrated with the \"no haggle\" attitude of one of the shopkeepers, the blonde shouted, \"Maybe I\'ll just go out and catch my own alligator so I can get a pair of shoes at a reasonable price!\"\r<BR>\n\r<BR>\nThe shopkeeper said, \"By all means, be my guest. Maybe you\'ll luck out and catch yourself a big one!\"\r<BR>\n\r<BR>\nDetermined, the blonde turned and headed for the swamps, set on catching herself an alligator.\r<BR>\n\r<BR>\nLater in the day, the shopkeeper is driving home when he spots the young woman standing waist deep in the water, shotgun in hand. \r<BR>\n\r<BR>\nJust then, he sees a huge 9 foot alligator swimming quickly toward her.\r<BR>\n\r<BR>\nShe takes aim, kills the creature and with a great deal of effort hauls it on to the swamp bank. Laying nearby were several more of the dead creatures.\r<BR>\n\r<BR>\nThe shopkeeper watches in amazement. Just then the blonde flips the alligator on it\'s back, and frustrated, shouts out, \"This one isn\'t wearing any shoes either!\"',NULL,1.00,1,576,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (422,4,'The Y2K Blonde!','Blonde secretary\'s memo to her boss:\r<BR>\n\r<BR>\nTO: My Boss\r<BR>\nFROM: Blondie\r<BR>\nSUBJECT: Changing Calendars For Y2K\r<BR>\n\r<BR>\nI hope that I haven\'t misunderstood your instructions because, to be honest, none of this Y to K problem made much sense to me. At any rate, I have finished the conversion of all of the months on all the company calendars for you. The calendars have returned from the printer and are ready to be distributed with the following new months:\r<BR>\n\r<BR>\nJanuark\r<BR>\nFebruark\r<BR>\nMak\r<BR>\nJulk\r<BR>\n\r<BR>\nI also changed all the days of each week to:\r<BR>\n\r<BR>\nSundak\r<BR>\nMondak\r<BR>\nTuesdak\r<BR>\nWednesdak\r<BR>\nThursdak\r<BR>\nFridak\r<BR>\nSaturdak\r<BR>\n\r<BR>\nWe are now Y to K compliant.\r<BR>\nYour loyal secretary!',NULL,2.50,4,682,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (423,4,'Tracks In The Woods','Three blondes were walking through the woods when they came upon a set of tracks.\r<BR>\n\r<BR>\n\"Looks like deer tracks\", said one blonde.\r<BR>\n\r<BR>\n\"No, it looks like maybe a cow track,\" another blonde suggested.\r<BR>\n\r<BR>\n\"Actually, I think they are just dog tracks,\" the third blonde offered.\r<BR>\n\r<BR>\nThey were still arguing when the train hit them!',NULL,0.00,NULL,464,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (424,4,'Trip To The Desert','A red-head, a brunette, and a blonde went on a trip to the desert. They each brought one item for survival.\r<BR>\n\r<BR>\nThe red-head brought water. The blonde asked, \"Why?\" The red-head replied, \"To prevent us from dying of thirst.\"\r<BR>\n\r<BR>\nThe brunette brought food. The blonde asked, \"Why?\" The brunette replied, \"To prevent us from dying of hunger.\"\r<BR>\n\r<BR>\nThe blonde brought a car door. The red-head and brunette asked, \"Why?\" The blonde replied, \"To roll down the window if it gets hot.\"',NULL,1.67,3,536,1,1,0,'',NULL,NULL);
