INSERT INTO `jokes` VALUES (667,5,'A little corporate humor','I took some friends out to dinner last week, and I noticed a spoon in the shirt pocket of our waiter as he handed us the menus. It seemed a little odd, but I dismissed it as a random thing. Until our busboy came with water & tableware; he too, sported a spoon in his breast pocket. I looked around the room, and all the waiters, waitresses, busboys, etc. had spoons in their pockets.\r\n\r\nWhen our waiter returned to take our order, I just had to ask, \"Why the spoons?\"\r\n\r\n\"Well,\" he explained, \"our parent company recently hired some Andersen\r\nConsulting efficiency experts to review all our procedures, and after\r\nmonths of statistical analyses, they concluded that our patrons drop\r\nspoons on the floor 73% more often than any other utensil; at a frequency of 3 spoons per hour per workstation. By preparing all our workers for this contingency in advance, we can cut our trips to the kitchen down and save time...nearly 1.5 extra man-hours per shift. \r\nJust as he concluded, a \"ch-ching\" came from the table behind him, and he quickly replaced a fallen spoon with the one from his pocket.\r\n\"I\'ll grab another spoon the next time I\'m in the kitchen instead of\r\nmaking a special trip,\" he proudly explained.\r\nI was impressed. \"Thanks. I had to ask.\"\r\n\"No problem,\" he answered, then he continued to take our orders.\r\n\r\nAs the members of my dinner party took their turns, my eyes darted\r\nback & forth from each person ordering and my menu. That\'s when, out of the corner of my eye, I spotted a thin, black thread protruding from our waiter\'s fly. Again, I dismissed it; yet I had to scan the room and, sure enough, there were other waiters & busboys with strings hanging out of their trousers.\r\nMy curiosity overrode discretion at this point, so before he could leave I had to ask. \"Excuse me, but...uh...why, or what...about that string?\"\r\n\"Oh, yeah\" he began in a quieter tone. \"Not many people are that observant. That same efficiency group found we could save time in the Men\'s room, too.\" \"How\'s that, I asked?\"\r\n\"You see, by tying a string to the end of our, eh. . ., selves, we can\r\npull it out at the urinals literally hands-free and thereby eliminate\r\nthe need to wash our hands, cutting time spent in the restroom by over\r\n93%!\" \"Oh, that makes sense,\" I said, but then thinking through the\r\nprocess, I asked, \"Hey, wait a minute. If the string helps you pull it out, how do you get it back in?\"\r\n\r\n\"Well,\" he whispered, \"I don\'t know about the other guys; but I use\r\nthe spoon in my pocket\"!',NULL,3.00,2,759,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (669,5,'Height Problems','A lady had a height problem - she was TOO tall, being excatly 2 meters tall. She hated the way she had to duck to walk through a doorway, the way she felt so uncomfortable in a car... So she visited an expert. The expert said:\r\n\r\n\"Go visit the Dwarven Town. It\'s full of dwarfs. Find any dwarf, and ask him if he\'ll marry you. Every time a dwarf says \'no,\' you grow 10 cm shorter!\"\r\n\r\nThe lady did as she was told. She went to the Dwarven Town, and found a dwarf, and asked if he would marry her. He refused. She found herself 10 cm shorter. She quickly repeated this act another time on another dwarf. Now 180 cm tall, she decided to ask one more dwarf then go home. She boldly walked up to a dwarf and asked if he would marry her. The dwarf replied:\r\n\r\n\"No, no, no, no, no...! I don\'t want to marry a tall person like you!\r\nYou\'re too tall! No, no, no, no, no!\"',NULL,1.00,1,682,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (672,5,'Lost Fingers','A man working at a lumberyard is pushing a tree through a saw when he accidentally shears off all then of his fingers. He rushes to the emergency romm of a nearby hospital where the awaiting doctor takes a look and says, \"Yuck! Well, give me the fingers and I\'ll see what I can do.\"\r\n\r\n\"I haven\'t got the fingers.\"\r\nThe doctor says, \"What do you mean, you haven\'t got the fingers? This is the age of medical advances. We\'ve got microsurgery and all sorts of incredible techniques! Why didn\'t you bring me the fingers?\"\r\n\r\n\"Well, heck, doctor. I tried, but I couldn\'t pick \'em up!\"',NULL,0.33,3,2385,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (673,5,'New Suit','The widow takes a look at her dear departed one right before the funeral and, to her horror, finds that he\'s in his brown suit. She\'d specifically said to the undertaker that she wanted him buried in his blue suit; she\'d brought it especially for that occasion, and she was distressed that the mortician had left him in the same brown suit he\'d been wearing when the lightning bolt hit him.\r\n\r\nShe demanded that the corpse be changed into the blue suit she\'d brought especially for that purpose.\r\n\r\nThe undertaker said, \"But madam! It\'s only a minute or two until the funeral is scheduled to begin! We can\'t possibly take him out and get him changed in that amount of time.\"\r\n\r\nThe lady said, \"Who\'s paying for this?\"\r\n\r\nSeeing the logic to this argument, a very reluctant mortician wheeled the coffin out, but then wheeled it right back in a moment later. Miraculously, the corpse was in a blue suit.\r\n\r\nAfter the ceremony, a well-satisfied widow complimented the undertaker on the smooth and speedy service. She especially wanted to know how he\'d been able to get her husband into a blue suit so fast.\r\n\r\nThe funeral director said, \"Oh, it was easy. It happens that there was another body in the back room and he was already dressed in a blue suit. All we had to do was switch heads!\"',NULL,3.00,NULL,241,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (674,5,'OUCH!','Knock Knock\r\nWho\'s there?\r\nMadam\r\nMadam who?\r\nMADAM FOOTS STUCK IN THE DOOR!',NULL,0.00,NULL,152,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (675,5,'Pirate and Lost Body Parts','A seaman meets a pirate in a bar, and talk turns to their adventures on the sea. The seaman notes that the pirate has a peg-leg, an hook, and an eye patch. \r\n\r\nThe seaman asks, \"So, how did you end up with the peg-leg?\"\r\n\r\nThe pirate replies \"We were in a storm at sea, and I was swept over board into a school of sharks. Just as my men were pulling me out, a shark bit my leg off.\"\r\n\r\n\"Wow!\" said the seaman. \"What about your hook\"?\r\n\r\n\"Well...\", replied the pirate, \"We were boarding an enemy ship and were battling the other sailors with swords when one of the enemy cut my hand off.\"\r\n\r\n\"Incredible!\" remarked the seaman. \"How did you get the eye patch\"?\r\n\r\n\"A seagull dropping fell into my eye.\", replied the pirate.\r\n\r\n\"You lost your eye to a seagull dropping?\" the sailor asked increduously.\r\n\r\n\"Well...\", said the pirate, \"..it was also my first day with the hook.\"',NULL,0.00,NULL,148,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (676,5,'Preparing for a Mammogram','The Mammogram\r\n\r\nThis is an x-ray that has its own name because no one wants to actually say the word breast. Mammograms require your breasts to do gymnastics. If you have extremely agile breasts, you should do fine. Most breasts however, pretty much hang around doing nothing in particular so they are woefully unprepared. But you can prepare for a mammogram right at home using these simple exercises:\r\n\r\n1. Refrigerate two bookends overnight. Lay one of your breasts (either will do) beetween the two bookends and smash the bookends together as hard as you can. Repeat three times daily.\r\n\r\n2. Locate a pasta maker or old wringer washer. Feed the breast into the machine and start cranking. Repeat twice daily.\r\n\r\n3. (Advanced) Situate yourself comfortably on your side on the garage floor. Place one of your breasts snugly behind the rear tire of the family van. When you give the signal, hubby will slowly ease the car into reverse. Hold for five seconds. Repeat on the other side.',NULL,4.00,NULL,1248,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (677,5,'Riddle me this!','Take the test...NO CHEATING!\r\n\r\nWhat does:\r\nA woman do sitting down?\r\nA man do standing up?\r\nA dog do on three legs?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\nGot your guess ready yet?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\nGET YOUR MIND OUR OF THE GUTTER!\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\nThey shake hands!',NULL,0.00,NULL,147,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (678,5,'Smarter','This is not only philosophical but is obviously pure science.\r\n\r\nA herd of buffalo can move only as fast as the slowest buffalo, and when the herd is hunted, it is the slowest and weakest ones at the back that are killed first.\r\n\r\nThis natural selection is good for the herd as a whole, because the general speed and health of the whole group keeps improving by the regular culling of the weakest members. \r\n\r\nIn much the same way the human brain can only operate as fast as the slowest brain cells. Excessive intake of alcohol, we all know, kills brain cells, but naturally it attacks the slowest and weakest brain cells first.\r\n\r\nIn this way regular consumption of beer eliminates the\r\nweaker brain cells, making the brain a faster and more efficient machine. So that\'s why you always feel smarter after a few beers.',NULL,0.00,NULL,162,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (679,5,'The snoring stopper!','A man has a dog that snores in his sleep. Annoyed, because she can\'t sleep, his wife goes to the vet to see if he can help. The vet tells the woman to tie a ribbon around the dog\'s testicles and he will stop snoring.\r\n\r\nA few hours after going to bed, the dog is snoring as usual. Finally, unable to sleep, she goes to the closet and grabs a piece of ribbon and ties it around the dog\'s testicles, and sure enough, the dog stops snoring. The woman is amazed!\r\n\r\nLater that night, her husband returns home drunk from being out with his buddies. He climbs into bed, falls asleep, and begins snoring very loudly. The woman thinks maybe the ribbon will work on him. So she goes to the closet again, grabs a piece of ribbon, and ties it around her husband\'s testicles. Amazingly, it also works on him!\r\n\r\nThe woman sleeps very soundly.\r\nThe next morning, the husband wakes up very hung over.\r\nHe tumbles into the bathroom to urinate. As he is standing in front of the toilet, he looks in the mirror and sees a blue ribbon attached to his privates.\r\n\r\nHe is very confused, and, as he walks back into the bedroom, he notices a red ribbon attached to his dog\'s testicles.\r\n\r\nHe shakes his head, looks down at the dog and says:\r\n\"Boy, don\'t remember where we were or what we did, but, by God, we got first and second place!\"',NULL,0.00,NULL,155,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (682,5,'The Poo List!','The Ghost Poo:\r\nThe kind where you feel poo come out, see poo on the toilet paper, but there\'s no poo in the bowl. \r\n\r\nThe Clean poo -\r\nThe kind where you feel poo come out, see poo in the bowl, but theres no poo on the toilet paper.\r\n\r\nThe Wet Poo-\r\nYou wipe your butt fifty times and it still feels unwiped. So you end up putting toilet paper between your butt and your underwear so you don\'t ruin them with those dreadful skid marks.\r\n\r\nThe Wet Cheeks Poo-\r\nThat\'s the kind that comes out of your butt so fast that your butt cheeks get splashed with the toilet water, or splash-back. \r\n\r\nThe Second Wave Poo-\r\nThis poo happens when you think you\'ve finished, your pants are up to your knees, and you suddenly realize you have to poo some more.\r\n\r\nThe Brain Haemorrhage-through-your-nose Poo-\r\nYou have to strain so much to get it out that you turn purple and practically have a stroke.\r\n\r\nThe Lincoln Log Log-\r\nThe kind of poo that\'s so enormous you\'re afraid to flush it down without first breaking it up into little pieces with the toilet brush. \r\n\r\nThe Power Dump Poo-\r\nThe kind that comes out so fast, you\'ve barely got your pants down and you\'re done. \r\n\r\nThe Liquid Plumber Poo-\r\nThis kind of poo is so big it plugs up the toilet and it overflows all over the floor. You should have followed the advice from the Lincoln Log Poo.\r\n\r\nThe Spinal Tap Poo-\r\nThe kind of poo that hurts so much coming out, you\'d swear it\'s got to be coming out sideways.\r\n\r\nThe \'I-think-I\'m-turning-into-a-bunny\' Poo-\r\nWhen you drop lots of cute, little round ones that look like marbles and make tiny splishy sounds when they hit the water.\r\n\r\nThe \'What-the-hell-died-in-here\' Poo-\r\nAlso sometimes referred to as The Toxic Dump. Of course you don\'t warn anyone of the poisonous bathroom odour. Instead, you stand innocently near the door and enjoy the show as they run out a-gagging and a-gasping for air.\r\n\r\nThe \'I-just-know-there\'s-a-turd-still-dangling-there\' Poo-\r\nWhere you just sit there patiently and wait for the last cling-on to drop.',NULL,0.00,NULL,161,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (685,6,'Technological Doctor','One day, a man complained to his friend, \"My elbow really hurts, guess I should see a doctor.\"\r<BR>\r<BR>His friend said, \"Don\'t do that. There\'s a computer at the drug store that can diagnose anything quicker and cheaper than a doctor. Simply put in a sample of your urine, and the computer will diagnose your problem and tell you what you can do about it. And it only costs $10.00.\"\r<BR>\r<BR>The guy figured he had nothing to lose, so he filled a jar with a urine sample and went to the drug store. Finding the computer, he poured in the sample and deposited the $10.00. The computer started making some noise andvarious lights started flashing. After a brief pause, out popped a small slip of paper which read:\r<BR>You have tennis elbow.\r<BR>Soak your arm in warm water, avoid heavy labor.\r<BR>It will be better in two weeks.\r<BR>\r<BR>That evening while thinking how amazing this new technology was and how it would change medical science forever, he began to wonder if this computer could be fooled.\r<BR>\r<BR>He decided to give it a try. He mixed together some tap water, a stool sample from his dog, and urine samples from his wife and daughter. To top it off, he masturbated into the concoction. He went back to the drug store, located the computer, poured in thisample and deposited the $10.00. The machine again made the usual noises,flashedlights, and printed out the following analysis:\r<BR>Your tap water is too hard. Get a water softener.\r<BR>Your dog has ringworm. Bathe him with anti-fungal shampoo.\r<BR>Your daughter is using cocaine. Put her in a rehabilitation clinic. \r<BR>Your wife is pregnant....twin girls. They aren\'t yours. Get a lawyer.\r<BR>\r<BR>And.... if you don\'t stop jerking off, your elbow will never get better!',NULL,2.00,5,2563,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (686,6,'New Computer Virus','Did you hear about the new computer virus?\r<BR>It\'s called the \"Lorena Bobbit Virus\".\r<BR>Apparently, it turns your hard drive into a 3 1/2 inch floppy!',NULL,3.00,2,820,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (688,6,'Guide to Safe Fax','Q: DO I HAVE TO BE MARRIED TO HAVE SAFE FAX?\r<BR>A: Although married people fax quite often, there are many single people who fax complete strangers every day.\r<BR>\r<BR>Q: MY PARENTS SAY THEY NEVER HAD FAX WHEN THEY WERE YOUNG AND WERE ONLY ALLOWED TO WRITE MEMOS TO EACH OTHER UNTIL THEY WERE TWENTYONE. HOW OLD DO YOU THINK SOMEONE SHOULD BE BEFORE THEY CAN FAX?\r<BR>A: Faxing can be performed at any age, once you learn the correct procedure.\r<BR>\r<BR>Q: IF I FAX MYSELF, WILL I GO BLIND?\r<BR>A: Certainly not, as far as we can see.\r<BR>\r<BR>Q: THERE IS A PLACE ON OUR STREET WHERE YOU CAN GO AND PAY FOR FAX. IS THIS LEGAL?\r<BR>A: Yes. many people have no other outlet for their fax drives and Must pay a \"professional\" when their needs to fax become too great.\r<BR>\r<BR>Q: SHOULD A COVER ALWAYS BE USED FOR FAXING?\r<BR>A: Unless you are really sure of the one you\'re faxing, a cover sheet should be used to insure safe fax.\r<BR>\r<BR>Q: WHAT HAPPENS WHEN I INCORRECTLY DO THE PROCEDURE AND I FAX PREMATURELY?\r<BR>A: Don\'t panic. Many people prematurely fax when they haven\'t faxed in a long time. Just start Over; Most people won\'t mind if you try again. \r<BR>\r<BR>Q: I HAVE A PERSONAL AND BUSINESS FAX. CAN TRANSMISSIONS BECOME MIXED UP?\r<BR>A: Being bi-faxual can be confusing, but as long as you use a cover with each one, you won\'t transmit anything You\'re not supposed to.',NULL,3.33,3,511,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (692,6,'Computers - Male or Female','Humankind\'s propensity for imposing anthropomorphic characteristics on inanimate objects has now reached computers. But, which gender should your PC be?\r<BR><BR>\r<BR><BR>Here are the top ten reasons why they have to be male.\r<BR><BR>\r<BR><BR>They have a lot of data, but they\'re still clueless.\r<BR><BR>A better model is just around the corner.\r<BR><BR>They look nice and shiny until you get them home.\r<BR><BR>It\'s always essential to have a backup.\r<BR><BR>They\'ll do whatever you want if you push the right buttons.\r<BR><BR>The best part of having one is the games you can play.\r<BR><BR>In order to get their attention, you have to turn them on.\r<BR><BR>The lights are on but nobody\'s home.\r<BR><BR>Big power surges knock them out at night.\r<BR><BR>Size does matter.\r<BR><BR>\r<BR><BR>But then again, here are the top ten reasons why they are obviously female.\r<BR><BR>\r<BR><BR>They\'re oh so picky, picky, picky.\r<BR><BR>They hear what you say, but not what you mean.\r<BR><BR>Beauty is only shell deep.\r<BR><BR>When you ask them what\'s wrong, they always say \'nothing\'.\r<BR><BR>They can produce incorrect results with alarming speed. \r<BR><BR>They are always turning simple statements into big productions.\r<BR><BR>Small talk is important.\r<BR><BR>You do the same thing for years, and suddenly it\'s wrong.\r<BR><BR>They make you take the garbage out.\r<BR><BR>Miss a period and they go wild.',NULL,3.00,2,628,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (693,6,'3 times a virgin.','A woman had been married three times and was still a virgin. Somebody asked her how that could be possible.\r<BR>\r<BR>\"Well,\" she said. \"The first time I married an octogenarian and he died before we could consummate the marriage.\"\r<BR>\r<BR>\"The second time I married a naval officer and war broke out on our wedding day.\"\r<BR>\r<BR>\"The third time I married a Microsoft Windows programmer and he just sat on the edge of the bed and kept telling me how good it was going to be.\"',NULL,0.33,3,583,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (784,8,'Love the Dentist Quote','I love to go to the dentist. A man in white hovering over me while I\'m trapped helpless in a chair.\r<BR>\nHe cleans me.\r<BR>\nHe flosses me.\r<BR>\nHis instruments alive in my mouth.\r<BR>\n\r<BR>\nAnd just when I don\'t think I can take it anymore, he says, \'Good girl, Marcie, you can spit now.\'\r<BR>\n- Marcie, from the \"Married With Children\" sitcom.',NULL,0.25,4,1013,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (786,8,'Minding his manners','A man walked into a crowded doctor\'s office.\r<BR>\nAs he approached the desk, the receptionist asked, \"Yes sir, may we help you?\"\r<BR>\n\r<BR>\n\"There\'s something wrong with my dick,\" he replied.\r<BR>\n\r<BR>\nThe receptionist became aggravated and said, \"You shouldn\'t come into a crowded office and say things like that.\"\r<BR>\n\"Why not? You asked me what was wrong and I told you,\" he said.\r<BR>\n\r<BR>\n\"We do not use language like that here,\" she said. \"Please go outside and come back in and say that there\'s something wrong with your \'ear\' or whatever.\"\r<BR>\n\r<BR>\nThe man walked out, waited several minutes and reentered.\r<BR>\n\r<BR>\nThe receptionist smiled smugly and asked, \"Yes?\"\r<BR>\n\"There\'s something wrong with my \'ear\',\" he stated.\r<BR>\n\r<BR>\nThe receptionist nodded approvingly, \"And what is wrong with your ear, sir?\"\r<BR>\n\r<BR>\n\"I can\'t piss out of it,\" the man replied!',NULL,5.00,2,1244,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (798,8,'Perfect Girlfriend','I recently attended a meeting of the International Singles Club here in Silicon Valley. I met a Chinese woman who was a dentist.\r<BR>\n\r<BR>\nShe had perfect teeth, which started me thinking: All dentists from all cultures apparently have perfect teeth.\r<BR>\n\r<BR>\nSo, I am looking for a gynecologist for my next girlfriend!',NULL,0.00,NULL,516,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (800,8,'Restoring her youth!','After her fifth child, Lucy decided that she should have some cosmetic surgery \"down below\" to restore herself to her former youthful glory.\r<BR>\n\r<BR>\nTime and childbirth had taken its toll and she reckoned that, with five children now being the limit, she\'d tidy things with a nip here and a tuck there.\r<BR>\n\r<BR>\nFollowing the operation she awoke from her anaesthetic to find three roses at the end of the bed.\r<BR>\n\r<BR>\nWho are these from ?\" she asked the nurse, \"They\'re very nice but I\'m a bit confused as to why I\'ve received them.\"\r<BR>\n\r<BR>\n\"Well\" said the nurse, \"The first is from the surgeon - the operation went so well and you were such a model patient that he wanted to say thanks.\"\r<BR>\n\r<BR>\n\"Ahhh, thats really nice\" said Lucy.\r<BR>\n\r<BR>\n\"The second is from your husband - he\'s delighted the operation was such a success that he can\'t wait to get you home. Apparently it\'ll be the first time he\'s touched the sides for years and he\'s very excited!\"\r<BR>\n\r<BR>\n\"Brilliant!\" said Lucy. \"And the third?\"\r<BR>\n\r<BR>\n\"Thats from Eric in the burns unit\" said the nurse.\r<BR>\n\"He just wanted to say thanks for his new ears!\"',NULL,0.00,NULL,428,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (803,8,'Surgical Error','A man goes into the hospital for a vasectomy.\r<BR>\n\r<BR>\nShortly after he recovers from his an anesthetic, his surgeon comes in and tells him: \"Well, I\'ve got good news and I\'ve got bad news for you.\"\r<BR>\n\r<BR>\n\"Give me the bad news first, Doc.\" says the patient.\r<BR>\n\"I\'m afraid that we accidentally cut your balls off during surgery, son.\"\r<BR>\n\"Oh my god!\" the patient cries, breaking into tears.\r<BR>\n\"But the good news,\" the doctor adds, \"is that we had them biopsied and you\'ll be relieved to know that they weren\'t malignant!\"',NULL,1.00,2,470,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (881,10,'Halloween funnies for kids!','Q. Why don\'t witches like to ride their brooms when they\'re angry?\r\nA. They\'re afraid of flying off the handle!\r\n\r\nQ. Where do baby ghosts go during the day?\r\nA. Dayscare centers.\r\n\r\nQ. Who did Frankenstein take to the prom?\r\nA. His ghoul friend.\r\n\r\nQ. What do ghosts serve for dessert?\r\nA. I Scream.\r\n\r\nQ. What do witches put on their hair?\r\nA. Scare spray.\r\n\r\nQ. What do you get when you cross Bambi with a ghost?\r\nA. Bamboo.\r\n\r\nQ. What kind of mistakes do spooks make?\r\nA. Boo boos.\r\n\r\nQ. Why couldn\'t Dracula\'s wife get to sleep?\r\nA. Because of his coffin.\r\n\r\nQ. Why do mummies make excellent spies?\r\nA. They\'re good at keeping things under wraps.\r\n\r\nQ. Why wasn\'t there any food left after the monster party?\r\nA. Because everyone was a goblin!\r\n\r\nQ. How did the ghost patch his sheet?\r\nA. With a pumpkin patch.\r\n\r\nQ. What is as sharp as a vampires fang?\r\nA. His other fang.',NULL,0.00,NULL,140,1,1,1,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (882,10,'Pierced ears for pirates','How much do pirates pay to get their ears pierced?\r\n\r\nA Buccaneer!',NULL,0.00,NULL,186,1,1,1,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (885,10,'Why did the...','Q. Why did the male sheep fall off the cliff?\r\n\r\nA. He didn\'t see the Ewe turn!',NULL,0.00,NULL,191,1,1,1,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (887,10,'Will you rember me??','Hey bob,\"Will you rember me tomorrow??\"\r\n\"Yes\"\r\n\"Will you rember me next week??\"\r\n\"Yes\"\r\n\"Will you rember me next month??\"\r\n\"Yes\"\r\n\"Will yoiu rember me next year??\"\r\n\"Yeah\"\r\n\"Knock Knock\"\r\n\"Whos There??\"\r\n\"See, you forgot me already!!!!!!\"',NULL,0.00,NULL,174,1,1,1,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (889,10,'Yogi Bear','Q.Why is there only one Yogi Bear?\r\n\r\nA. Because when they tried to make another one, they made a Boo-Boo.',NULL,0.00,NULL,195,1,1,1,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (890,10,'Knock-Knocks 4 Kids Galore','Knock! Knock!\r\nWho\'s there?\r\nRita.\r\nRita who?\r\nRita book, you might learn something.\r\n\r\nKnock! Knock!\r\nWho\'s there?\r\nPolice.\r\nPolice who?\r\nPolice open the door, I\'m tired of knocking.\r\n\r\nKnock! Knock!\r\nWho\'s there?\r\nHenrietta.\r\nHenrietta who?\r\nHenrietta worm that was in his apple.\r\n\r\nKnock! Knock!\r\nWho\'s there?\r\nCarrie.\r\nCarrie who?\r\nCarrie on with what you\'re doing, I\'m at the wrong door.\r\n\r\nKnock! Knock!\r\nWho\'s there?\r\nAnita.\r\nAnita who?\r\nAnita drink of water.\r\n\r\nKnock! Knock!\r\nWho\'s ther?\r\nDwain.\r\nDwain who?\r\nDwain the bathtub, I\'m dwrowning.',NULL,0.00,NULL,134,1,1,1,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (891,10,'Throw Up!','Knock Knock.\r\nWho\'s there?\r\n\r\nStan\r\nStan who?\r\n\r\nStan back or I\'ll be sick on your shoe!!!!',NULL,0.00,NULL,187,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (892,10,'The lady and her house','A lady went to bed and turned out all the lights. Later she awoke and heard a crash, instantly she died of shock. What kind of house did she live in?\r\n\r\nA LIGHTHOUSE!!!',NULL,0.00,NULL,170,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (893,10,'The Boy Who Thinks He\'s A Chicken','Girl to Doctor: Doctor, Help! My brother thinks he\'s a chicken!\r\nDoctor: How long has this been going on?\r\n\r\nGirl: About a year.\r\nDoctor: Wow! Why didn\'t you tell me sooner?\r\n\r\nGirl: Because we needed the eggs!',NULL,0.00,NULL,156,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (894,10,'Orange and Banana','Knock Knock!\r\nWho\'s there?\r\nBanana!\r\nBanana who?\r\n\r\nKnock Knock!\r\nWho\'s there?\r\nBanana!\r\nBanana who?\r\n\r\nKnock Knock!\r\nWho\'s there?\r\nBanana!\r\nBanana who?\r\n\r\nKnock Knock!\r\nWho\'s there?\r\nOrange!\r\nOrange who?\r\n\r\nOrange you glad I didn\'t say Banana!',NULL,0.00,NULL,178,1,1,1,'1',NULL,NULL);
