INSERT INTO `jokes` VALUES (898,10,'Give the frog a loan','A frog walks into a bank and says \"I wanna loan.\" \r\n\r\n\"Well Mr.. frog, go over there to Mrs. Black\'s desk, she is the loan manager, I\'m sure she will be happy to talk to you,\" The head desk says. \r\n\r\nThe frog hops over to Mrs. Patty Black\'s desk and says, \"I wanna loan.\" \r\n\r\nMrs. Black says, \"Well Mr. Frog, we will have to get some paperwork for you to sign, so if you will wait right here...\" At this point the frog pulls out of his knapsack a golden disk and hands it over to her. \r\n\r\nShe asks, confused, \"What is this?\" \r\n\r\nThe frog croaks back, \"I wanna loan.\" She rubs her head, and walks back to her boss and says, \"I don\'t get it, a frog hops in here wanting a loan, and gives me this golden disk. Do you know what it is?\" \r\n\r\nThe boss laughs and says, \"It\'s a knick-knack Patty Black, give the frog a loan!\"',NULL,0.00,NULL,161,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (899,10,'Be A Smoker!','Good News To All Smokers\r\n\r\nThe International Tabacco Syndicate, on its Golden Anniversary, wishes to invite Smokers of all ages to join in its biggest Anniversary Sweepstakes Draw, where every smoker is a sure winner!\r\nAll smokers have the chance of winning the following major prizes.\r\n\r\nGrand Prizes: A Brand New Cancer, Bronchial Infection, Goiter, Sinusitis, Migraine, Cerebral Tumor, Paralysis, Hypertension, and Asthma\r\n\r\nSecond Prizes: Special Hepatitis, Meningitis, Bronchitis\r\n\r\nThird Prizes: Colored TB, Emphysema, Arteriosclerosis, Gingivitis, Rheumatism, Heart Disease, and Lung Cancer.\r\n\r\nYou can also have a chance to win consolation prizes such as:\r\nTartar Deposits, Bad Breath, Stained Teeth, Appetite Loss, and Swelled Gums.\r\n\r\nJoin now!!! Remember that the more sticks you puff, the more chances of easy winning. Fabulous prizes await you!!! You can also be a lucky winner! Please claim your prizes at the nearest funeral parlor.\r\n\r\nThis promo is a limited offer...\r\nSee your X-Ray result for more details!!!',NULL,0.00,NULL,149,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (900,10,'Bad boy','One day there was a boy at school and his teacher told him to get 4 spelling words. \r\n\r\n1st he went to his Brother and asked \"Could you give me a spelling word?\" His Brother answered \"ShutUp\" So he wrote down Shutup. \r\n\r\n2nd he went to his Mother and asked her. She answered \"Certainly\" He wrote down certinly. \r\n\r\n3rd he wen to his Dad and asked for somthing sweet. His dad answered Lolipop so he wrote down Lolipop. \r\n\r\n4th he went to his little brother and asked the question. He answered \"In my Little Blue Car\" \r\n\r\nThe next day he went to school and his teacher asked for the words. He said his 1st word Shutup. Then she asked \"Do you want to go to the principles office?\" He said is second word \"Certainly\". In the principals office the principal asked what do you think you deserve, the boy answered \"Lolipop!!\" Then the principal asked \"What do you think your punishment should be?\" The boy answered \"To go in my Little Blue Car!!!!\"',NULL,0.00,NULL,152,1,1,1,'1',NULL,NULL);
