INSERT INTO `jokes` VALUES (902,10,'ABCP','On day there was a boy at school. He needed to go to the toilet. The teacher said \"Say your ABCs first\" \r\n\r\nThe boy started saying \"A B C D E F G H I J K L M N O Q R S T U V W X Y Z\"\r\n\r\nThe teacher asked at the end \"Where is your P?\"\r\nThe boy answered \"Running down my pants!!\"',NULL,0.00,NULL,175,1,1,1,'1',NULL,NULL);
