INSERT INTO `jokes` VALUES (1107,11,'Men Are Like.......','Men are like....Laxatives. They irritate the shit out of you.\r\n\r\nMen are like....Bananas. The older they get, the less firm they are.\r\n\r\nMen are like ....Vacations. They never seem long enough.\r\n\r\nMen are like....Bank machines.Once they withdraw they lose interest.\r\n\r\nMen are like ....Weather. Nothing can be done about either one of them.\r\n\r\nMen are like....Blenders. You need one but your not quite sure why.\r\n\r\nMen are like....Cement. After getting laid, they take along time to get hard.\r\n\r\nMen are like....Chocolate Bars. Sweet,smooth, and they usually head right for your hips.\r\n\r\nMen are like....Coffee. The best ones are rich, warm and can keep you up all night long.\r\n\r\nMen are like....Commercials. You can\'t believe a word they say.\r\n\r\nMen are like....Department Stores. Their clothes should always be half off.\r\n\r\nMen are like....Government Bonds. They take so long to mature.\r\n\r\nMen are like....Horoscopes. They always tell you what to do and are usually wrong.\r\n\r\nMen are like....Lawn Mowers. If your not pushing one around, you\'re riding it.\r\n\r\nMen are like....Mascara. They usually run at the first sign of emotion.\r\n\r\nMen are like....Popcorn. They satisfy you, but only for a little while.\r\n\r\nMen are like ....Snowstorms. You never know when he\'s coming, how many inches you\'ll get or how long he will last.',NULL,0.00,NULL,149,1,1,3,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1108,11,'Men Are Like...','Men are like department stores.... their clothes should always be half off.\r\n\r\nMen are like vacations.... they never seem to be long enough.\r\n\r\nMen are like computers... hard to figure out and never have enough memory.\r\n\r\nMen are like coolers... load them with beer and you can take them anywhere.\r\n\r\nMen are like chocolate bars.... sweet, smooth, and they usually head right for your hips.\r\n\r\nMen are like coffee.... the best ones are rich, warm, and can keep you up all night long.\r\n\r\nMen are like horoscopes.... they always tell you what to do and are usually wrong.\r\n\r\nMen are like plungers... they spend most of their lives in a hardware store or the bathroom.\r\n\r\nMen are like cement.... after getting laid, they take a long time to get hard.',NULL,0.00,NULL,140,1,1,3,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1115,11,'Jokes for the Ladies!','Q: Why are married women heavier than single women?\r\nA: Single women come home, see what\'s in the fridge and go to bed. \r\nMarried women come home, see what\'s in bed and go to the fridge.\r\n\r\nQ: How many honest, intelligent, caring men in the world does it take to do the dishes?\r\nA: Both of them.\r\n\r\nQ: Why did the man cross the road?\r\nA: He heard the chicken was a slut.\r\n\r\nQ: Why don\'t women blink during foreplay?\r\nA: They don\'t have time.\r\n\r\nQ: Why does it take 1 million sperm cells to fertilize one egg?\r\nA: They won\'t stop to ask directions.\r\n\r\nQ: What do men and sperm have in common?\r\nA: They both have a one-in-a-million chance of becoming a human being.\r\n\r\nQ: How does a man show that he is planning for the future?\r\nA: He buys two cases of beer.\r\n\r\nQ: What is the difference between men and government bonds?\r\nA: The bonds mature.\r\n\r\nQ: Why are blonde jokes so short?\r\nA: So men can remember them.\r\n\r\nQ: How many men does it take to change a roll of toilet paper?\r\nA: We don\'t know; it has never happened.\r\n\r\nQ: Why is it difficult to find men who are sensitive, caring and good looking?\r\nA: They all already have boyfriends.\r\n\r\nQ: What do you call a woman who knows where her husband is every night?\r\nA: A Widow.\r\n\r\nQ: How did Pinocchio find out he was made of wood?\r\nA: His hand caught fire.\r\n\r\nQ: How do you get a man to do sit-ups?\r\nA: Put the remote control between his toes.\r\n\r\nQ: What did God say after creating Adam?\r\nA: I must be able to do better than that.\r\n\r\nQ: What did God say after creating Eve?\r\nA: \"Practice makes perfect.\"\r\n\r\nQ: How are men and parking spots alike?\r\nA: Good ones are always taken. Free ones are mostly handicapped or extremely small.\r\n\r\nQ: What is the one thing that all men at singles bars have in common?\r\nA: They are married.\r\n\r\nMan says to God: \"God, why did you make woman so beautiful?\"\r\nGod says: \"So you would love her.\"\r\n\"But God,\" the man says, \"why did you make her so dumb?\"\r\nGod says: \"So she would love you.\"',NULL,0.00,NULL,147,1,1,3,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1259,13,'Sound Dirty In Law But Aren\'t:','Things That Sound Dirty In Law But Aren\'t...\r<BR>\n\r<BR>\nHave you looked through her briefs?\r<BR>\nHe is one hard judge!\r<BR>\nCounselor, let\'s do it in chambers.\r<BR>\nHis attorney withdrew at the last minute.\r<BR>\nIs it a penal offense?\r<BR>\nBetter leave the handcuffs on.\r<BR>\nFor $200 an hour, she better be good!\r<BR>\nCan you get him to drop his suit?\r<BR>\nThe judge gave her the stiffest one he could.\r<BR>\nThink you can get me off?',NULL,1.50,2,574,1,1,0,'',NULL,NULL);
