INSERT INTO `jokes` VALUES (1264,13,'Gigolo','Q. What\'s the difference between a lawyer and a gigolo?\r<BR>\nA. A gigolo only screws one person at a time.',NULL,0.00,NULL,409,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1266,13,'Courtroom Chaos','A man accused of robbing a bank was tried for the final time and was found guilty. Just before he was taken away, the man looked the judge in the eye and said, \"Would it be okay if I called you a son of a bitch?\"\r\n\r\nThe judge\'s face went red and he roared, \"It most certainly would not! I\'d add another two years onto your sentence!\"\r\n\r\nThe defendant nodded and then asked, \"Would it be okay if I THOUGHT you were a son of a bitch?\"\r\n\r\nThe judge was becoming very annoyed but replied, \"Yes, I suppose that would be okay. I obviously have no control over your thoughts.\"\r\n\r\nThe defendant smiled and said, \"Well, in that case, judge, I think you are a son of a bitch!\"',NULL,0.00,NULL,413,1,1,2,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1268,13,'Explaination','A grade school teacher was asking students what their parents did for a living. \"Tim, you be first,\" she said. \"What does your mother do all day?\" Tim stood up and proudly said, \"She\'s a doctor.\"\r<BR>\n\r<BR>\n\"That\'s wonderful. How about you, Amie?\"\r<BR>\n\r<BR>\nAmie shyly stood up, scuffed her feet and said, \"My father is a mailman.\"\r<BR>\n\r<BR>\n\"Thank you, Amie,\" said the teacher. \"What about your father, Billy?\"\r<BR>\n\r<BR>\nBilly proudly stood up and announced, \"My daddy plays piano in a whorehouse.\"\r<BR>\n\r<BR>\nThe teacher was aghast and promptly changed the subject to geography. Later that day she went to Billy\'s house and rang the bell. Billy\'s father answered the door. The teacher explained what his son had said and asked if there might be some logical explanation. \r<BR>\n\r<BR>\nBilly\'s father said, \"I\'m actually an attorney. But how can I explain a thing like that to a seven-year-old?\"',NULL,2.50,2,725,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1269,13,'Getting a date.','There was a loser who couldn\'t get a date. He went to a bar and asked this one guy how to get a date. The guy said, \"It\'s simple. I just say, I\'m a lawyer.\"\r<BR>\n\r<BR>\nSo the guy went up to a pretty woman and asked her out. After she said \"No,\" he told her that it was probably a good thing because he had a case early in the morning.\r<BR>\nShe said, \"Oh!!!! Your a lawyer?\"\r<BR>\nHe said, \"Why,... Yes I am!\"\r<BR>\n\r<BR>\nSo they went to his place and when they were in bed, screwing, he started to laugh to himself. When she asked what was so funny, he answered,\r<BR>\n\"Well, I\'ve only been a lawyer for 15 minutes, and I\'m already screwing someone!\"',NULL,0.00,NULL,362,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1274,13,'The 12 marriages!','A lawyer got married to a woman who had previously been married 12 times. On their wedding night, they settled into the bridal suite at their hotel and the bride said to her new groom, \"Please, promise to be gentle. I am still a virgin.\"\r\n\r\nThis puzzled the groom, since after 12 marriages, he thought that at least one of her husbands would have been able to perform. He asked his new bride to explain the phenomenon.\r\n\r\nShe responded:\r\n\r\nMy first husband was a Sales Representative who spent our entire marriage telling me, in grandiose terms, \'It\'s gonna be great!\'\r\n\r\nMy second husband was from Software Services; he was never quite sure how it was supposed to function, but he said he would send me documentation.\r\n\r\nMy third husband was from Field Services and constantly said that everything was diagnostically OK, but he just couldn\'t get the system up.\r\n\r\nMy fourth husband was from Educational Services, and he simply said, Those who can, do; those who can\'t, teach.\r\n\r\nMy fifth husband was from the Telemarketing Department and said that he had the orders, but he wasn\'t quite sure when he was going to be able to deliver.\r\n\r\nMy sixth husband was an Engineer. He told me that he understood the basic process but needed three years to research, implement, and design a new state-of-the-art method.\r\n\r\nMy seventh husband was from Finance and Administration. His comments were that he knew how, but he just wasn\'t sure whether it was his job.\r\n\r\nMy eighth husband was from Standards and Regulations and told me that he was up to the standards but that regulations said nothing about how to do it.\r\n\r\nMy ninth husband was a Marketing Manager. He said, \'I know I have the product. I\'m just not sure how to position it.\'\r\n\r\nMy tenth husband was a psychiatrist, and all he ever wanted to do was talk about it.\r\n\r\nMy eleventh husband was a gynecologist, and all he ever wanted to do was look at it.\r\n\r\nMy twelfth husband was a stamp collector, and all he ever wanted to do was -- God I miss him!\r\n\r\nSo now I have married a lawyer, so I know I\'m going to get screwed!',NULL,0.50,2,531,1,1,2,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1275,13,'The stranded lawyers!','Two lawyers had been stranded on a deserted island for several months.<br><br>\nThe only other thing on the island was the tall coconut tree, that provided them their food. Each day, one of the lawyers climbed to the top of the tree, to see if he could see a rescue boat coming.<br><br>\n<br><br>\nOne day, the lawyer yelled down from the tree, \"Wow! I can\'t believe my eyes! I don\'t believe this is true!\" The lawyer on the ground was skeptical and said, \"I think you\'re hallucinating and you should come down right now.\"<br><br>\n<br><br>\nSo, the lawyer reluctantly climbed down the tree and told his friend that he had just seen a naked blonde woman floating face up headed toward their island.<br><br>\n<br><br>\nThe other lawyer started to laugh, thinking his friend had surely lost his mind. But, within a few minutes, up to the beach floated a naked blonde woman, face up, totally unconscious.<br><br>\n<br><br>\nThe two lawyers went over to her and one said to the other, \"You know, we\'ve been on this island for months now without a woman. It\'s been a long time...do you think we should....you know..... screw her?\"<br><br>\n<br><br>\nThe other lawyer glanced down at the totally naked woman and asked...<br><br>\n\"Out of what?\"',NULL,1.00,1,405,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1276,13,'Virgin','A mature woman was in the pastorial study counseling for her upcoming fourth wedding.\r\n\r\n\"Father, how am I going to tell my husband that I am still a virgin?\"\r\n\r\n\"My child, you have been a married woman for many years. Surely that cannot be.\"\r\n\r\n\"Well, father, my first husband was a psychologist, and all he wanted to do was talk, and the next one was in construction and he always said he\'d get to it tomorrow.\r\n\r\nThe last one was a gynecologist and all he did was look. But this time, father, I\'m marrying a lawyer and I\'m sure I\'m going to get screwed!\"',NULL,0.00,NULL,470,1,1,2,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1278,13,'Actual Court Sayings!','30 things people actually said in court\r\n\r\nQuestion 1.\r\nQ: What is your date of birth?\r\nA: July 15th\r\nQ: What year?\r\nA: Every year.\r\n\r\nQuestion 2.\r\nQ: What gear were you in the moment of impact?\r\nA: Gucci sweets and Reeboks.\r\n\r\nQuestion 3.\r\nQ: This myasthenia gravis, does it affect your memory\r\nA: Yes.\r\nQ: And in what ways does it affect your memory?\r\nA: I forget.\r\nQ: You forget. Can you give us an example of something that you have forgotten?\r\n\r\nQuestion 4.\r\nQ: How old is your son, the one living with you?\r\nA: 38 or 35, I can\'t remember which.\r\nQ: How long has he lived with you?\r\nA: 45 years\r\n\r\nQuestion 5.\r\nQ: What was the first thing your husband said to you when he woke that morning?\r\nA: He said \"Where am I, Cathy?\"\r\nQ: And why did that upset you?\r\nA My name is Susan.\r\n\r\nQuestion 6.\r\nQ: And where was the location of the accident?\r\nA: Approximatly milepost 499.\r\nQ: And where is milepost 499?\r\nA: Probably between milepost 498 and 500.\r\n\r\nQuestion 7.\r\nQ: Sir, What is your IQ?\r\nA: Well, I can see pretty well, I think.\r\n\r\nQuestion 8.\r\nQ: Did you blow your horn or anything?\r\nA: After the accident?\r\nQ: Before the accident.\r\nA: Sure, I played for ten years. I even went to school for it.\r\n\r\nQuestion 9.\r\nQ: Do you know if your daughter has ever been involved in voodoo or the occult?\r\nA: We both do.\r\nQ: Voodoo?\r\nA: We do.\r\nQ: You do?\r\nA: Yes, Voodoo.\r\n\r\nQuestion 10.\r\nQ: Trooper, when you stopped the defendent, were you red and blue lights flashing?\r\nA: Yes\r\nQ: Did the defendent say anything when she got out of her car?\r\nA: Yes sir\r\nQ: What did she say?\r\nA: What disco am I at?\r\n\r\nQuestion 11.\r\nQ: Now doctor, isnt it true that when a person dies in his sleep, he doesnt know about it until the next morning?\r\n\r\nQuestion 12.\r\nQ: The youngest son, the 22 year old, how old is he?\r\n\r\nQuestion 13.\r\nQ: Were you present when your picture was taken?\r\n\r\nQuestion 14.\r\nQ: Was it you or your younger brother who was killed in the war?\r\n\r\nQuestion 15.\r\nQ: Did he kill you?\r\n\r\nQuestion 16.\r\nQ: How far apart were the vehicles at the time of collision?\r\n\r\nQuestion 17.\r\nQ: You were there until the time you left, is that true?\r\n\r\nQuestion 18.\r\nQ: How many times have you committed suicide?\r\n\r\nQuestion 19.\r\nQ: So the date of conception (of the baby) was August 8th?\r\nA: Yes.\r\nQ: What were you doing at the time?\r\n\r\nQuestion 20.\r\nQ: She had three children right?\r\nA: Yes.\r\nQ: How many were boys?\r\nA: none.\r\nQ: Were there any girls?\r\n\r\nQuestion 21.\r\nQ: You say the stairs went down to the basement?\r\nA: yes\r\nQ: And these stairs, did they go up also?\r\n\r\nQuestion 22.\r\nQ: Mr. Slatery, you went on a rather eleborate honeymoon, didnt you?\r\nA: I went to Europe, Sir.\r\nQ: And you took your new wife?\r\n\r\nQuestion 23.\r\nQ: How was your first marriage terminated?\r\nA: By death.\r\nQ: And by whose death was it terminated?\r\n\r\nQuestion 24.\r\nQ: Is your appearance here this morning pursuant to a deposition notice which I sent to your attorney?\r\nA: No, this is how I dress when I go to work.\r\n\r\nQuestion 25.\r\nQ: Can you describe the individual?\r\nA: He was about medium height and had a beard.\r\nQ: Was this a male or female?\r\n\r\nQuestion 26.\r\nQ: Doctor how many autopsies have you performed on dead people?\r\nA: All my autopsies are performed on dead people.\r\n\r\nQuestion 27.\r\nQ: All your responses must be oral, OK,? What school did you go to?\r\nA: Oral\r\n\r\nQuestion 28.\r\nQ: Do you recall the time you examined the body?\r\nA: The autopsy started around 8:30 p.m.\r\nQ: And Mr. Dennington was dead at the time?\r\nA: No, he was sitting on the table wondering why I was doing an autopsy.\r\n\r\nQuestion 29.\r\nQ: Are you qualified to give a urine sample?\r\n\r\nQuestion 30.\r\nQ:Doctor, before you performed the autopsy, did you check for a pulse? \r\nA: No.\r\nQ: Did you check for blood pressure?\r\nA: No.\r\nQ: Did you check for breathing?\r\nA: No.\r\nQ: So it was possible that the patient was alive when you began the autopsy?\r\nA: No.\r\nQ: How can you be so sure, Doctor?\r\nA: Because his brains was sitting on my desk in a jar.\r\nQ: But could the patien have still been alive nevertheless?\r\nA: It is possible that he could have been alive and practicing law somewhere.',NULL,0.00,NULL,366,1,1,1,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1280,13,'Laws of Life','Katz\'s Law:<br>\nMen and women will act rationally towards each other only after all other possibilities have been exhausted.<br>\n<br>\nChurchill\'s Commentary on Man:<br>\nMan will occasionally stumble over the truth, but most of the time he will pick himself up and continue on.<br>\n<br>\nSattinger\'s Law:<br>\nIt works better if you plug it in.<br>\n<br>\nCahn\'s Axiom (aka Alien\'s Axiom):<br>\nWhen all else fails, read the instructions.<br>\n<br>\nBeckhap\'s Law:<br>\nBeauty times brains equals a constant.<br>\n<br>\nCole\'s Axiom:<br>\nThe sum of the intelligence on the planet is a constant; the population is growing.<br>\n<br>\nJone\'s Motto:<br>\nFriends come and go, but enemies accumulate.<br>\n<br>\nThe Ultimate Law:<br>\nAll general statements are false.<br>\n<br>\nKnight\'s Law:<br>\nLife is what happens to you when you\'re making other plans.<br>\n<br>\nKrueger\'s Observation:<br>\nA taxpayer is someone who does not have to take a civil service exam in order to work for the government.<br>\n<br>\nBenchley\'s Law of Distinction:<br>\nThere are two kinds of people in the world; those who believe there are two kinds of people and those who don\'t.<br>\n<br>\nHarver\'s Law:<br>\nA drunken man\'s words are a sober man\'s thoughts.<br>\n<br>\nRule of Accuracy:<br>\nWhen working towards the solution of a problem, it always helps if you know the answer.<br>\n<br>\nFinagle\'s First Law:<br>\nIf an experiment works, something has gone wrong.<br>\n<br>\nFinagle\'s Third Law:<br>\nIn any collection of data, the figure most obviously correct, beyond all need of checking, is the mistake.<br>\n<br>\nRudin\'s Law:<br>\nIn crises that force people to choose among alternative courses of action, most people will choose the worst one possible.<br>\n<br>\nGinsberg\'s Restatement of the Three Laws of Thermodynamics:<br>\nYou can\'t win.<br>\nYou can\'t break even.<br>\nYou can\'t quit.<br>\n<br>\nQuantized Revision of Murphy\'s Law:<br>\nEverything goes wrong all at once.<br>\n<br>\nO\'Toole\'s Commentary:<br>\nMurphy was an optimist.<br>\n<br>\nMurphy\'s Constant:<br>\nMatter will be damaged in direct proportion to its value.<br>\n<br>\nFirestone\'s Law of Forecasting:<br>\nChicken Little only has to be right once.<br>\n<br>\nRalph\'s Observation:<br>\nIt is a mistake to allow any mechanical object to realize you are in a hurry.<br>\n<br>\nMurphy\'s 3rd Military Law:<br>\nFriendly fire ain\'t.<br>\n<br>\nMurphy\'s 4th Military Law:<br>\nThe most dangerous thing in the combat zone is an officer with a map.<br>\n<br>\nMurphy\'s 5th Military Law:<br>\nThe problem with taking the easy way out is that the enemy has already mined it.<br>\n<br>\nMurphy\'s 6th Military Law:<br>\nThe buddy system is essential to your survival; it gives the enemy somebody else to shoot at.<br>\n<br>\nMurphy\'s 7th Military Law:<br>\nThe farther you are in advance of your own positions, the more likely your artillery will shoot short.<br>\n<br>\nMurphy\'s 8th Military Law:<br>\nIncoming fire has the right of way.<br>\n<br>\nMurphy\'s 9th Military Law:<br>\nIf your advance is going well, you\'re walking into an ambush.<br>\n<br>\nMurphy\'s 10th Military Law:<br>\nThe quartermaster only has two sizes, too large and too small.<br>\n<br>\nMurphy\'s 11th Military Law:<br>\nIf you really need an officer in a hurry, take a nap.<br>\n<br>\nMurphy\'s 13th Military Law:<br>\nThe only thing more accurate than incoming fire is incoming friendly fire.<br>\n<br>\nClarke\'s Third Law:<br>\nAny sufficiently advanced technology is indistinguishable from magic.<br>\n<br>\nWeiler\'s Law:<br>\nNothing is impossible for the man who doesn\'t have to do it himself.<br>\n<br>\nPeter\'s Placebo:<br>\nAn ounce of image is worth a pound of performance.<br>\n<br>\nZymurgy\'s Law of Volunteer Labour:<br>\nPeople are always available for work in the past tense.<br>\n<br>\nGrossman\'s Misquote:<br>\nComplex problems have simple, easy-to-understand wrong answers.<br>\n<br>\nDucharme\'s Precept:<br>\nOpportunity always knocks at the least opportune moment.<br>\n<br>\nPerkin\'s Postulate:<br>\nThe bigger they are, the harder they hit.<br>\n<br>\nConway\'s Law:<br>\nIn every organization there will always be one person who knows what is going on. This person must be fired.<br>\n<br>\nStewart\'s Law of Retroaction:<br>\nIt is easier to get forgiveness than permission.<br>\n<br>\nHorngren\'s Observation (generalized):<br>\nThe real world is a special case.<br>\n<br>\nShirley\'s Law:<br>\nMost people deserve each other.<br>\n<br>\nGold\'s Law:<br>\nIf the shoe fits, it\'s ugly.<br>\n<br>\nColson\'s Law:<br>\nWhen you\'ve got them by the balls, their hearts and minds will follow.<br>\n<br>\nComin\'s Law:<br>\nPeople will accept your idea much more readily if you tell them Benjamin Franklin said it first.<br>\n<br>\nMencken\'s Metalaw:<br>\nFor every human problem there is a neat, simple solution; and it is always wrong.<br>\n<br>\nSevareid\'s Law:<br>\nThe chief cause of problems is solutions.<br>\n<br>\nThoreau\'s Law:<br>\nIf you see a man approaching you with the obvious intention of doing you good, you should run for your life.<br>\n<br>\nGerrold\'s Pronouncement:<br>\nThe difference between a politician and a snail is that a snail leaves its slime behind.<br>\n<br>\nHane\'s Law:<br>\nThere is no limit to how bad things can get.<br>\n<br>\nAlan\'s Law:<br>\nAll things being equal, you lose.',NULL,0.00,NULL,386,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1281,13,'Lawyer Hunting Regulations!','NEW REGULATIONS FOR THE HUNTING OF LAWERS<br>\nGovernment Department of Fish and \"WildLife\" Sec. 1200<br>\n<br>\n1. Any person with a valid hunting license may harvest attorneys.<br>\n<br>\n2. Taking of attorneys with traps or deadfalls is permitted. The use of currency as bait is prohibited.<br>\n<br>\n3. Killing of attorneys with a vehicle is prohibited. If accidentally struck, remove dead attorney to roadside and proceed to nearest car wash.<br>\n<br>\n4. It is unlawful to chase, herd, or harvest attorneys from a snow machine, helicopter, or aircraft.<br>\n5. It shall be unlawful to shout \"whiplash\", \"ambulance\", or \"free Perrier\" for the purpose of trapping attorneys.<br>\n<br>\n6. It shall be unlawful to hunt attorneys within 100 yards of BMW<br>\ndealerships.<br>\n<br>\n7. It shall be unlawful to hunt attorneys within 200 yards of courtrooms, law libraries, whorehouses, health spas, gay bars, ambulances, or hospitals.<br>\n<br>\n8. If an attorney is elected to government office, it shall be a felony to hunt, \"entrap\", or possess it.<br>\n<br>\n9. Stuffed or mounted attorneys must have a state health department inspection for rabies, and vermin.<br>\n<br>\n10. It shall be illegal for a hunter to disguise himself as a reporter, drugdealer, pimp, female legal clerk, sheep, accident victim, bookie, or taxaccountant for the purpose of hunting attorneys.<br>\n<br>\nBAG LIMITS<br>\n(Maximum number of catches allowed per hunting season)<br>\n<br>\n1. Yellow Bellied Sidewinder...........(2)<br>\n2. Two-faced Tort Feasor...............(1)<br>\n3. Back-stabbing Divorce Litigator.....(4)<br>\n4. Small-breasted Ball Buster..........(3)<br>\n(Female only)<br>\n5. Big-mouthed Pub Gut.................(2)<br>\n6. Honest Attorney.....................(0) <br>\n(On the Endangered Species List) (Illegal to hunt)<br>\n7. Cut-throat..........................(2)<br>\n8. Back-stabbing Whiner................(2)<br>\n9. Brown-nosed Judge Kisser............(2)<br>\n10. Silver-tongued Drug Defender.......($100 BOUNTY)',NULL,0.00,NULL,294,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1284,13,'2 Bullets','Q: If you are stranded on a desert island with Adolph Hitler, Atilla the Hun, and a lawyer, and you have a gun with only two bullets, what do you do?<br>\nA: Shoot the lawyer twice.',NULL,0.00,NULL,421,1,1,1,'',NULL,NULL);
