INSERT INTO `jokes` VALUES (1289,13,'Inventing Wire','How was wire invented?<br>\n<br>\nTwo lawyers pulling on a penny.',NULL,0.00,NULL,230,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1305,13,'Get Me Another Lawyer','Defendant: Your Honor, I want you to appoint me another lawyer. \r<BR>\r<BR>Judge: And why is that?\r<BR>\r<BR>Defendant: Because the Public Defender isn\'t interested in my case.\r<BR>\r<BR>Judge (to Public Defender): Do you have any comments on the defendant\'s motion?\r<BR>\r<BR>Public Defender: I\'m sorry, Your Honor. I wasn\'t listening.',NULL,0.00,NULL,279,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1308,13,'How Do You Feel?','Farmer Joe decided his injuries from the accident were serious enough to take the trucking company responsible for the accident to court. In court the trucking company\'s fancy lawyer was questioning farmer Joe.\r<BR>\n\r<BR>\n\"Didn\'t you say at the scene of the accident, \'I\'m fine,\"\' asked the lawyer. Farmer Joe responded, \"Well, I\'ll tell you what happened. I had just loaded my favorite mule Bessie into the...\"\r<BR>\n\r<BR>\n\"I didn\'t ask for any details,\" the lawyer interrupted, \"just answer the question.\"\r<BR>\n\r<BR>\nDid you not say at the scene of the accident, \'I\'m fine!\'.\"\r<BR>\n\r<BR>\nFarmer Joe said, \"Well, I had just got Bessie into the trailer and I as driving down the road...\"\r<BR>\n\r<BR>\nThe lawyer interrupted again and said, \"Judge, I am trying to establish the fact that, at the scene of the accident, this man told the highway patrolman on the scene that he was fine. Now several weeks after the accident he is trying to sue my client. I believe he is a fraud. Please tell him to simply answer the question.\"\r<BR>\n\r<BR>\nBy this time the judge was fairly interested in Farmer Joe\'s answer and said to the lawyer, \"I\'d like to hear what he has to say.\"\r<BR>\n\r<BR>\nJoe thanked the Judge and proceeded, \"Well, as I was saying, I had just loaded Bessie into the trailer and was driving her down the highway when this huge semi-truck and trailer ran the stop sign and smacked my truck right in the side.\r<BR>\n\r<BR>\nI was thrown into one ditch and Bessie was thrown into the other. I was hurting real bad and didn\'t want to move. However, I could hear ol\' Bessie moaning and groaning. I knew she was in terrible shape just by her groans.\r<BR>\n\r<BR>\nShortly after the accident a highway patrolman came on the scene. He could hear Bessie moaning and groaning so he went over to her. After he looked at her, he took out his gun and shot her between the eyes. Then the Patrolman came across the road with his gun in his hand and looked at me.\r<BR>\nHe said, \"Your mule was in such bad shape I had to shoot her.\r<BR>\nHow are you feeling?\"',NULL,0.00,NULL,303,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1313,13,'Lawyer at the Pearly Gates.','A prominent young attorney was on his way to court to begin arguments on a complex lawsuit when he suddenly found himself at the Gates of Heaven.\r<BR>\n\r<BR>\nSt. Peter started to escort him inside, when he began to protest that his untimely death had to be some sort of mistake. \"I\'m much too young to die! I\'m only 35!\"\r<BR>\n\r<BR>\nSt. Peter agreed that 35 did seem to be a bit young to be entering the pearly gates, and agreed to check on his case.\r<BR>\n\r<BR>\nAfter investigating, he told the attorney, \"I\'m afraid that their is no mistake my son...\r<BR>\n\r<BR>\nWe verified your age on the basis of the number of hours you\'ve billed to your clients, and you\'re at least 108 years old!\"',NULL,0.00,NULL,261,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1316,13,'Lawyer\'s Translation','A Mexican bandit made a specialty of crossing the Rio Grande from time to time and robbing banks in Texas. Finally, a reward was offered for his capture, and an enterprising Texas ranger decided to track him down. After a lengthy search, he traced the bandit to his favorite cantina, snuck up behind him, put his trusty six-shooter to the bandit\'s head, and said, \"You\'re under arrest. Tell me where you hid the loot or I\'ll blow your brains out.\"\r<BR>\r<BR>But the bandit didn\'t speak English, and the Ranger didn\'t speak Spanish.\r<BR>\r<BR>Fortunately, a bilingual lawyer was in the saloon and translated the Ranger\'s message. The terrified bandit blurted out, in Spanish, that the loot was buried under the oak tree in back of the cantina.\r<BR>\r<BR>\"What did he say?\" asked the Ranger.\r<BR>\r<BR>The lawyer answered, \"He said \'Get lost, Gringo. You wouldn\'t dare shoot me!\'\"',NULL,5.00,1,1464,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1349,14,'Top10 New Summer Camps!','Top 10 Summer Camps you should not send your kids to:\r\n\r\n10. Tommy Lee\'s---------- Camp Kickachickee\r\n9. Lorena Bobbit\'s------ Camp Cutaweewee\r\n8. Tanya Harding\'s------ Camp Wackaneenee\r\n7. Kenneth Star\'s------- Camp Catchacrookee\r\n6. Louis Farakahn\'s----- Camp Killawhitey\r\n5. O.J. Simpson\'s------- Camp Killachickee\r\n4. Michael Jackson\'s---- Camp Wannabewhitey\r\n3. President Clinton\'s-- Camp Getahoochie\r\n2. Ellen Degeneras\'s---- Camp Lickacoochie\r\n\r\nAnd the number one camp not to send your kid to:\r\n\r\n1. Monica Lewinsky\'s---- Camp Suckapeepee',NULL,0.00,NULL,156,1,1,3,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1350,14,'Dairy queen--whopper','How did the dairy queen get pregnant?\r\nThe burger king showed her his whopper!!!',NULL,0.00,NULL,157,1,1,3,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1351,14,'Green','Q: If you\'ve got a green ball in your left hand, and a green ball in your right hand, what do you have?\r\n\r\nA: Kermit the Frog\'s undivided attention.',NULL,0.00,NULL,161,1,1,3,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1352,14,'Kermit the Frog','Q: What\'s long, green, thin, and smells like pork?\r\n\r\nA: Kermits finger!',NULL,0.00,NULL,155,1,1,3,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1353,14,'Cinderella and Alan','Cinderella was now 75 years old. After a fulfilling life with the now dead Prince, she happily sat upon her rocking chair, watching the world go by from her front porch, with a cat called Alan for companionship.\r\n\r\nOne sunny afternoon, out of nowhere, appeared the Fairy Godmother. Cinderella said: \'Fairy Godmother, what are you doing here after all these years?\'\r\nThe Fairy Godmother replied: \'Well Cinderella, since you have lived a good, wholesome life since we last met, I have decided to grant you 3 wishes. Is there anything for which your heart still yearns?\'\r\n\r\nCinderella is taken aback, overjoyed and after some thoughtful consideration and almost under her breath she uttered her first wish. \'I wish I was wealthy beyond comprehension.\' Instantly her rocking chair was turned into solid gold. Cinderella was stunned.\r\n\r\nCinderella said \'Oh thank you, Fairy Godmother!\' The Fairy Godmother replied \'It is the least I can do. What is your second wish?\' Cinderella looked down at her frail body and said: \'I wish I was young and full of the beauty of youth again.\'\r\n\r\nAt once, her wish having been desired, became reality, and her beautiful youthful visage had returned. Cinderella felt stirrings inside her that had been dormant for years and long forgotten vigour and vitality began to course through her very soul. Then the Fairy Godmother spoke again: \'You have one more wish, what shall you have?\'\r\n\r\nCinderella looked over to Alan, who was now quivering in the corner with fear. \'I wish you to transform my old cat, Alan, into a beautiful and handsome young man.\' Magically, Alan suddenly underwent so fundamental a change in his biologicial make up, that when he stoof before her, he was a boy, so beautiful the like of which she nor the world had ever seen, so fair indeed that birds begun to fall from the sky at his feet.\r\n\r\nThe Fairy Godmother said: \'Congratulations Cinderella! Enjoy your new life.\' With a blazing shock of bright blue electricity, she was gone.\r\n\r\nFor a few moments, Alan and Cinderella looked into each other\'s eyes. Cinderella sat, breathless, gazing at the most stunningly perfect boy she had ever seen. Then Alan walked over to Cinderella, who sat transfixed in her rocking chair, and held her close in his muscular arms.\r\n\r\nHe leant close to her ear, and into her ear breathed as much as whispered, blowing her golden hair with his warm breath, \'I bet you regret having my balls chopped off now, don\'t you?\'',NULL,0.00,NULL,165,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1358,14,'Little Red Riding Hood','Little Red Riding Hood is skipping down the road when she sees the Big Bad Wolf crouched down behind a log.\r\n\r\n\"My, what big eyes you have, Mr. Wolf,\" says Little Red Riding Hood.\r\nThe surprised wolf jumps up and runs away!\r\n\r\nFurther down the road, Little Red Riding Hood sees the wolf again-this time he is crouched behind a tree stump.\r\n\r\n\"My what big ears you have Mr. Wolf, \" says Little Red Riding Hood.\r\nAgain the foiled wolf jumps up and runs away!\r\n\r\nAbout two miles down the track, Little Red Riding Hood sees the wolf again, this time crouched down behind a road sign.\r\n\r\n\"My, what big teeth you have Mr. Wolf,\" taunts Little Red Riding Hood.\r\nWith that, the Big Bad Wolf jumps up and screams, \"Will you get lost? \r\nI\'m trying to take a shit!\"',NULL,0.00,NULL,147,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1361,14,'Pinocchio Kidnapped!','Everyone hear the news about Snow White, Cinderella, and Sleeping Beauty being expelled from Disneyland?\r\n\r\nApparently all three were co-conspirators in the kidnapping of Pinocchio.\r\n\r\nFor several days, they tied him up, and each took turns sitting on his face, telling him to lie, lie, lie!!!',NULL,0.00,NULL,162,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1363,14,'Schingwers','Q: Why are Bill Clinton, Monica Lewinksy, and O.J. Simpson such bad golfers.\r\n\r\nA: Monica is a hooker, O.J. is a slicer and Bill doesn\'t know what hole to put it in.',NULL,0.00,NULL,164,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1365,14,'Tell me a Story!','A reporter goes way up into the hills of West Virginia to write an article about the area. He meets an old man in a small town and asks him about any memorable events in his life.\r\n\r\nThe old man says, \"Well, one time my favorite sheep got lost, so me and my neighbors got some moonshine and went looking for it. We looked and looked and finally found the sheep. Then we drank the moonshine and one by one, started shagging the sheep. It was a lot of fun!\"\r\n\r\nThe reporter figured he can\'t write an article about that, so he asked the old man to tell him another story.\r\n\r\nThe old man said, \"Well, one time my neighbor\'s wife got lost, so me and all the village men got some moonshine and went out looking for her. We looked and looked and finally we found her. Then we drank the moonshine and one by one, started shagging the neighbor\'s wife. Now, THAT was a lot of fun!\"\r\n\r\nThe reporter, feeling frustrated, finally told the old man that he couldn\'t write articles about those stories and asked him if he had any dramatic or sad memories that he could talk about.\r\n\r\nThe old man paused a little and with a sad expression on his face said -\r\n\"Well, one time I was lost ...\"',NULL,0.00,NULL,129,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1367,14,'The Marv Albert Song','Walkin\' Round in Women\'s Underwear\r\n(to be sung to \"Walkin\' in a Winter Wonderland\")\r\n\r\nLacy things - the wife is missin,\r\nDidn\'t ask - her permission,\r\nI\'m wearin\' her clothes,\r\nHer silk pantyhose,\r\nWalkin\' round in women\'s underwear.\r\n\r\nIn the store - there\'s a teddy,\r\nLittle straps - like spaghetti,\r\nIt holds me so tight,\r\nLike handcuffs at night,\r\nWalkin\' round in women\'s underwear.\r\n\r\nIn the office there\'s a guy named Marvin,\r\nHe pretends that I am Murphy Brown.\r\nHe\'ll say, \"Are you ready?\" I\'ll say, \"Whoa, Man!\"\r\n\"Let\'s wait until our wives are out of town!\"\r\n\r\nLater on, if you wanna,\r\nWe can dress - like Madonna,\r\nPut on some eyeshade,\r\nAnd join the parade,\r\nWalkin\' round in women\'s underwear!',NULL,0.00,NULL,145,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1368,14,'The Real Cinderella Story','The story takes off where Cinderella just got yelled at by her step-mother, then her fairy godmother comes to her aid.\r\n\r\nThe fairy godmother says, \"I can make you a new dress and give you everything you need to go to the ball... on two conditions!\"\r\n\"Anything, \" says Cinderella, \"anything!\"\r\n\r\n\"Okay the first condition is you have to wear a diaphram. The second condition is you have to be back by 2:00 AM or else your diaphram will turn into a pumpkin,\" says the fairy godmother.\r\n\r\nSo Cinderella goes to the ball and the fairy godmother just waits and waits and then it gets to be 2:00AM, 3:00, 4:00, 5:00 and Cinderella\'s still not back. Then Cinderella finally shows up and the fairy godmother is astonished as to Cinderella\'s appearence... no pumpkin!\r\n\r\nThe godmother asks Cinderella who she was with for she had no idea of a man with such power.\r\n\r\nThen Cinderella replies, \"Peter, Peter something or other?\"',NULL,0.00,NULL,138,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1369,14,'The Snow White Ad!','Snow White and the Seven Dwarfs are roaming in the forest when they come across a lake. The water was enticing and Snow White decides to take a bath. So she tells the Dwarfs to turn around while she is taking a bath in the lake.\r\n\r\nThe Dwarfs protest vehemently because they want to take a bath too.\r\n\r\nSnow White relents and says \"When I get into the water and you hear the splash, you can turn around.\"\r\n\r\nSnow White undresses and as she is about to jump into water, at that very moment, she is startled by a frog who jumps into water before she can.\r\n\r\nThe moment the Dwarfs hear the SPLASH, they turn around and see Snow White standing NAKED.\r\n\r\nNow, given that this incident is an idea for a TV ad, what product is being advertised?\r\n\r\nScroll down for the answer.\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\nCome on now, this should be easy for a person of your mental powers!\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\nThe product being advertised is...\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\n?\r\nSEVEN UP!',NULL,0.00,NULL,144,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1373,14,'Name A Fawn...','Q: Name a fawn, a lawn and a yawn.\r\n\r\nA: Bambi, the White House grounds, and the new TV season.',NULL,0.00,NULL,159,1,1,2,'3',NULL,NULL);
