INSERT INTO `jokes` VALUES (1376,14,'Scottie (Star Trek)','Ha ha ha,very funny Scottie....\r\n\r\nNOW BEAM DOWN MY CLOTHES!!',NULL,0.00,NULL,138,1,1,2,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1377,14,'The Enterprise/Toilet Paper','Q: What does the Star Trek Enterprise and tiolet paper have in common?\r\n\r\nA: They both circle around uranus searching for klingons!',NULL,0.00,NULL,200,1,1,2,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1378,14,'The nsync joke','God made oceans, God made lakes, God made NSYNC but hey, we all make mistakes!!!!',NULL,0.00,NULL,165,1,1,2,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1380,14,'A Letter From Barbie','*************************\r\nChief Executive Officer\r\nMattel, Inc.\r\nEl Segundo, CA\r\n\r\nDear Sir,\r\n\r\nListen you little troll, I\'ve been helping you out every year, playing at being the perfect Christmas present, wearing skimpy bathing suits in frigid weather, and drowning in fake tea from one too many tea parties, and I hate to break it to ya, but IT\'S DEFINITELY PAYBACK TIME! There had better be some changes around here this year, or I\'m gonna call for a nationwide meltdown (and trust me, you won\'t wanna be around to smell it).\r\n\r\nSo, here\'s my 1997 resolution/wish list:\r\n\r\n1. A nice, comfy pair of sweat pants and a frumpy, oversized sweatshirt. I\'m sick of looking like a hooker. How much smaller are these bathing suits gonna get? Do you have any idea what it feels like to have nylon and velcro crawling up your butt?\r\n\r\n2. Real underwear that can be pulled on and off. Preferably white. What bonehead at Mattel decided to cheap out and MOLD imitation underwear to my skin?!? It looks like cellulite!\r\n\r\n3. A REAL man...maybe GI Joe. Hell, I\'d take Tickle-Me Elmo over that wimped-out excuse for a boyfriend, Ken. And what\'s with that earring anyway? If I\'m gonna have to suffer with him, at least make him (and me) anatomically correct.\r\n\r\n4. Arms that actually bend so I can push the aforementioned Ken-wimp away once he is anatomically correct.\r\n\r\n5. Breast reduction surgery. I don\'t care whose arm you have to twist, just get it done.\r\n\r\n6. A sports bra. To wear until I get the surgery.\r\n\r\n7. A new career. Pet doctor and school teacher just don\'t cut it. How about a systems analyst? Or better yet, an advertising account exec!\r\n\r\n8. A new, more 90s persona. Maybe \"PMS Barbie\", complete with a miniature container of chocolate chip cookie dough ice cream and a bag of chips; \"Animal Rights Barbie\", with my very own paint gun, outfitted with a fake fur coat and handcuffs; or \"Stop Smoking Barbie\", sporting a removable Nicotrol patch and equipped with several packs of gum.\r\n\r\n9. No more McDonald\'s endorsements. The grease is wrecking my vinyl.\r\n\r\n10. Mattel stock options. It\'s been 37 years--I think I deserve it.\r\n\r\nOk, Mr CEO, that\'s it. Considering my valuable contribution to society, I don\'t think these requests are out of line. If you disagree, then you can find yourself a new bimbo doll for next Christmas. It\'s that simple.\r\n\r\nYours truly,\r\n\r\nBarbie\r\nDreamhouse\r\nMalibu, CA',NULL,0.00,NULL,148,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1382,14,'AOL/TW Merger','Due to the recent merger of AOL and Time Warner, AOL members can soon expect the following changes:\r\n\r\nTime Magazine\'s next \"Man Of The Year\" issue will feature Steve Case on the cover as the undisputed winner. This of course will strictly be a coincidence.\r\n\r\nThe standard irritating AOL popups will be replaced by Warner Bros. cartoons. Now, Elmer Fudd will say, \"You cwazy wabbit, you\'ve been onwine for 5 minutes and that\'s way-y-y too long... we\'re going to boot you off!\"\r\n\r\nThe next time that you hear Bugs Bunny say, \"Eh, what\'s up Doc?\" he will be referring to your monthly AOL subscription charge.',NULL,0.00,NULL,184,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1383,14,'Arnold:the musical','Stallone, Tony Danza, and Arnold Swarzanagger are all going to be in a musical about famous composers.\r\n\r\nStallone wants to be Mozart, Danza says he\'ll be Bethoven, \r\n\r\nand Swarzanagger says \"I\'ll be Bach!\"',NULL,0.00,NULL,112,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1384,14,'Chuck, Jean Claud, and Arnold','Chuck Norris, Arnold Swartzenagger, and Jean Claud VanDam, were talking one day. Chuck Norris asked, \"If you were a musician, who would you be?\".\r\n\r\nChuck Norris said, \"I would be Motzart.\"\r\nJean Claud VanDam said, \"I would be Bethoven.\"\r\nArnold then said, \"I\'ll be Bach!\"',NULL,0.00,NULL,142,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1385,14,'Interview with a Pirate!','The pirate Red Beard was being interviewed by a newspaper reporter who was looking for juicy stories of excitement and derring-do. He told Red, \"I\'m sure my readers would love to hear the tale behind your pegleg.\" \r\n\r\n\"Well, I was thrown from the ship during gale force winds, and before me mate could throw me a line, a shark bit me leg clean off!\" \r\n\r\nThe interviewer was sort of disappointed. \"What about the hook at the end of your right arm?\" \r\n\r\n\"I lost it in a sword fight with the Captain of the Guard!\" \r\n\r\nAgain the reporter was disappointed. \"Certainly there\'s an exciting story about the patch on your eye?\" \r\n\r\n\"One day, I was out on deck, and a bird flew over and pooped in me eye!\" \r\n\r\nThe reporter was amazed. \"That\'s why you wear a patch?\" \r\n\r\n\"Well, I\'d only had me hook a couple of days!\"',NULL,0.00,NULL,122,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1387,14,'Killer','A man was found murdered in his home over the weekend. Detectives at the scene found the man face down in his tub. The tub had been filled with milk, and the deceased had a banana protruding from his buttocks.\r\n\r\nPolice suspect a cereal killer.',NULL,0.00,NULL,152,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1388,14,'Let me through!','A car was involved in an accident in a street. As expected, a large crowd gathered.\r\n\r\nA newspaper reporter anxious to get his story could not get near the car. Being a clever sort, he started shouting loudly, \"Let me through! Let me through! I am the son of the victim.\"\r\n\r\nThe crowd made way for him.\r\nLying in front of the car was a donkey.',NULL,0.00,NULL,168,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1389,14,'Michael Jackson Funnies','Q: Have you heard about Michael Jackson\'s New Book?\r\nA: It\'s called, \"The In\'s and Out\'s of Child Rearing\".\r\n\r\nQ: What do Michael Jackson and the Baltimore Orioles have in common?\r\nA: They both walk around with one glove on their hand for no apparent reason.\r\n\r\nMichael Jackson and Tonya Harding have decided to begin training racehorses together?\r\nYup, she\'s gonna do all the handicapping and he\'s gonna ride all the 3-year-olds!\r\n\r\nQ: Why did Michael Jackson place a phone call to Boyz-2-Men??\r\nA: He thought it was a delivery service.\r\n\r\nThe Pope has issued a proclamation on Michael Jackson.\r\nIf he hears any more allegations about little boys, the Pope says he\'ll have no choice but to make him a priest!\r\n\r\nQ: How can you tell when Michael Jackson is giving a party?\r\nA: By all the Big Wheels parked in his driveway.\r\n\r\nAnd finally, I found out why Michael has cut down on public appearances...\r\nHe wants to spend more time with the kids!',NULL,0.00,NULL,154,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1390,14,'Rush Limbaugh','Rush Limbaugh and his chauffeur were out driving in the country and accidentally hit and killed a pig that had wandered out on a country road.\r\n\r\nLimbaugh told the chauffeur to drive up to the farm and apologize to the farmer. They drove up to the farm, the chauffeur got out and knocked on the front door and was let in. He was in there for what seemed hours. When he came out, Limbaugh was confused about why his employee had been there so long.\r\n\r\n\"Well, first the farmer shook my hand, then he offered me a beer, then his wife brought me some cookies, and his daughter showered me with kisses,\" explained the driver.\r\n\r\n\"What did you tell the farmer?\" Limbaugh asked.\r\n\r\nThe chauffeur replied, \"I told him that I was Rush Limbaugh\'s driver and I\'d just killed the pig.',NULL,10.00,1,1304,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1391,14,'The \"real story\" of the three bears..','It\'s a sunny morning in the Big Forest, and the Bear family is just waking up.\r\n\r\nBaby Bear goes downstairs and sits in his small chair at the table.\r\nHe looks into his small bowl. It is empty!\r\n\"Who\'s been eating my porridge,\" he squeaks?\r\n\r\nDaddy Bear arrives at the table and sits in his big chair.\r\nHe looks into his big bowl, and it is also empty! \r\n\"Who\'s been eating my porridge!,\" he roars?\r\n\r\nMomma Bear puts her head through the serving hatch from the kitchen and yells -\r\n\"For Pete\'s sake, how many times do we have to go through this?\"\r\n\r\n\"It was \'Momma Bear\' who got up first.\"\r\n\"It was \'Momma Bear\' who woke everybody else in the house up.\"\r\n\"It was \'Momma Bear\' who made the Coffee.\"\r\n\"It was \'Momma Bear\' who unloaded the dishwasher from last night, and put everything away.\"\r\n\"It was \'Momma Bear\' who went out into the cold early morning air to fetch the newspaper.\"\r\n\"It was \'Momma Bear\' who set the table.\"\r\n\"It was \'Momma Bear\' who put the cat out, cleaned the litter box and filled the cat\'s water & food dish.\"\r\n\r\n\"And, now that you\'ve decided to come downstairs and grace \'Momma Bear\' with your presence, ...listen good, \'cause I\'m only going to say this one time...\r\n\"I haven\'t made the @!#$%^&* Porridge, yet!!\"',NULL,0.00,NULL,94,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1392,14,'The 3 little pigs','Three Little Pigs went out to dinner one night.\r\nThe waiter comes and takes their drink order.\r\n\r\n\"I would like a Sprite,\" said the first little piggie.\r\n\"I would like a Coke,\" said the second little piggie.\r\n\"I want water, lots and lots of water,\" said the third little piggie.\r\n\r\nThe drinks are brought out and the waiter takes their orders for dinner.\r\n\r\n\"I want a nice big steak,\" said the first piggie.\r\n\"I would like the salad plate,\" said the second piggie.\r\n\"I want water, lots and lots of water,\" said the third little piggie.\r\n\r\nThe meals were brought out and a while later the waiter approached the table and asked if the piggies would like any dessert.\r\n\r\n\"I want a banana split,\" said the first piggie.\r\n\"I want a root beer float,\" said the second piggie.\r\n\"I want water, lots and lots of water,\" exclaimed the third little piggie.\r\n\r\n\"Pardon me for asking,\" said the waiter, \"but why have you only ordered water?\"\r\n\r\nThe third piggies says -\r\n\"Well, somebody has to go \'Wee, wee, wee, all the way home!\'\"',NULL,0.00,NULL,168,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1393,14,'Think you\'re having a bad day!','If you think you\'re having a bad day...read these true stories!\r\n\r\n1. The average cost of rehabilitating a seal after the Exxon Valdez oil spill in Alaska was $80,000. At a special ceremony, two of the most expensively saved animals were released back into the wild amid cheers and applause from onlookers. A minute later, in full view, they were both eaten by a killer whale.\r\n\r\n2. A psychology student in New York rented out her spare room to a carpenter in order to nag him constantly and study his reactions. After weeks of needling, he snapped and beat her repeatedly with an axe leaving her mentally retarded.\r\n\r\n3. In 1992, Frank Perkins of Los Angeles made an attempt on the world flagpole-sitting record. Suffering from the flu he came down eight hours short of the 400 day record, his sponsor had gone bust, his girl friend had left him and his phone and electricity had been cut off.\r\n\r\n4. A woman came home to find her husband in the kitchen, shaking frantically with what looked like a wire running from his waist towards the electric kettle. Intending to jolt him away from the deadly current she whacked him with a handy plank of wood by the back door, breaking his arm in two places. Until that moment he had been happily listening to his Walkman.\r\n\r\n5. Two animal rights protesters were protesting at the cruelty of sending pigs to a slaughterhouse in Bonn. Suddenly the pigs, all two thousand of them, escaped through a broken fence and stampeded, trampling the two hapless protesters to death.\r\n\r\nAnd finally.......\r\n\r\n6. Iraqi terrorist, Khay Rahnajet, didn\'t pay enough postage on a letter bomb. It came back with \"return to sender\" stamped on it. Forgetting it was the bomb, he opened it and was blown to bits.',NULL,0.00,NULL,114,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1395,14,'What is God?','One morning at church, the pastor was preaching about what God was and wasn\'t.\r\n\r\nHe said \"God is neither white, nor black. God is neither male nor female.\"\r\n\r\nAfter hearing all this, a curious 5 year old turned to his dad and asked - \"Daddy, is God Michael Jackson?\"',NULL,0.00,NULL,145,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1397,14,'Write and Wrong','A writer dies and reaches the Golden Gates where God gives him a choice to either go to Heaven or Hell. He finds it difficult to make up his mind so he asks God if he can have a little tour of both places.\r\n\r\nGod agrees and they first go to Hell where the writer sees rows and rows of writers, chained to their desks in an overheated room, being whipped if they stopped writing for a second by merciless editors and publishers. This really frightens the writer who then proceeds to Heaven hoping it\'ll be better.\r\n\r\nIn Heaven too he sees rows of writers, chained to their desks in an over heated room, being whipped mercilessly.\r\n\r\nSo he turns to God and says, \"But they\'re both the same!\"\r\nTo which God replies, \"Oh no. Here in Heaven your work gets published!\"',NULL,0.00,NULL,153,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1400,14,'Advertisements','1. Illiterate? Write today for free help. \r\n2. Auto Repair Service. Free pick-up and delivery. Try us once, you\'ll never go anywhere again. \r\n3. Our experienced Mom will care for your child. Fenced yard, meals and smacks included. \r\n4. Dog for sale: eats anything and is fond of children. \r\n5. Man wanted to work in dynamite factory. Must be willing to travel. \r\n6. Stock up and save. Limit: one. \r\n7. Semi-annual After-Christmas sale. \r\n8. 3-year old teacher needed for pre-school. Experience preferred. \r\n9. Mixing bowl set designed to please a cook with round bottom for efficient beating. \r\n10. Dinner special - Turkey $2.35; Chicken or Beef $2.25; Children $2.00.',NULL,0.00,NULL,143,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1404,14,'Dear Abby','Snappy answers to sappy questions:\r\nAll your puny problems solved in 10 words or less!\r\n\r\nQ: Dear Abby,\r\nWhat can I do about my little brother? He\'s such a pest!\r\nA: Have you tried a flyswatter?\r\n\r\nQ: Dear Abby,\r\nMy boss is a mean, unappreciative slave driver who constantly belittles me. What can I do?\r\nA: Shut up and get back to work!\r\n\r\nQ: Dear Abby,\r\nMy dad insists I clean my room! How can I get out of this?\r\nA: Get a new dad.\r\n\r\nQ: Dear Abby,\r\nWhy are you so lazy?\r\nA: Dear loser, Why are you so stupid? Next question.\r\n\r\nQ: Dear Abby,\r\nHelp! I need to lose weight! How can I stop eating all the fattening foods I love?\r\nA: Send them to me and I\'ll eat them for you.',NULL,0.00,NULL,156,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1405,14,'End of the World Reports','When the end of the world arrives how will the media report it?\r\n\r\nUSA Today:\r\nWE\'RE DEAD\r\n\r\nThe Wall Street Journal:\r\nDOW JONES PLUMMETS AS WORLD ENDS\r\n\r\nNational Enquirer:\r\nO.J. AND NICOLE, TOGETHER AGAIN\r\n\r\nPlayboy:\r\nGIRLS OF THE APOCALYPSE\r\n\r\nMicrosoft Systems Journal:\r\nAPPLE LOSES MARKET SHARE\r\n\r\nVictoria\'s Secret Catalog:\r\nOUR FINAL SALE\r\n\r\nSports Illustrated:\r\nGAME OVER\r\n\r\nWired:\r\nTHE LAST NEW THING\r\n\r\nRolling Stone:\r\nTHE GRATEFUL DEAD REUNION TOUR\r\n\r\nReaders Digest:\r\n\'BYE\r\n\r\nDiscover Magazine:\r\nHOW WILL THE EXTINCTION OF ALL LIFE AS WE KNOW IT AFFECT THE WAY WE VIEW THE COSMOS?\r\n\r\nTV Guide:\r\nDEATH AND DAMNATION: NIELSON RATINGS SOAR!\r\n\r\nLady\'s Home Journal:\r\nLOSE 10 LBS BY JUDGEMENT DAY WITH OUR NEW \"ARMAGEDDON\" DIET!\r\n\r\nAmerica Online:\r\nSYSTEM TEMPORARILY DOWN. TRY CALLING BACK IN 15 MINUTES.\r\n\r\nInc. magazine:\r\nTEN WAYS YOU CAN PROFIT FROM THE APOCALYPSE\r\n\r\nMicrosoft\'s Web Site:\r\nIF YOU DIDN\'T EXPERIENCE THE RAPTURE,DOWNLOAD SOFTWARE PATCH RAPT777.EXE',NULL,0.00,NULL,127,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1415,14,'Retractions by the NY Times in 1998','The Top 13 Retractions Printed by the NY Times in 1998\r\n\r\n13 \"Correction: The cookie recipe in question cost $350, not $250 as previously reported.\"\r\n\r\n12 \"Earlier this year, the Times mistakenly reported that software magnate Bill Gates is a money-hungry, maladapted, socially awkward loser. He is, in fact, a bloodsucking cob-nobbler. The Times regrets the error.\"\r\n\r\n11 \"We wish to apologize for calling the former Australian Prime minister, Paul Keating, the lowest slime-ball in the country. We meant in THEIR country.\"\r\n\r\n10 \"Due to a typographical error yesterday, we mistakenly printed the entire Wall Street Journal under our banner. It should have been the Washington Post. Sorry.\"\r\n\r\n9 \"Okay, so it was a blue dress, not a red skirt. Get off our backs already!\"\r\n\r\n8 \"In Thursday\'s edition of the Times, we erroneously reported the stories of five people who experienced bad luck as a result of not forwarding an e-mail message...\"\r\n\r\n7 \"This mistake will never happen again. We apologize to the Top 5 subscribers, contributors and the list moderator, Chris Whitewater.\"\r\n\r\n6 \"Recently, pop singer George Michael was caught masturbating in a public restroom yesterday. He was not, as reported in this newspaper, actually choking a chicken.\"\r\n\r\n5 \"It has come to the attention of the Times that disk jockey Fred LeFebvre of KISS-FM in Toledo was not actually the recipient of a MacArthur \'Genius Grant.\'\"\r\n\r\n4 \"Evidently, there are no Klingons on Uranus after all. Sorry for the confusion.\"\r\n\r\n3 \"Our article describing O.J. Simpson as \'slashing out\' over the prospect of losing his children contained a regrettable typo...\"\r\n\r\n2 \"As it turns out, the Banana Republic dictatorship is actually just a clothing store.\"\r\n\r\nand Top5\'s Number 1 Other Retraction Printed by the NY Times in 1998...\r\n\r\n1 \"Miss Lewinsky did not give the President a snow job, as reported in some editions yesterday.\"',NULL,0.00,NULL,129,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1417,14,'Star Wars Update Changes','Top Ten Changes to the new Star Wars update\r\n\r\n#10 Tie fighters replaced with black UN helicopters lead by Buotros Buotros Vader.\r\n\r\n#9 Sand People replaced by Michigan Militia members (and still walk single file to hide their numbers).\r\n\r\n#8 Kahn turns out to be Captain Kirk\'s father (whoops, that\'s from the Top Ten new Star Trek movie changes).\r\n\r\n#7 Chewbacca now giggles when you tickle his tummy.\r\n\r\n#6 If you look closely, storm troopers now have Microsoft employee badges.\r\n\r\n#5 Original Jawas: Killed by Storm Troopers for having R2 and C3P0. New Jawas: Killed for pitching yet another lame JAVA product \"concept\".\r\n\r\n#4 Obi Wan\'s name changed to OS/2 Kenobi. Uncle Owen now constantly says \"I think he died X years ago\" where X changes between 10 years before to 10 years in the future. Storm troopers now don\'t kill Uncle Owen but instead appoint him head of the Imperial press.\r\n\r\n#3 Amiga users upset because the new computers in the Death Star are PC\'s when they could have been replaced with a single Amiga 1000 with 512K of ram and still run \"tons faster and do real multitasking unlike those PEE-CEEs\"\r\n\r\n#2 The Canteen now has real rock stars in it. They look as they normally do but still manage to look more alien than the original aliens in there.\r\n\r\n#1 Death Star\'s old slogan: \"Fear this battle station\"\r\nDeath Star\'s NEW slogan: \"Where do you want to go today?\"',NULL,0.00,NULL,148,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1420,14,'The Hollywood/English Dictionary','to schmooze = befriend scum\r\nto pitch = grovel shamelessly\r\nto brainstorm = feign preparedness\r\nto research = procrastinate indefinitely\r\nto network = spread disinformation\r\nto collaborate = argue incessantly\r\nto freelance = collect unemployment\r\n\r\nNOUNS:\r\n\r\nagent = frustrated lawyer\r\nlawyer = frustrated producer\r\nproducer = frustrated writer\r\nwriter = frustrated director\r\ndirector = frustrated actor\r\nactor = frustrated human\r\n\r\nCOMPOUND WORDS:\r\n\r\nhigh-concept = low brow\r\nproduction value = gore\r\nentry-level = pays nothing\r\nhighly qualified = knows the producer\r\nnetwork approved = had made them money\r\n\r\nFINANCIAL TERMS:\r\n\r\nnet = something that apparently doesn\'t exist\r\ngross = Michael Eisner\'s salary\r\nback-end = you, if you think you\'ll ever see it\r\nresiduals = braces for the kids\r\ndeferral = don\'t hold your breath\r\npoints = see \"net\" or \"back-end\"\r\n\r\nCOMMON PHRASES:\r\n\r\nYou can trust me = You must be new\r\nIt needs some polishing = Change everything\r\nIt shows promise = It stinks rotten\r\nIt needs some fine tuning = Change everything\r\nI\'d like some input = I want total control\r\nIt needs some honing = Change everything\r\nCall me back next week = Stay out of my life\r\nIt needs some tightening = Change everything\r\nTry and punch it up = I have no idea what I want\r\nIt needs some streamlining = Change everything\r\nYou\'ll never work in this town again = I have no power whatsoever',NULL,0.00,NULL,184,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1421,14,'Thoughts From Women...','Thoughts From Women About Being A Woman\r\n\r\nThe hardest years in life are those between ten and seventy.\r\n* Helen Hayes (at 73)\r\n\r\nI refuse to think of them as chin hairs. I think of them as stray eyebrow.\r\n* Janette Barber\r\n\r\nThings are going to get a lot worse before they get worse.\r\n* Lily Tomlin\r\n\r\nA male gynecologist is like an auto mechanic who never owned a car.\r\n* Carrie Snow\r\n\r\nOld age ain\'t no place for sissies.\r\n* Bette Davis\r\n\r\nIf you can\'t be a good example, then you\'ll just have to be a horrible warning.\r\n* Catherine Aird\r\n\r\nA man\'s got to do what a man\'s got to do. A woman must do what he can\'t.\r\n* Rhonda Hansome\r\n\r\nThe phrase \"working mother\" is redundant.\r\n* Jane Sellman\r\n\r\nWhatever women must do they must do twice as well as men to be thought half as good. Luckily, this is not difficult.\r\n* Charlotte Whitton\r\n\r\nThirty-five is when you finally get your head together and your body starts falling apart.\r\n* Caryn Leschen\r\n\r\nWhoever thought up the word \"Mammogram\"? Every time I hear it, I think I\'m supposed to put my breast in an envelope and send it to someone.\r\n* Jan King\r\n\r\nI try to take one day at a time, but sometimes several days attack me at once.\r\n* Jennifer Unlimited\r\n\r\nWhen I was young, I was put in a school for retarded kids for two years before they realized I actually had a hearing loss. And they called ME slow!\r\n* Kathy Buckley\r\n\r\nI\'m not offended by all the dumb blonde jokes because I know I\'m not dumb and I\'m also not blonde.\r\n* Dolly Parton\r\n\r\nYou see a lot of smart guys with dumb women, but you hardly ever see a smart woman with a dumb guy.\r\n* Erica Jong\r\n\r\nIf high heels were so wonderful, men would still be wearing them.\r\n* Sue Grafton\r\n\r\nLaugh and the world laughs with you. Cry and you cry with your girlfriends.\r\n* Laurie Kuslansky\r\n\r\nI think - therefore I\'m single.\r\n* Lizz Winstead\r\n\r\nYou know the hardest thing about having cerebral palsy and being a woman? It\'s plucking your eyebrows. That\'s how I originally got pierced ears.\r\n* Geri Jewell\r\n\r\nWhen women are depressed they either eat or go shopping. Men invade another country.\r\n* Elayne Boosler\r\n\r\nBehind every successful man is a surprised woman.\r\n* Maryon Pearson\r\n\r\nIn politics, if you want anything said, ask a man - if you want anything done, ask a woman.\r\n* Margaret Thatcher\r\n\r\nI have yet to hear a man ask for advice on how to combine marriage and a career.\r\n* Gloria Steinem\r\n\r\nI never married because there was no need. I have three pets at home who answer the same purpose as a husband. I have a dog that growls every morning, a parrot that swears all afternoon, and a cat that comes home late every night.\r\n* Marie Corelli\r\n\r\nIf men can run the world, why can\'t they stop wearing neckties? How intelligent is it to start the day by tying a noose around your neck?\r\n* Linda Ellerbee\r\n\r\nNobody can make you feel inferior without your permission.\r\n* Eleanor Roosevelt',NULL,0.00,NULL,144,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1424,14,'Weathermen Are Nuts','From David Letterman - Monday, October 3, 1994\r\nTop Ten Signs your Local TV Weatherman Is Nuts\r\n\r\n10. Every night, his forecast is: \"It\'s raining men, hallelujah!\"\r\n9. Often asks anchorwoman to switch clothes with him.\r\n8. Uses expensive radar equipment to track Michelle Pfeiffer.\r\n7. \"Satellite photos\" look suspiciously like Polaroids of a desk globe.\r\n6. Appears to have the first spring robin in his mouth.\r\n5. Seen checking into a Motel 6 with a half-inflated weather balloon.\r\n4. Every night he says, \"Lordy mama, it\'s gonna rain root beer tomorrow!\"\r\n3. The symbol on his weather map for an arctic cold front is a snowman giving the finger.\r\n2. Looks a lot like this pinhead. (videotape of Dave in his TV weatherman days)\r\n1. He\'s got a tropical storm in his pants.',NULL,0.00,NULL,149,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1425,14,'28','Worlds \"shortest\" books! \r\n\r\n\r\n25. MY PLAN TO FIND THE REAL KILLERS - by O.J. Simpson\r\n24. THE ENGINEER\'S GUIDE TO FASHION\r\n23. TO ALL THE MEN I\'VE LOVED BEFORE - by Ellen DeGeneres\r\n22. THE DIFFERENCE BETWEEN REALITY AND DILBERT\r\n21. HUMAN RIGHTS ADVANCES IN CHINA\r\n20. THINGS I WOULD NOT DO FOR MONEY - by Dennis Rodman\r\n19. THE WILD YEARS - by Al Gore\r\n18. AMELIA EARHART\'S GUIDE TO THE PACIFIC OCEAN\r\n17. AMERICA\'S MOST POPULAR LAWYERS\r\n16. CAREER OPPORTUNITIES FOR LIBERAL ARTS MAJORS\r\n15. DETROIT - A TRAVEL GUIDE\r\n14. DIFFERENT WAYS TO SPELL BOB\r\n13. DR. KEVORKIAN\'S COLLECTION OF MOTIVATIONAL SPEECHES\r\n12. EASY UNIX\r\n11. ETHIOPIAN TIPS ON WORLD DOMINANCE AND AGRICULTURE\r\n10. EVERYTHING MEN KNOW ABOUT WOMEN\r\n9. EVERYTHING WOMEN KNOW ABOUT MEN\r\n8. FRENCH HOSPITALITY\r\n7. GEORGE FOREMAN\'S BIG BOOK OF BABY NAMES\r\n6. HOW TO SUSTAIN A MUSICAL CAREER - by Art Garfunkel\r\n5. MIKE TYSON\'S GUIDE TO DATING ETIQUETTE\r\n4. SPOTTED OWL RECIPES - by the EPA\r\n3. STAPLE YOUR WAY TO SUCCESS\r\n2. THE AMISH PHONE DIRECTORY\r\n\r\nAnd the Number one World\'s Shortest book......\r\n\r\n1. HOW TO OVERCOME TEMPTATION - by Bill Clinton',NULL,0.00,NULL,153,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1427,15,'Aussie Trouser Snake','An Australian Combat Field Engineer Sergeant and a U.S Marine were on exchange duty and were sharing the latrines.\r\n\r\nThe Aussie Sergeant finished first and walked out without washing his hands. The U.S Marine watched in disgust, finished his squirt, washed his hands and walked up to the Aussie Sergeant and said. \" In the U.S Marine Corps we were taught to wash our hands after a leak\". \r\n\r\nThe rather large Aussie Sergeant replied, \" In the Australian Army mate, we were taught not to piss on our hands ...! \"',NULL,0.00,NULL,131,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1428,15,'Bubba and Junior!','Two good ol\' boys, Bubba and Junior get promoted from Privates to Sergeants.\r\nNot long after, they\'re out for a walk and Bubba says, \"Hey, Junior - there\'s the NCO Club. Let\'s you and me stop in and have us a drank.\"\r\n\r\n\"But we\'s privates,\" protests Junior.\r\n\"NO, we\'s sergeants now,\" says Bubba, pulling him inside\r\n\"Now, Junior, I\'m gonna sit down and have me a drank.\"\r\n\"But, we\'s privates,\" says Junior.\r\n\"You blind, boy!\" says Bubba, pointing at his stripes. \"We\'s Sergeants now!\"\r\n\r\nSo they order their drinks and pretty soon a hooker comes up to Bubba.\r\n\"You\'re cute,\" she says, \"and I\'d like to take you someplace and make you feel good -- but I\'ve got a bad case of gonorrhea.\"\r\n\r\nBubba pulls his friend to the side and whispers, \"Junior, go look in the dictionary and see what that gonorrhea means. If it\'s good, give me the okay sign.\"\r\n\r\nJunior goes to look it up, comes back, and gives Bubba the big okay sign.\r\nThree weeks later Bubba is laid up in the infirmary with a terrible case of gonorrhea.\r\n\"Junior,\" he says, \"What you give me the okay for?!\"\r\n\r\n\"Well Bubba, in the dictionary, it says gonorrhea only affects the privates.\"\r\nThen he pointed to his stripes and says, \"But we\'s Sergeants now!',NULL,0.00,NULL,141,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1435,15,'On the Train','A WW II American soldier had been on the front lines in Europe for three months when he was finally given a week of R&R. He caught a supply boat to a base in the south of England, then caught a train to London. The train was extremely crowded and he could not find a seat. He was dead on his feet and walked the length of the train looking for any place to sit.\r\n\r\nFinally he found a compartment with seats facing each other. There was room for two people on each seat. On one side sat only a proper looking, older British lady, with a small dog sitting in the empty seat beside her. \"Could I please sit in that seat\" he asked. \r\n\r\nThe lady was insulted. \"You Americans are so rude\" she said, \"can\'t you see my dog is sitting there\"?\r\n\r\nHe walked through the train more and still could not find a seat. He found himself back at the same place. \"Lady, I love dogs - have a couple at home - so I would be glad to hold your dog if I could sit down\" he said.\r\n\r\nThe lady replied, \"You Americans are not only rude you are arrogant\" she said. \r\n\r\nHe leaned against the wall for a time, but was so tired he finally said, \"Lady, I\'ve been on the front lines in Europe for three months with not a decent rest for all that time. Could I please sit there and hold your dog?\" \r\n\r\nThe lady replied, \"You Americans are not only rude and arrogant, you are also obnoxious.\"\r\n\r\nWith that comment, the soldier calmly stepped in, picked up the dog, threw it out the widow, and sat down.\r\n\r\nThe lady was speechless.\r\n\r\nAn older, neatly dressed Englishman sitting across on the other seat spoke up. \r\n\r\n\"Young man, I do not know if all you Americans fit the lady\'s description of you or not. But I do know that you Americans do a lot of things wrong. You drive on the wrong side of the road, you hold your fork with the wrong hand, and now you have just thrown the wrong bitch out of the window!\"',NULL,0.00,NULL,146,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1436,15,'Soldier\'s Ambition','An army Major visiting the sick soldiers, went to one private and asked, \"What\'s your problem, Soldier?\"\r\n\r\n\"Chronic syphilis, Sir.\"\r\n\"What treatment are you getting?\"\r\n\"Five minutes with the wire brush each day.\"\r\n\"What\'s your ambition?\"\r\n\"To get back to the front, Sir.\"\r\n\"Good man,\" said the Major.\r\n\r\nHe went to the next bed, \"What\'s your problem, Soldier?\"\r\n\"Chronic piles, Sir.\"\r\n\"What treatment are you getting?\"\r\n\"Five minutes with the wire brush each day.\"\r\n\"What\'s your ambition?\"\r\n\"To get back to the front, Sir.\"\r\n\"Good man,\" barked the Major.\r\n\r\nHe moved to the next bed, \"What\'s your problem, Soldier?\"\r\n\"Chronic gum disease, Sir\"\r\n\"What treatment are you getting?\"\r\n\"Five minutes with the wire brush each day.\"\r\n\"What\'s your ambition?\"\r\n\"To get the wire brush before the other two, Sir!\"',NULL,0.00,NULL,124,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1437,15,'Stand Still, Soldier!','Military training:\r\n\r\nDuring camouflage training in Louisiana, a private disguised as a tree trunk had made a sudden move that was spotted by a visiting general.\r\n\r\n\"You simpleton!\" the officer barked. \"Don\'t you know that by jumping and yelling the way you did, you could have endangered the lives of the entire company?\"\r\n\r\n\"Yes sir,\" the solder answered apologetically. \"But, if I may say so, I did stand still when a flock of pigeons used me for target practice and I never moved a muscle when a large dog peed on my lower branches but when two squirrels ran up my pants leg and I heard the bigger say,\r\n\r\n\"Let\'s eat one now and save the other until winter\' ---that did it!\"',NULL,0.00,NULL,149,1,1,3,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1439,15,'Army Wisdom','A Purple Heart proves three things: you were smart enough to think of a plan, stupid enough to try it, and lucky enough to survive.\r\n\r\n10 second fuses only last 7 seconds.\r\nAnything you do can get you shot, even doing nothing.\r\nClaymores are labeled \"This side toward enemy\" for a reason.\r\nDon\'t draw fire, it irritates the people around you.\r\n\r\nDon\'t ever be the first, don\'t ever be the last and don\'t ever, ever volunteer to do anything.\r\n\r\nDon\'t look conspicuous: it draws fire.\r\nIf it\'s stupid but works, it really isn\'t stupid.\r\nIf the enemy is in range, so are you.\r\nIf the pin is pulled, Mr. Grenade is *not* our friend.\r\nIf you can\'t remember, the claymore is pointed at you.\r\nIf your attack is going well, you have walked into an ambush.\r\nIncoming fire has the right of way.\r\n\r\nIt is generally unadvisable to eject directly over the area you just bombed.\r\nMake it too tough for the enemy to get in and you can\'t get out.\r\nMines are equal opportunity weapons.\r\nNever share a fox hole with anyone braver than you.\r\nProfessionals are predictable, it\'s the amateurs that are dangerous.\r\nTeamwork is essential; it gives the enemy someone else to shoot at.\r\nThe easy way is always mined.\r\n\r\nThe enemy invariably attacks on one of two occasions:\r\na. When you\'re not ready for them.\r\nb. When you\'re ready for them.\r\nEither time is inconvenient and generally a bummer.\r\n\r\nThe only thing more accurate than incoming enemy fire is incoming friendly fire.\r\nThe quartermaster has only two sizes: too large and too small.\r\nTry to look unimportant, they may be low on ammo.\r\nWhen in doubt empty the magazine.',NULL,0.00,NULL,144,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1441,15,'Hit Television Shows in Iraq','\"Husseinfeld\"\r\n\"Mad About Everything\"\r\n\"U.S. Military Secrets Revealed\"\r\n\"Suddenly Sanctions\"\r\n\"Allah McBeal\"\r\n\"Children Are Forbidden From Saying Anything Darndest\"\r\n\"Matima Loves Chachi\"\r\n\"The Brian Benben Bin Laden Show\"\r\n\"Buffy The Slayer of Yankee Imperialist Dogs\"\r\n\"Wheel of Fortune and Terror\"\r\n\"Iraq\'s Wackiest Public Execution Bloopers\"\r\n\"Achmed\'s Creek\"\r\n\"The Price is Right If Saddam Says It\'s Right\"\r\nM*U*S*T*A*S*H\r\n\"Veronica\'s Closet Full of Long, Black, Shapeless Dresses\"\r\n\"Two Guys, a Girl, and a Mosque\"\r\n\"When Kurds Attack\"\r\n\"Just Shoot Me\"\r\n\"My Two Baghdads\"\r\n\"Captured Iranian Soldiers Say the Darndest Things\"\r\n\"Two Guys, a Girl and a Fatwah\"\r\n\"Totally Clothed Baywatch\"',NULL,0.00,NULL,162,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1442,15,'Military Wisdom!','1. If the enemy is in range, so are you.\r\n2. Incoming fire has the right of way.\r\n3. Don\'t look conspicuous: it draws fire.\r\n4. The easy way is always mined.\r\n5. Try to look unimportant, they may be low on ammo.\r\n6. Professionals are predictable, it\'s the amateurs that are dangerous.\r\n7. The enemy invariably attacks on one of two occasions:\r\nWhen you\'re ready for them.\r\nWhen you\'re not ready for them.\r\n8. Teamwork is essential; it gives the enemy someone else to shoot at. \r\n9. If you can\'t remember, the claymore is pointed at you.\r\n10. If your attack is going well, you have walked into an ambush.\r\n11. Don\'t draw fire, it irritates the people around you.\r\n12. The only thing more accurate than incoming enemy fire is incoming friendly fire.\r\n13. When the pin is pulled, Mr. Grenade is not our friend.\r\n14. If it\'s stupid but works, it isn\'t stupid.\r\n15. When in doubt empty the magazine.\r\n16. Never share a fox hole with anyone braver than you.\r\n17. Anything you do can get you shot. Including doing dothing.\r\n18. Make it too tough for the enemy to get in and you can\'t get out.\r\n19. Mines are equal opportunity weapons.\r\n20. A Purple Heart just proves that were you smart enough to think of a plan, stupid enough to try it, and lucky enough to survive.\r\n21. Don\'t ever be the first, don\'t ever be the last and don\'t ever volunteer to do anything.\r\n22. The quartermaster has only two sizes: too large and too small.\r\n23. Five second fuses only last three seconds.\r\n24. It is generally inadvisable to eject directly over the area you just bombed.',NULL,0.00,NULL,143,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1443,15,'US Air Force Humor!','\"Squawks\" are problem listings that pilots generally leave for maintenance crews to fix before the next flight. Here are some squawks submitted by US Air Force pilots and the replies from the maintenance crews. \r\n\r\n(P)=PROBLEM (S)=SOLUTION \r\n\r\n(P) Left inside main tire almost needs replacement \r\n(S) Almost replaced left inside main tire \r\n\r\n(P) Test flight OK, except autoland very rough \r\n(S) Autoland not installed on this aircraft \r\n\r\n(P) #2 Propeller seeping prop fluid \r\n(S) #2 Propeller seepage normal - #1 #3 and #4 propellers \r\nlack normal seepage \r\n\r\n(P) Something loose in cockpit \r\n(S) Something tightened in cockpit \r\n\r\n(P) Evidence of leak on right main landing gear \r\n(S) Evidence removed \r\n\r\n(P) DME volume unbelievably loud \r\n(S) Volume set to more believable level \r\n\r\n(P) Dead bugs on windshield \r\n(S) Live bugs on order \r\n\r\n(P) Autopilot in altitude hold mode produces a 200 fpm descent\r\n(S) Cannot reproduce problem on ground \r\n\r\n(P) IFF inoperative \r\n(S) IFF always inoperative in OFF mode \r\n(IFF-Identification Friend or Foe) \r\n\r\n(P) Friction locks cause throttle levers to stick \r\n(S) That\'s what they\'re there for \r\n\r\n(P) Number three engine missing \r\n(S) Engine found on right wing after brief search \r\n\r\n(P) Aircraft handles funny \r\n(S) Aircraft warned to straighten up, \"fly right\" and be serious!\r\n\r\n(P) Target Radar hums \r\n(S) Reprogrammed Target Radar with the lyrics',NULL,0.00,NULL,120,1,1,2,'4',NULL,NULL);
INSERT INTO `jokes` VALUES (1444,15,'13 Sick Soldiers...','An army Major visits the sick soldiers, goes up to one private and asks -\r\n\"What\'s your problem, Soldier?\"\r\n\"Chronic syphilis, Sir!\"\r\n\"What treatment are you getting?\"\r\n\"Five minutes with the wire brush each day, Sir!\"\r\n\"What\'s your ambition?\"\r\n\"To get back to the front lines, Sir!\"\r\n\"Good man!\" says the Major.\r\n\r\nHe goes to the next bed.\r\n\"What\'s your problem, Soldier?\"\r\n\"Chronic piles, Sir!\"\r\n\"What treatment are you getting?\"\r\n\"Five minutes with the wire brush each day, Sir!\"\r\n\"What\'s your ambition?\"\r\n\"To get back to the front lines, Sir!\"\r\n\"Good man!\" says the Major.\r\n\r\nHe goes to the next bed.\r\n\"What\'s your problem, Soldier?\"\r\n\"Chronic gum disease, Sir!\"\r\n\"What treatment are you getting?\"\r\n\"Five minutes with the wire brush each day, Sir!\"\r\n\"What\'s your ambition?\"\r\n\"To get to the front of the line and get the wire brush before the other two - Sir!\"',NULL,0.00,NULL,151,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1445,15,'Alter Your Course!','This is an actual radio conversation released by the Chief of Naval\r\nOperations, 10-10-95, MSG#H0000115020ecb52EMHS \r\n\r\n#1: \"Please divert your course 15 degrees to the north to avoid a collision.\"\r\n#2: \"Recommend that you change YOUR course 15 degrees to the south to avoid a collision.\"\r\n\r\n#1: \"This is the captain of a U.S. navy ship. I say again, divert YOUR course.\"\r\n#2: \"No, I say again divert YOUR course.\"\r\n\r\n#1: \"This is the aircraft carrier Enterprise, we are a large warship of the U.S. navy. Divert your course NOW!\"\r\n#2: \"This is a lighthouse. Your call?\"',NULL,0.00,NULL,133,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1446,15,'Always on Duty','A new soldier was on sentry duty at the main gate. His orders were\r\nclear: No car was to enter unless it had a special sticker on the\r\nwindshield. A big Army car came up with a general seated in the back.\r\nThe sentry said, \"Halt, who goes there?\"\r\n\r\nThe chauffeur, a corporal, says, \"General Wheeler.\"\r\n\r\n\"I\'m sorry, I can\'t let you through. You\'ve got to have a sticker on\r\nthe windshield.\"\r\n\r\nThe general said, \"Drive on!\"\r\n\r\nThe sentry said, \"Hold it! You really can\'t come through. I have\r\norders to shoot if you try driving in without a sticker.\"\r\n\r\nThe general repeated, \"I\'m telling you, son, drive on!\"\r\n\r\nThe sentry walked up to the rear window and said, \"General, I\'m new at\r\nthis. Do I shoot you or the the driver?\"',NULL,0.00,NULL,159,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1447,15,'Army vs. Marines!','Two Marines boarded a quick shuttle flight out of Dallas, headed for Houston.\r\nOne sat in the window seat, the other sat in the middle seat.\r\n\r\nJust before take-off, an Army soldier got on and took the aisle seat next to the two Marines.\r\n\r\nThe Soldier kicked off his shoes, wiggled his toes and was settling in when the Marine in the window seat said, \"I think I\'ll get up and get a coke.\"\r\n\"No problem,\" said the Soldier, \"I\'ll get it for you.\"\r\n\r\nWhile he was gone, the Marine picked up the Soldier\'s shoe and spit in it. When the Soldier returned with the coke, the Marine in the middle seat said, \"That looks good, I think I\'ll have one too.\"\r\n\r\nAgain, the Soldier obligingly went to fetch it and while he was gone, the Marine picked up the soldier\'s other shoe and spit in it. The Soldier returned and they all sat back and enjoyed the rest of the short flight to Houston.\r\n\r\nAs the plane was landing, the Soldier slipped his feet into his shoes and knew immediately what had happened.\r\n\r\n\"How long must this go on?\" the Soldier asked.\r\n\r\n\"This fighting between our services? This hatred? This animosity?\r\nThis spitting in shoes and peeing in cokes?\"',NULL,0.00,NULL,147,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1448,15,'Battle on the Ocean','Long ago, when sailing ships ruled the waves, a captain and his crew were in danger of being boarded by a pirate ship. As the crew became frantic, the captain bellowed to his First Mate, \'Bring me my red shirt!\'\r\n\r\nThe First Mate quickly retrieved the captain\'s red shirt, which the captain put on and led the crew to battle the pirate boarding party. Although some casualties occurred among the crew, the pirates were repelled.\r\n\r\nLater that day, the lookout screamed that there were two pirate vessels sending boarding parties. The crew cowered in fear, but the captain, calm as ever bellowed, \'Bring me my red shirt!\'\r\n\r\nAnd once again the battle was on. However, the Captain and his crew repelled both boarding parties, though this time more casualties occurred.\r\n\r\nWeary from the battles, the men sat around on deck that night recounting the day\'s occurrences when an ensign looked to the Captain and asked, \'Sir, why did you call for your red shirt before the battle?\'\r\n\r\nThe Captain, giving the ensign a look that only a captain can give, exhorted, \'If I am wounded in battle, the red shirt does not show the wound and thus, you men will continue to fight unafraid.\'\r\nThe men sat in silence marveling at the courage of such a man.\r\n\r\nAs dawn came the next morning, the lookout screamed that there were pirate ships, 10 of them, all with boarding parties on their way. \r\nThe men became silent and looked to the Captain, their leader, for his usual command.\r\nThe Captain, calm as ever, bellowed, \'Bring me my brown pants!\' ',NULL,0.00,NULL,135,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1449,15,'Dear John Reply','The soldier serving overseas and far from home was annoyed and upset when his girl wrote breaking off their engagement and asking for her photograph back.\r\n\r\nA creative fellow, he went out and collected from his buddies all the unwanted photographs of women that he could find, bundled them all together and sent them to her with a note stating the following:\r\n\r\n\"Dear Mary,\r\n\r\nI can not remember which one is you ... please keep YOUR photo and return the others!\"',NULL,0.00,NULL,131,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1452,15,'Not me Sarge!','A drill sergeant had just chewed out one of his cadets, and as he was walking away, he turned to the cadet and said, \"I guess when I die you\'ll come and dance on my grave.\" \r\n\r\nThe cadet replied, \"Not me, Sarge...no sir!\r\nI promised myself that when I got out of the Army I\'d never stand in another line!\"',NULL,0.00,NULL,121,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1453,15,'On the high seas!','A merchant captain and several of his officers were returning to the ship after an evening of partying ashore.\r\n\r\nAs they climbed the gangway, the captain threw up all over himself. Pointing to an apprentice seaman above, him he shouted, \"Give that man five days in the brig for vomiting!\"\r\n\r\nThe following morning the captain was checking the log and saw that the young seaman had been sentenced to ten days and asked the chief mate why.\r\n\r\n\"Well Sir, when we got you undressed we found that he\'d also took a dump in your pants.\"',NULL,0.00,NULL,122,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1454,15,'People who don\'t believe in retaliation...','What to do if you fall into a conversation with someone about the terrorist attacks who doesn\'t believe in retaliation:\r\n\r\n1. Engage in conversation, and ask if military force is appropriate.\r\n\r\n2. When he says \"No,\" ask, \"Why not?\"\r\n\r\n3. Wait until he says something to the effect of \"Because that would just cause more innocent deaths, which would be awful and we should not cause more violence.\"\r\n\r\n4. When he\'s in mid sentence, punch him in the face as hard as you can.\r\n\r\n5. When he gets back up to punch you, point out that it would be a mistake and contrary to his values to strike you, because that would be awful and he should not cause more violence.\r\n\r\n6. Wait until he agrees, and has pledged not to commit additional violence.\r\n\r\n7. Punch him in the face again, harder this time.\r\n\r\n8. Repeat steps 5 through 8 until he understands that sometimes it is necessary to punch back.',NULL,0.00,NULL,119,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1455,15,'Role Reversal','A visitor, returning to Kuwait for the first time since the Gulf War, was impressed by a sociological change. On previous visits she noted that women customarily walked about 5 paces behind their husbands.\r\n\r\nShe observed that the men now walked over 20 paces BEHIND their wives!\r\n\r\nShe approached one of the women for an explanation: \"What enabled women here to achieve this marvellous reversal of roles?\" \r\n\r\n\"Land mines,\" replied the Kuwaiti woman.',NULL,0.00,NULL,132,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1456,15,'Saved Your Privates','A soldier goes into the hospital for surgery after being wounded in battle.\r\n\r\nWaking up from the anesthesia he sees his doctor standing at his bedside. \"So tell me Doc, what did you do to me?\"\r\n\r\nThe doctor says, \"Son, we have some good news and some bad news.\" \r\n\r\n\"Yeah, what?\" replies the patient. \r\n\r\n\"Well the good news is that we were able to save your private parts.\" \r\n\r\n\"Yes, that is good news Doc, but what about the bad news?\"\r\n\r\n\"We put them under your pillow!\"',NULL,0.00,NULL,154,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1458,15,'Sick and Pompous General','The general was confined to the military hospital for treatment of a minor malady.\r\n\r\nFor almost a week he made a complete nuisance of himself, irritating both staff and the other patients, demanding attention and expecting his every order to be followed immediately. He was in a six-man ward rather than a private room, his meals were too cold or not served to suit his taste, the light needed to be adjusted to his demands, the nighttime activities interfered with his rest... and on, and on.\r\n\r\nOne afternoon an orderly entered the room. \"Time to take your temperature, General.\"\r\n\r\nAfter growling at the orderly, the general opened his mouth to accept the thermometer.\r\n\r\n\"Sorry, General, but for this test we need your temperature from the other end.\"\r\n\r\nA whole new barrage of verbal abuse followed, but the orderly was insistent that a rectal temperature was what the test called for.\r\n\r\nThe general at last rolled over, bared his rear, and allowed the orderly to proceed. The orderly then told the general, \"Stay exactly like that and don\'t move. I\'ll be back in five minutes to check up on you\" and withdrew.\r\n\r\nAn hour later, the head nurse entered the room, saw the general with his bare rear in the air and gasped, \"What\'s going on here?\"\r\n\r\n\"Haven\'t you ever seen someone having their temperature taken?\" the general barked.\r\n\r\n\"Yes I have, General, but with a daffodil?\"',NULL,0.00,NULL,114,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1460,15,'Standing Still','During camouflage training in Louisiana, a private disguised as a tree trunk had made a sudden move that was spotted by a visiting general.\r\n\r\n\"You simpleton!\" the officer barked. \"Don\'t you know that by jumping and yelling the way you did, you could have endangered the lives of the entire company?\"\r\n\r\n\"Yes sir,\" the solder answered apologetically. \"But, if I may say so, I did stand still when a flock of pigeons used me for target practice. And I never moved a muscle when a large dog peed on my lower branches. But when two squirrels ran up my pants leg and I heard the bigger say, \"Let\'s eat one now and save the other until winter\' ---that did it!\"',NULL,0.00,NULL,151,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1461,15,'The General\'s Temperature','The general was confined to the military hospital for treatment of a minor malady. \r\n\r\nFor almost a week he made a complete nuisance of himself, irritating both staff and the other patients, demanding attention and expecting his every order to be followed immediately. \r\n\r\nHe was in a six-man ward rather than a private room, his meals were too cold or not served to suit his taste, the light needed to be adjusted to his demands, the nighttime activities interfered with his rest... and on, and on.\r\n\r\nOne afternoon an orderly entered the room. \"Time to take your temperature, General.\"\r\n\r\nAfter growling at the orderly, the general opened his mouth to accept the thermometer.\r\n\r\n\"Sorry, General, but for this test we need your temperature from the other end.\"\r\n\r\nA whole new barrage of verbal abuse followed, but the orderly was insistent that a rectal temperature was what the test called for.\r\n\r\nThe general at last rolled over, bared his rear, and allowed the orderly to proceed. The orderly then told the general, \"Stay exactly like that and don\'t move. I\'ll be back in five minutes to check up on you\" and withdrew.\r\n\r\nAn hour later, the head nurse entered the room, saw the general with his bare rear in the air and gasped, \"What\'s going on here?\"\r\n\r\n\"Haven\'t you ever seen someone having their temperature taken?\" the general barked.\r\n\r\n\"Yes I have, General, but with a daffodil?\"',NULL,0.00,NULL,139,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1462,15,'The Interview','Note: This is an extract of a National Public Radio (NPR) interview between a female broadcaster, and US Army General Reinwald who was about to sponsor a Boy Scout Troop visiting his military installation.\r\n\r\nINTERVIEWER: \" So, General Reinwald, what things are you going to teach these young boys when they visit your base?\"\r\nGENERAL REINWALD: We\'re going to teach them climbing, canoeing, archery, and shooting.\"\r\n\r\nINTERVIEWER: \"Shooting! that\'s a bit irresponsible, isn\'t it?\"\r\nGENERAL REINWALD: \"I don\'t see why, they\'ll be properly supervised on the rifle range.\"\r\n\r\nINTERVIEWER: \"Don\'t you admit that this is a terribly dangerous activity to be teaching children?\"\r\nGENERAL REINWALD: \"I don\'t see how, ....we will be teaching them proper rifle discipline before they even touch a firearm.\"\r\n\r\nINTERVIEWER: \"But you\'re equipping them to become violent killers.\"\r\nGENERAL REINWALD: \"Well, you\'re equipped to be a prostitute, but you\'re not one, are you?\"\r\nThe radio went silent and the interview ended.',NULL,0.00,NULL,155,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1463,15,'The last laugh!','Several years ago, after having Japanese executives from the automotive industry tour a Ford Plant, they held a press conference in which one of the Japanese execs claimed that the American workers were slow and lazy.\r\n\r\nNot long after, a friend sent me a picture of a bumper sticker on a truck at the Ford plant.\r\n\r\nIt read - \"We may be slow and lazy, but we build a damn good bomb!\"',NULL,0.00,NULL,137,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1465,15,'The Recruits','Ten Recruits had just arrived at the training camp and were lined up for inspection.\r\n\r\n\"Hey johnson!\" yelled the drill instructor, \" those are the ugliest shoes i\'ve ever seen! \"\r\n\"Yes, sir\" the young man answered.\r\n\r\n\"Those shoes are really really ugly, right?\" hollered the D.I again\r\n\"Yes, sir!\"\r\n\r\n\"And that hair- dont they have barbershops where you came from?\"\r\n\"Yes, sir\", answered the recruit.\r\n\"So why didnt you get a haircut?\"\r\n\"I was saving up for shoes, sir!\"',NULL,0.00,NULL,129,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1466,15,'Two Terrorists','Two terrorists are chatting. One of them has his wallet out and is flipping through pictures. \"Yeah, this is my oldest. He\'s a martyr. Here\'s my second son. He\'s a martyr, too.\"\r\n\r\nThere\'s a pause.\r\n\r\nThen, the second terrorist says, wistfully: \"Ah, they blow up so fast, don\'t they?\"',NULL,0.00,NULL,142,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1467,15,'Wooden Airfield','An enemy decoy, built in occupied Holland, led to a tale that has been told and retold ever since by veteran Allied pilots. The German \"airfield,\" constructed with meticulous care, was made almost entirely of wood. There were wooden hangars, oil tanks, gun emplacements, trucks, and aircraft.\r\n\r\nThe Germans took so long in building their wooden decoy that Allied photo experts had more than enough time to observe and report it.\r\n\r\nThe day finally came when the decoy was finished, down to the last wooden plank. Early the following morning, a lone RAF plane crossed the Channel, came in low, circled the field once, and dropped a large wooden bomb.',NULL,0.00,NULL,141,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1469,16,'Cool Bumper Stickers!','1) God is my co-pilot, but the Devil is my bombardier.\r<BR>\n<BR>\r<BR>\n2) I don\'t have a license to kill. I have a learner\'s permit.\r<BR>\n<BR>\r<BR>\n3) I wasn\'t born a bitch. Men like you made me this way.\r<BR>\n<BR>\r<BR>\n4) Keep honking while I reload.\r<BR>\n<BR>\r<BR>\n5) Taxation WITH representation isn\'t so hot, either!\r<BR>\n<BR>\r<BR>\n6) Madness takes its toll. Please have exact change.\r<BR>\n<BR>\r<BR>\n7) 5 days/week my body is a temple. The other two, it\'s an amusement park.\r<BR>\n<BR>\r<BR>\n8) EARTH FIRST! We\'ll stripmine the other planets later.\r<BR>\n<BR>\r<BR>\n9) Your child may be an honor student but you\'re still an idiot.\r<BR>\n<BR>\r<BR>\n10) If you drink, don\'t park. Accidents cause people.\r<BR>\n<BR>\r<BR>\n11) If you can read this, I can hit my brakes and sue you.\r<BR>\n<BR>\r<BR>\n12) Save the whales! Trade them for valuable prizes.\r<BR>\n<BR>\r<BR>\n13) My wife complains I never listen to her...or something like that.\r<BR>\n<BR>\r<BR>\n14) Sure you can trust the government! Just ask a Native American!\r<BR>\n<BR>\r<BR>\n15) If we are what we eat; I\'m cheap, fast, and easy.\r<BR>\n<BR>\r<BR>\n16) Stop repeat offenders. Don\'t re-elect them!',NULL,0.25,4,1523,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1470,16,'Daffynitions!','Arbitrator ar\'-bi-tray-ter: \r<BR>\nA cook that leaves Arby\'s to work at McDonald\'s. \r<BR>\n\r<BR>\nAvoidable uh-voy\'-duh-buhl: \r<BR>\nWhat a Italian bullfighter tries to do. \r<BR>\n\r<BR>\nBaloney uh-lo\'-nee: \r<BR>\nWhere some hemlines fall. \r<BR>\n\r<BR>\nBernadette urn\'-a-det: \r<BR>\nThe act of torching a mortgage. \r<BR>\n\r<BR>\nBurglarize ur\'-gler-ize: \r<BR>\nWhat a crook sees with. \r<BR>\n\r<BR>\nCounterfeiters kown-ter-fit-ers: \r<BR>\nWorkers who put together kitchen cabinets. \r<BR>\n\r<BR>\nEclipse e-klips\': \r<BR>\nWhat an English barber does for a living. \r<BR>\n\r<BR>\nEyedropper i\'-drop-ur: \r<BR>\nA clumsy ophthalmologist. \r<BR>\n\r<BR>\nHeroes hee\'-rhos: \r<BR>\nWhat a guy in a boat does. \r<BR>\n\r<BR>\nLeft Bank left\' bangk\': \r<BR>\nWhat the robber did when his bag was full of loot. \r<BR>\n\r<BR>\nMisty mis\'-tee: \r<BR>\nHow golfers create divots. \r<BR>\n\r<BR>\nParadox par\'-uh-doks: \r<BR>\nTwo physicians. \r<BR>\n\r<BR>\nParasites par\'-uh-sites: \r<BR>\nWhat you see from the top of the Eiffel Tower. \r<BR>\n\r<BR>\nPharmacist farm\'-uh-sist: \r<BR>\nA helper on the farm. \r<BR>\n\r<BR>\nPolarize po\'-lur-ize: \r<BR>\nWhat penguins see with.',NULL,1.00,2,694,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1474,16,'VanGogh Family','Vincent Van Gogh had a really large family. Here\'s a listing of some of the lessor known ones...\r<BR>\n\r<BR>\nThe grandfather who moved to Yugoslavia ........ U. Gogh\r<BR>\n\r<BR>\nThe brother who bleached all his clothes white .. Hue Gogh\r<BR>\n\r<BR>\nThe sister who wore a mini skirt to dance in bars ... Go Gogh\r<BR>\n\r<BR>\nThe real obnoxious brother .......... Please Gogh\r<BR>\n\r<BR>\nThe brother who ate prunes ............ Gotta Gogh\r<BR>\n\r<BR>\nThe uncle who worked at a convenience store ....... Stop N Gogh\r<BR>\n\r<BR>\nHis dizzy aunt ............. Verti Gogh\r<BR>\n\r<BR>\nThe cousin that moved to Illinois ......... Chicah Gogh\r<BR>\n\r<BR>\nHis magician uncle .............. Wherediddy Gogh\r<BR>\n\r<BR>\nThe cousin who lived in Mexico .......... Amee Gogh\r<BR>\n\r<BR>\nAnother cousin who lived in Mexico ......... Green Gogh\r<BR>\n\r<BR>\nNephew that drove a stage coach .......... Wells Far Gogh\r<BR>\n\r<BR>\nAunt who was a good dancer .............. Tan Gogh',NULL,0.00,NULL,335,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1475,16,'Very Short Books','Very Short Books...\r<BR>\n\r<BR>\n1) Outdoor activities in Chernobyl\r<BR>\n2) Hot Scenic Real-estate opportunities on top of Mt St. Helens\r<BR>\n3) Investment opportunities in worm futures for the deceased\r<BR>\n4) Ballerina lessons for men with size 13 or larger feet\r<BR>\n5) Defensive Driving tips for the Blind\r<BR>\n6) Contraceptive tips for Nuns\r<BR>\n7) Delicious Beef Recipes for Hindus\r<BR>\n8) Mutual Fund Investment strategies for compulsive gamblers\r<BR>\n9) Cooking with Pork Fat for Vegetarians\r<BR>\n10) GreenPeace Guide for Buying Quality Baby Seal coats\r<BR>\n11) GreenPeace Guide to Preparing Fast & Easy Whale Dishes\r<BR>\n12) Jewish and Arab Friendship Customs\r<BR>\n13) Human Rights organizations in Libya\r<BR>\n14) Democracy Debate clubs in Cuba\r<BR>\n15) Applying for Tibetan Vendors Permits\r<BR>\n16) Applying for Flight Clearance over The White House\r<BR>\n17) Guide to Redneck Gay Bars\r<BR>\n18) Guide to NeoNazis Jewish Friendship Centers\r<BR>\n19) Famous Native American Judges, Senators and Presidents\r<BR>\n20) Famous Black Canadian Hockey Players\r<BR>\n21) Famous Hillbilly Physics\r<BR>\n22) Guide to apply for Pan Handling Permit in Singapore\r<BR>\n23) Street guide to most original graffiti in Singapore\r<BR>\n24) Country Singers who have appeared at Carnegie Hall\r<BR>\n25) Sports Illustrated\'s Gay Mens Swimsuit Edition\r<BR>\n26) How to start you own part time Hospital from home\r<BR>\n27) Guide to Gay NBA, NFL, AFL & NHL Teams\r<BR>\n28) E-mail address directory for the homeless\r<BR>\n29) All Night Libyan Moshe pits\r<BR>\n30) List of Fine Wines from Iran',NULL,0.00,NULL,481,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1477,16,'Vincent Van Gogh\'s relatives:','After much careful research, it has been discovered that the artist Vincent Van Gogh had many relatives.\r<BR>\n\r<BR>\nAmong them were:\r<BR>\n\r<BR>\nHis obnoxious brother.............................. Please Gogh\r<BR>\nHis dizzy aunt..................................... Verti Gogh\r<BR>\nThe brother who ate prunes..........................Gotta Gogh\r<BR>\nThe constipated uncle.............................. Cant Gogh\r<BR>\nThe brother who worked at a convenience store.......Stopn Gogh\r<BR>\nThe grandfather from Yugoslavia.....................U Gogh\r<BR>\nThe brother who bleached his clothes white..........Hue Gogh\r<BR>\nThe cousin from Illinois............................Chica Gogh\r<BR>\nHis magician uncle..................................Wherediddy Gogh\r<BR>\nHis Italian uncle.......................................Day Gogh\r<BR>\nHis Mexican cousin..................................Amee Gogh\r<BR>\nThe Mexican cousin\'s American half brother..........Grin Gogh\r<BR>\nThe nephew who drove a stage coach................. Wellsfar Gogh\r<BR>\nThe ballroom dancing aunt...........................Tan Gogh\r<BR>\nA sister who loved disco............................Go Gogh\r<BR>\nThe bird lover uncle................................Flamin Gogh\r<BR>\nHis nephew psychoanalyst............................E Gogh\r<BR>\nThe fruit loving cousin.............................Man Gogh\r<BR>\nAn aunt who taught positive thinking................Wayto Gogh\r<BR>\nThe little bouncy nephew............................Poe Gogh\r<BR>\nAnd his niece who travels the country in a van......Winnie Bay Gogh',NULL,0.33,3,872,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1478,16,'Warning Labels On Booze!','THE MINISTRY OF HEALTH HAS PROPOSED THAT WARNING SIGNS BE PLACED ON BOOZE BOTTLES TO TIP OFF DRINKERS ABOUT THE POSSIBLE PERIL OF POUNDING A PINT OR TWO.\r\n\r\n1. WARNING: consumption of alcohol may cause you to wake up with breath that could knock a buzzard off a sewer truck at 100 yards.\r\n\r\n2. WARNING: consumption of alcohol is a major factor in dancing like an idiot.\r\n\r\n3. WARNING: consumption of alcohol may cause you to tell the same boring story over and over again until your friends want to SMASH YOUR HEAD IN.\r\n\r\n4. WARNING: consumption of alcohol may cause you to thay shings like thish.\r\n\r\n5. WARNING: consumption of alcohol may cause you to tell the boss what you REALLY think while photocopying your butt at the office Christmas party.\r\n\r\n6. WARNING: consumption of alcohol may lead you to believe that ex-lovers are really dying for you to telephone them at 4 in the morning.\r\n\r\n7. WARNING: consumption of alcohol may leave you wondering what the hell ever happened to your pants anyway.\r\n\r\n8. WARNING: consumption of alcohol may cause you to roll over in the morning and see something really scary (whose species and or name you can\'t remember).\r\n\r\n9. WARNING: consumption of alcohol is the leading cause of inexplicable rug burn on the forehead.\r\n\r\n10. WARNING: consumption of alcohol may create the illusion that you are tougher, handsomer and smarter than some really, really big guy named Psycho.',NULL,0.00,NULL,507,1,1,1,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1480,16,'What my Mom taught me','All the things my mother taught me:\r\n\r\nMy mom taught me TO APPRECIATE A JOB WELL DONE -\r\n\"If you\'re going to kill each other, do it outside - I just finished cleaning!\"\r\n\r\nMy mother taught me RELIGION -\r\n\"You better pray that will come out of the carpet.\"\r\n\r\nMy mother taught me about TIME TRAVEL:\r\n\"If you don\'t straighten up, I\'m going to knock you into the middle of next week!\"\r\n\r\nMy mother taught me LOGIC:\r\n\"Because I said so, that\'s why.\"\r\n\r\nMy mother taught me FORESIGHT -\r\n\"Make sure you wear clean underwear, in case you\'re in an accident.\"\r\n\r\nMy mother taught me IRONY -\r\n\"Keep laughing and I\'ll *give* you something to cry out.\"\r\n\r\nMy mother taught me about the science of OSMOSIS -\r\n\"Shut your mouth and eat your supper!\"\r\n\r\nMy mother taught me about CONTORTIONISM -\r\n\"Will you *look* at the dirt on the back of your neck!\"\r\n\r\nMy mother taught me about STAMINA -\r\n\"You\'ll sit there \'til all that spinach is finished.\"\r\n\r\nMy mother taught me about WEATHER -\r\n\"It looks as if a tornado swept through your room.\"\r\n\r\nMy mother taught me how to solve PHYSICS PROBLEMS -\r\n\"If I yelled because I saw a meteor coming toward you; would you listen then?\"\r\n\r\nMy mother taught me about HYPOCRISY -\r\n\"If I\'ve told you once, I\'ve told you a million times - don\'t exaggerate!!!\"\r\n\r\nMy mother taught me THE CIRCLE OF LIFE -\r\n\"I brought you into this world, and I can take you out.\"\r\n\r\nMy mother taught me about BEHAVIOR MODIFICATION -\r\nStop acting like your father!\"\r\n\r\nMy mother taught me about ENVY -\r\n\"There are millions of less fortunate children in this world who don\'t have wonderful parents like you do!\"',NULL,10.00,1,9578,1,1,1,'3',NULL,NULL);
INSERT INTO `jokes` VALUES (1481,16,'Why, why, Tell me WHY?','WHY ? ......\r<BR>\n\r<BR>\n1. Is it good if a vacuum really sucks? \r<BR>\n2. Why is the third hand on the watch called the second hand? \r<BR>\n3. If a word is misspelled in the dictionary, how would we ever know? \r<BR>\n4. If Webster wrote the first dictionary, where did he find the words? \r<BR>\n5. Why do we say something is out of whack? What is a whack? \r<BR>\n6. Why does \"slow down\" and \"slow up\" mean the same thing? \r<BR>\n7. Why does \"fat chance\" and \"slim chance\" mean the same thing? \r<BR>\n8. Why do \'tug\' boats push their barges? \r<BR>\n9. Why do we sing \"Take me out to the ball game\" when we are already there?\r<BR>\n10. Why are they called \"stands\" when they are made for sitting? \r<BR>\n11. Why is it call \"after dark\" when it really is \"after light\" ? \r<BR>\n12. Doesn\'t \'expecting the unexpected\" make the unexpected expected? \r<BR>\n13. Why are a \'wise man\' and a \'wise guy\' opposites? \r<BR>\n14. Why do \'overlook and \'oversee\' mean opposite things? \r<BR>\n15. Why is phonics not spelled the way it sounds? \r<BR>\n16. If work is so terrific, why do they have to pay you to do it? \r<BR>\n17. If all the world is a stage, where is the audience sitting? \r<BR>\n18. If love is blind, why is lingerie so popular? \r<BR>\n19. If you are cross-eyed and have dyslexia, can you read all right? \r<BR>\n20. Why is bra singular and panties plural? \r<BR>\n21. Why do you press harder on the buttons of a remote control when you know the batteries are dead? \r<BR>\n22. Why do we put suits in garment bags and garments in a suitcase? \r<BR>\n23. How come abbreviated is such a long word? \r<BR>\n24. Why do we wash bath towels? Aren\'t we clean when we use them? \r<BR>\n25. Why doesn\'t glue stick to the inside of the bottle?',NULL,10.00,1,1579,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1482,16,'Words of wisdom','All those who believe in psychokinesis raise my hand.\r<BR>\nEarly bird gets the worm, but the second mouse gets the cheese\r<BR>\nQuantum Mechanics: The dreams stuff is made of\r<BR>\nI almost had a psychic girlfriend but she left me before we met\r<BR>\nOK, so what\'s the speed of dark?\r<BR>\nHow do you tell when you run out of invisible ink?\r<BR>\nIf everything seems to be going well, you have obviously overlooked something.\r<BR>\nSupport bacteria - they\'re the only culture some people have\r<BR>\nDepression is merely anger without enthusiasm\r<BR>\nWhen everything\'s coming your way, you\'re in the wrong lane.\r<BR>\nAmbition is a poor excuse for not having enough sense to be lazy.\r<BR>\nHard work pays off in the future. Laziness pays off now.\r<BR>\nThe only substitute for good manners is fast reflexes.\r<BR>\nEveryone has a photographic memory. Some don\'t have film.\r<BR>\nShin: a device for finding furniture in the dark.\r<BR>\nMany people quit looking for work when they find a job.\r<BR>\nI intend to live forever - so far, so good\r<BR>\nJoin the Army, meet interesting people, kill them.\r<BR>\nEnergizer Bunny arrested, charged with battery.\r<BR>\nIf Barbie is so popular, why do you have to buy her friends?\r<BR>\nEagles may soar, but weasels don\'t get sucked into jet engines\r<BR>\nI\'m not cheap, but I am on special this week\r<BR>\nI drive way too fast to worry about cholesterol\r<BR>\nI love defenseless animals, especially in a good gravy\r<BR>\nIf you ain\'t makin\' waves, you ain\'t kickin\' hard enough!\r<BR>\nMental backup in progress - Do Not Disturb!\r<BR>\nMind Like A Steel Trap - Rusty And Illegal In 37 States\r<BR>\nTelevangelists: The Pro Wrestlers of religion.\r<BR>\nGive a man a free hand and he\'ll run it all over you.\r<BR>\nIf I worked as much as others, I would do as little as they.\r<BR>\nBeauty is in the eye of the beer holder ...\r<BR>\n24 hours in a day ... 24 beers in a case ... coincidence?\r<BR>\nDancing is a perpendicular expression of a horizontal desire.\r<BR>\nWhen I\'m not in my right mind, my left mind gets pretty crowded.',NULL,0.00,NULL,472,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1484,16,'Zen Quotes','1. Do not walk behind me, for I may not lead. Do not walk ahead of me, for I may not follow. Do not walk beside me, either; just #$%^ off and leave me alone.\r<BR>\n\r<BR>\n2. The journey of a thousand miles begins with a broken fan belt and a flat tire.\r<BR>\n\r<BR>\n3. It\'s always darkest before dawn. So if you\'re going to steal your neighbor\'s newspaper, that\'s the time to do it.\r<BR>\n\r<BR>\n4. Don\'t be irreplaceable; if you can\'t be replaced, you can\'t be promoted.\r<BR>\n\r<BR>\n5. No one is listening until you make a mistake.\r<BR>\n\r<BR>\n6. Always remember you\'re unique, just like everyone else.\r<BR>\n\r<BR>\n7. Never test the depth of the water with both feet.\r<BR>\n\r<BR>\n8. It may be that your sole purpose in life is simply to serve as a warning to others.\r<BR>\n\r<BR>\n9. It is far more impressive when others discover your good qualities without your help.\r<BR>\n\r<BR>\n10. If you think nobody cares if you\'re alive, try missing a couple of car payments.\r<BR>\n\r<BR>\n11. Before you criticize someone, you should walk a mile in their shoes. That way, when you criticize them, you\'re a mile away and you have their shoes.\r<BR>\n\r<BR>\n12. If at first you don\'t succeed, skydiving is not for you.\r<BR>\n\r<BR>\n13. Give a man a fish and he will eat for a day. Teach him how to fish, and he will sit in a boat & drink beer all day.\r<BR>\n\r<BR>\n14. If you lend someone $20, and never see that person again, it was probably worth it.\r<BR>\n\r<BR>\n15. Don\'t squat with your spurs on.\r<BR>\n\r<BR>\n17. If you drink, don\'t park; accidents cause people.\r<BR>\n\r<BR>\n18. Some days you are the bug, some days you are the windshield.\r<BR>\n\r<BR>\n19. The quickest way to double your money is to fold it in half and put it back in your pocket.\r<BR>\n\r<BR>\n20. Duct tape is like the force; it has a light side and a dark side, and it holds the universe together.',NULL,0.00,NULL,381,1,1,1,'',NULL,NULL);
