INSERT INTO `jokes` VALUES (1519,16,'A Wish Comes True','A man walks up to the bar with an ostrich behind him, and as he sits, the bartender asks for their order.\r<BR>\n\r<BR>\nThe man says, \"I\'ll have a beer\" and turns to the ostrich. \"What\'s yours?\" \"I\'ll have a beer too\" says the ostrich.\r<BR>\nThe bartender pours the beer and says \"That will be $3.40 please,\" and the man reaches into his pocket and pays with the exact change for payment.\r<BR>\n\r<BR>\nThe next day, the man and the ostrich come again, and the man says \"I\'ll have a beer,\" and the ostrich says \"I\'ll have the same.\" Once again the man reaches into his pocket and pays with exact change.\r<BR>\n\r<BR>\nThis became a routine until late one evening, the two enter again. \"The usual?\" asks the bartender.\"Well, it\'s close to last call, so I\'ll have a large Scotch\" says the man. \"Same for me\" says the ostrich. \"That will be $7.20\" says the bartender. Once again the man pulls exact change out of his pocket and places it on the bar.\r<BR>\n\r<BR>\nThe bartender can\'t hold back his curiosity any longer. \"Excuse me, sir. How do you manage to always come up with the exact change out of your pocket every time?\"\r<BR>\n\r<BR>\n\"Well,\" says the man, \"several years ago I was cleaning the attic and I found this old lamp. When I rubbed it a Genie appeared and offered me two wishes. My first wish was that if I ever needed to pay for anything, I just put my hand in my pocket and the right amount of money will be there.\"\r<BR>\n\r<BR>\n\"That\'s brilliant!\" says the bartender. \"Most people would wish for a million dollars or something, but you\'ll always be as rich as you want for as long as you live!\"\r<BR>\n\r<BR>\n\"That\'s right! Whether it\'s a gallon of milk, or a Rolls Royce, the exact money is always there,\" says the man.\r<BR>\n\"That\'s fantastic!\" says the bartender. \"You are a genius! ... Oh, one other thing sir, what\'s with the ostrich?\"\r<BR>\n\r<BR>\nThe man replies, \"Oh, my second wish was for a chick with long legs.\"',NULL,0.00,NULL,204,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1520,16,'Baking humor','Veteran Pillsbury spokesman, Pop N. Fresh, died yesterday of a severe yeast infection. He was 71. Known to friends as \"Brown-n-Serve,\" Fresh was an avid gardener and tennis player. Fresh was buried in one of the largest funeral ceremonies in recent years.\r<BR>\n\r<BR>\nDozens of celebrities turned out including Mrs. Butterworth, the California Raisins, Hungry Jack, Aunt Jemima, Betty Crocker, the Hostess Twinkies, and Skippy.\r<BR>\n\r<BR>\nThe graveside was piled high with flours as longtime friend, Aunt Jemima, delivered the eulogy, describing Fresh as a man who \"never knew how much he was kneaded.\"\r<BR>\n\r<BR>\nFresh rose quickly in show business, but his later life was filled with many turnovers. He was not considered a very smart cookie, wasting much of his dough on half-baked schemes -- conned by those who buttered him up. Still, even as a crusty old man, he was a roll model for millions. He enjoyed being prodded by his many friends who invariably poked fun at him.\r<BR>\n\r<BR>\nFresh is survived by his second wife. They have two children and another bun in the oven.\r<BR>\n\r<BR>\nThe funeral was held at 3:50 for about 20 minutes.',NULL,0.00,NULL,216,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1522,16,'Cocky Gunslinger','It\'s 1880, the decade of gunslingers and gentlemen. This is a story of one such young man that wanted more than anything to be the fastest and most respected gunslinger in the west.\r<BR>\n\r<BR>\nThe place was Dodge City, Kansas in the Sawdust Saloon. The young man walked into the Sawdust Saloon and, to his surprise, saw Wyatt Earp sitting at a table playing poker. The young man walked up to Wyatt and said, \"Mr. Earp, I would like to be a gunslinger just like you. Could you give me some tips?\"\r<BR>\n\r<BR>\nWyatt put his cards down, looked up at the boy and said, \"Son, I don\'t usually give out tips like this cause it could someday be detrimental to my health, but step back and let me take a look at you.\"\r<BR>\n\r<BR>\nThe boy stepped back and Mr. Earp said, \"You look good. You\'re wearing black, you\'ve got two ivory handled guns with waxed holsters, and you look like a gunslinger. But what\'s more important, son, is: Can you shoot?\"\r<BR>\n\r<BR>\nThe young man, happy to show how good he was, quickly drew his pistol from his right holster and without aiming shot the cuff link off of the piano player\'s right sleeve.\r<BR>\n\r<BR>\nWyatt said, \"That\'s good shooting son, but can you shoot with your left hand?\"\r<BR>\n\r<BR>\nBefore Earp could even finish, the boy had already drawn the pistol from his left holster and shot the cuff link off of the piano player\'s left shirt sleeve. Very proud of himself the young man blew the smoke away from his six shooter and holstered his gun. \"How was that?\" the boy asked.\r<BR>\n\r<BR>\nWyatt smiled and looked up and the boy and said, \"That was pretty good shooting son. I couldn\'t do better than that myself, but I do have one good tip for you.\"\r<BR>\n\r<BR>\n\"What\'s that?\" the boy asked.\r<BR>\n\r<BR>\n\"I suggest that you go to the kitchen and ask the cook for a large can of lard. Then take both guns of yours and stick them down deep into the lard.\"\r<BR>\n\r<BR>\nPuzzled the young gunslinger asked why he should do that.\r<BR>\n\r<BR>\nEarp put his cards down again, leaned back in his chair, and said, \"Well son, when Doc Holliday gets done playing the piano over there, he\'s going to take those two guns of yours and. . . \"\r<BR>\n\r<BR>\nThe boy didn\'t wait for the rest of the answer.',NULL,0.00,NULL,191,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1523,16,'Dare to Swim','Once there was a millionaire who collected live alligators. He kept them in the pool in back of his mansion. The millionaire also had a beautiful daughter that was single.\r<BR>\n\r<BR>\nOne day he decides to throw a huge party, during the party he announces: \"My dear guests, I have a proposition to every man here. I will give 1 million dollars or my daughter to the man that can swim across this pool full of alligators and emerge unharmed!\"\r<BR>\n\r<BR>\nAs soon as he finished his last word there was the sound of a large splash! There was one guy in the pool swimming with all his might, the crowd cheered him on as he kept stroking. Finally, he made it to the other side unharmed.\r<BR>\n\r<BR>\nThe millionaire was impressed, he said, \"My boy that was incredible!\r<BR>\nFantastic! I didn\'t think it could be done! Well, I must keep my end of the bargain, which do you want my daughter or the 1 million dollars?\"\r<BR>\n\r<BR>\nThe guy says, \"Listen, I don\'t want your money! And I don\'t want your daughter! I want the person who pushed me in that water!\"',NULL,0.00,NULL,214,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1524,16,'Defamation of character','A man was sued by a woman for defamation of character. She charged that he had called her a pig. The man was found guilty and fined.\r<BR>\n\r<BR>\nAfter the trial he asked the judge, Does this mean that I cannot call Mrs. Johnson a pig?\"\r<BR>\nThe judge said that was true.\r<BR>\n\r<BR>\n\"Does this mean I cannot call a pig, \'Mrs. Johnson\'?\" the man asked. The judge replied that he could indeed call a pig \'Mrs. Johnson\' with no fear of legal action.\r<BR>\n\r<BR>\nThe man looked directly at Mrs. Johnson and said...\r<BR>\n\"Good afternoon, Mrs. Johnson!\"',NULL,0.00,NULL,178,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1525,16,'Farmer Joe goes to Court','Farmer Joe decided his injuries from his recent accident were serious enough to take the trucking company responsible for the accident to court. In court, the trucking company\'s fancy lawyer was questioning farmer Joe.\r\n\r\n\"Didn\'t you say, at the scene of the accident, that you were fine?\"\r\n\r\n\"Well,\" said the farmer, \"I\'ll tell you what happened. I had just loaded my favorite mule Bessie into the--\"\r\n\r\n\"I didn\'t ask for any details,\'\' the lawyer interrupted. \'\'Just answer the question. Did you not say, at the scene of the accident, that you were fine?\"\r\n\r\n\"Well,\" the farmer started to explain, \"I had just got Bessie into the trailer and was driving down the road--\"\r\n\r\n\"Judge,\" the lawyer said with indignation, \"I am trying to establish the fact that, at the scene of the accident, this man told the highway patrolman on the scene that he was just fine. Now, several weeks after the accident, he is trying to sue my client. I believe he is a fraud. Please tell him to simply answer the question.\"\r\n\r\nBy this time, the Judge was fairly interested in Farmer Joe\'s answer and told the lawyer so.\r\n\r\n\"Well,\" said the farmer, \"as I was saying, I had just loaded Bessie, my favorite mule, into the trailer and was driving her down the highway when this huge semi-truck and trailer ran the stop sign and smacked my truck right in the side. I was thrown into one ditch and Bessie was thrown into the other. I was hurting real bad and didn\'t want to move. However, I could hear ol\' Bessie moaning and groaning. I knew she was in terrible shape just by her groans. Shortly after the accident, a Highway Patrolman came on the scene. He could hear Bessie moaning and groaning so he went over to her. After he looked at her, he took out his gun and shot her between the eyes. Then the patrolman came across the road with his gun in his hand and looked at me. \r\n\r\nHe said, \"Your mule was in such bad shape I had to shoot her. How are you feeling?\'\"',NULL,0.00,NULL,212,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1526,16,'Doomed!','An explorer in the deepest Amazon suddenly finds himself surrounded by a blood thirsty group of cannibals. Upon surveying the situation, he says quietly to himself, \"Oh God, I\'m doomed!\"\r<BR>\n\r<BR>\nThere is a ray of light from the sky above and a voice booms out: \"No my son, you are NOT doomed. Pick up that stone at your feet and bash in the head of the chief standing in front of you.\"\r<BR>\n\r<BR>\nSo the explorer picks up the stone and attacks the chief, feverishly bashing at his head with all his strength. He stands above the lifeless body, breathing heavily and surrounded by 100 cannibals with a look of shock on their faces.\r<BR>\n\r<BR>\nThe voice booms out again: \"Okay . . . . NOW you\'re doomed.\"',NULL,0.00,NULL,165,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1530,16,'Fun Toungue Twister!','Here\'s a fun tongue twister.\r\nRead the following list and then follow the instructions at the end.\r\nRead it LOUD and REAL FAST...see if you can do it!\r\nDON\'T read the instructions until you get it right!!!\r\n\r\nThis is this cat\r\nThis is is cat\r\nThis is how cat\r\nThis is to cat\r\nThis is keep cat\r\nThis is a cat\r\nThis is fool cat\r\nThis is busy cat\r\nThis is for cat\r\nThis is forty cat\r\nThis is seconds cat\r\n*\r\n*\r\n*\r\n*\r\n*\r\n*\r\n*\r\n*\r\n*\r\n*\r\n*\r\nDid ya do it? Now go back up and read the third word in each line starting from the top to the bottom :)',NULL,0.00,NULL,188,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1531,16,'Guess the instructions','Read the 10 to-do instructions and then scroll for the answer - NO CHEATING!\r\n\r\n1. Back straight, knees bent, feet shoulder width apart.\r\n2. Form a loose grip.\r\n3. Keep your head down.\r\n4. Avoid a quick back swing.\r\n5. Stay out of the water.\r\n6. Try not to hit anyone.\r\n7. If you are taking too long, please let others go ahead of you.\r\n8. Don\'t stand directly in front of others.\r\n9. Quiet please... while others are preparing to go.\r\n10. Don\'t take extra strokes.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\n.\r\nVery good. Now flush the urinal, go outside, and tee off!\r\n(From a sign posted at a local golf course restroom :)',NULL,0.00,NULL,191,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1533,16,'Hmmm...Ponderings','What\'s with the people who put carpeting on the lid of their toilet seat? What are they thinking -- \"Gosh, if we have a party there may not be enough standing room; I\'d better carpet the toilet too.\"\r<BR>\n\r<BR>\nHave you ever noticed that the waiter who takes your order is not the one who brings your food anymore? What is THAT about? And which waiter are you tipping, anyway? I think next time I go to a restaurant I\'ll just say, \"Oh, sorry, I only eat the food. The guy who pays the bill will be along shortly.\"\r<BR>\n\r<BR>\nWould somebody please explain to me those signs that say, \"No animals allowed except for Seeing Eye Dogs?\" Who is that sign for? Is it for the dog, or the blind person?\r<BR>\n\r<BR>\nWhy do people give each other flowers? To celebrate various important occasions, they\'re killing living creatures? Why restrict it to plants? \"Sweetheart, let\'s make up. Have this deceased squirrel.\"\r<BR>\n\r<BR>\nCan\'t we just get rid of wine lists? Do we really have to be reminded every time we go out to a nice restaurant that we have no idea what we are doing? Why don\'t they just give us a trigonometry quiz with the menu?\r<BR>\n\r<BR>\nIf airline seat cushions are such great flotation devices, why don\'t you ever see anyone take one to the beach?\r<BR>\n\r<BR>\nWhy do they call it a \"building\"? It looks like they\'re finished. Why isn\'t it a \"built\"?\r<BR>\n\r<BR>\nWhy is it when you turn on the TV you see ads for telephone companies, and when you turn on the radio you hear ads for TV shows, and when you get put on hold on the phone you hear a radio station?\r<BR>\n\r<BR>\nWhy is it illegal to park in a handicapped parking space but okay to go the bathroom in a handicapped stall?\r<BR>\n\r<BR>\nHow come you have to pay someone to rotate your tires? Isn\'t that the basic idea behind the wheel? Don\'t they rotate on their own?\r<BR>\n\r<BR>\nAll the king\'s HORSES and all the king\'s men? Are you kidding me? No wonder they couldn\'t put Humpty together again. Just what did those idiots expect the horses to do, anyway?\r<BR>\n\r<BR>\nDid you ever notice, when you are sitting at a red light, that when the person in front of you pulls up a couple of inches, you are compelled to move up too? Do we really think we are making progress toward our destination? \"Whew, I thought we would be late, but now that I am nine inches closer, I can stop for coffee and a danish!\"\r<BR>\n\r<BR>\nIsn\'t it weird that we drink milk, stuff designed to nourish baby cows? How did THAT happen? Did some cattleman once say, \"Oh, man, I can\'t wait till them calves are done so I can get ME a hit of that stuff.\"\r<BR>\n\r<BR>\nHave you ever noticed how they keep improving your laundry detergent, but they still can\'t get those blue flakes out? Why do we trust them to get our clothes clean? These guys can\'t even get the DETERGENT white!\r<BR>\n\r<BR>\nDid you see these new minivan ads? All they talk about are cup holders, kiddy seats and doors. What kind of advertising is that? When you see an ad for a suit, do they say, \"And look at the zipper! Carefully hidden, but easily accessible when you need it!\" I think not.',NULL,0.00,NULL,186,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1535,16,'How to handle telemarketers','One thing that has always bugged me, and I\'m sure it does most of you, is to sit down at the dinner table only to be interrupted by a phone call from a telemarketer. \r\n\r\nI decided, on one such occasion, to try to be as irritating as they were to me. The call was from AT&T and it went something like this: (swallowing)\r\n- Me: Hello\r\n- AT&T: Hello, this is AT&T...\r\n- Me: Is this AT&T?\r\n- AT&T: Yes, this is AT&T...\r\n- Me: This is AT&T?\r\n- AT&T: Yes This is AT&T...\r\n- Me: Is this AT&T?\r\n- AT&T: YES! This is AT&T, may I speak to Mr. Byron please?\r\n- Me: May I ask who is calling?\r\n- AT&T: This is AT&T.\r\n- Me: OK, hold on.\r\n\r\nAt this point I put the phone down for a solid 5 minutes thinking that, surely, this person would have hung up the phone. I ate my salad. Much to my surprise, when I picked up the receiver, they were still waiting.\r\n\r\n- Me: Hello?\r\n- AT&T: Is this Mr. Byron?\r\n- Me: May I ask who is calling please?\r\n- AT&T: Yes this is AT&T...\r\n- Me: Is this AT&T?\r\n- AT&T: Yes this is AT&T...\r\n- Me: This is AT&T?\r\n- AT&T: Yes, is this Mr. Byron?\r\n- Me: Yes, is this AT&T?\r\n- AT&T: Yes sir.\r\n- Me: The phone company?\r\n- AT&T: Yes sir.\r\n- Me: I thought you said this was AT&T.\r\n- AT&T: Yes sir, we are a phone company.\r\n- Me: I already have a phone.\r\n- AT&T: We aren\'t selling phones today Mr. Byron.\r\n- Me: Well whatever it is, I\'m really not interested but thanks for calling.\r\n\r\nWhen you are not interested in something, I don\'t think you can express yourself any plainer than by saying \"I\'m really not interested,\" but this lady was persistent.\r\n\r\n- AT&T: Mr. Byron, we would like to offer you 10 cents a minute, 24 hours a day, 7 days a week, 365 days a year. Now, I am sure she meant she was offering a \"rate\" of 10 cents a minute, but she at no time used the word \"rate.\" I could clearly see that it was time to whip out the trusty old calculator and do a little ciphering.\r\n- Me: Now, that\'s 10 cents a minute 24 hours a day?\r\n- AT&T: (getting a little excited at this point by my interest) Yes\r\n- sir, that\'s right! 24 hours a day!\r\n- Me: 7 days a week?\r\n- AT&T: That\'s right.\r\n- Me: 365 days a year?\r\n- AT&T: Yes sir.\r\n- Me: I am definitely interested in that! Wow!!! That\'s amazing!\r\n- AT&T: We think so!\r\n- Me: That\'s quite a sum of money!\r\n- AT&T: Yes sir, it\'s amazing how it adds up.\r\n- Me: OK, so will you send me checks weekly, monthly or just one big one at the end of the year for the full $52,560, and if you send an annual check, can I get a cash advance?\r\n- AT&T: Excuse me?\r\n- Me: You know, the 10 cents a minute.\r\n- AT&T: What are you talking about?\r\n- Me: You said you\'d give me 10 cents a minute, 24 hours a day, 7 days a week, 365 days a year. That comes to $144 per day, $1,008 per week and $52,560 per year. I\'m just interested in knowing how you will be making payment.\r\n- AT&T: Oh no, sir, I didn\'t mean we\'d be paying you. You pay us 10 cents a minute.\r\n- Me: Wait a minute here!!! Didn\'t you say you\'d give me 10 cents a minute? Are you sure this is AT&T?\r\n- AT&T: Well, yes this is AT&T sir but......\r\n- Me: But nothing, how do you figure that by saying that you\'ll give me 10 cents a minute that I\'ll give you 10 cents a minute? Is this some kind of subliminal telemarketing scheme? I\'ve read about things like this in the Enquirer, you know. Don\'t use your alien brainwashing techniques on me.\r\n- AT&T: No sir, we are offering 10 cents a minute for.....\r\n- Me: THERE YOU GO AGAIN! Can I speak to a supervisor please!\r\n- AT&T: Sir, I don\'t think that is necessary.\r\n- Me: Sure! You say that now! What happens later?\r\n- AT&T: What?\r\n- Me: I insist on speaking to a supervisor!\r\n- AT&T: Yes Mr. Byron. Please hold.\r\n\r\nSo now AT&T has me on hold and my supper is getting cold. I begin to eat while I\'m waiting for a supervisor. After a wait of a few minutes and while I have a mouth full of food:\r\n\r\n- Supervisor: Mr. Byron?\r\n- Me: Yeth?\r\n- Supervisor: I understand you are not quite understanding our 10 cents a minute program.\r\n- Me: Id thish Ath Teeth & Teeth?\r\n- Supervisor: Yes sir, it sure is.\r\n\r\nI had to swallow before I choked on my food. It was all I could do to suppress my laughter and I had to be careful not to produce a snort.\r\n\r\n- Me: No, actually, I was just waiting for someone to get back to me so that I could sign up for the plan.\r\n- Supervisor: OK, no problem, I\'ll transfer you back to the person who was helping you.\r\n- Me: Thank you.\r\n\r\nI was on hold once again and managed a few more mouthfuls. I needed to end this conversation. Suddenly, there was an aggravated but polite voice at the other end of the phone.\r\n\r\n- AT&T: Hello Mr. Byron, I understand that you are interested in signing up for our plan?\r\n- Me: Do you have that friends and family thing because you can never have enough friends and I\'m an only child and I\'d really like to have a little brother...\r\n- AT&T: (click)',NULL,0.00,NULL,171,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1536,16,'If You Love Something....','If you love something, set it free.\r<BR>\nIf it comes back, it was and always will be yours.\r<BR>\nIf it never returns, it was never yours to begin with.\r<BR>\nIf, however, it just sits in your living room,\r<BR>\nmesses up your stuff,\r<BR>\neats your food,\r<BR>\nuses your telephone,\r<BR>\ntakes your money, and\r<BR>\nnever appears to have noticed that \r<BR>\nyou actually set it free in the first place,\r<BR>\nYou either married it or gave birth to it!',NULL,0.00,NULL,180,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1538,16,'Letter To Ann Landers','Dearn Ann:\r<BR>\n\r<BR>\nI am facing a very serious problem. You see, I am a Vietnam-era deserter from the U. S. Marines, and I have a cousin who works for Microsoft. My mother peddles Nazi literature to Girl Scouts and my father (a former dentist) is in jail for 30 years for raping most of his patients while they were under anesthesia.\r<BR>\n\r<BR>\nThe sole supports of our large family, including myself and my $500-a-week heroin habit, are my uncle (master pick-pocket, Benny \"The Fingers\"), my 70-year-old aunt Hester (a shoplifter), and my two kid sisters, who are well-known streetwalkers.\r<BR>\n\r<BR>\nMy problem is this: I have just gotten engaged to the most beautiful, sweetest girl in the world. She is just sweet sixteen, and we are going to marry as soon as she can escape from reform school.\r<BR>\n\r<BR>\nTo support ourselves, we are going to move to Mexico and start a fake Aztec souvenir factory staffed by child labor. We look forward to bringing our kids into the family business.\r<BR>\n\r<BR>\nBut I am worried that my family will not make a good impression on hers. In your opinion, Should I, or shouldn\'t I, tell her about my cousin who works for Microsoft?',NULL,0.00,NULL,197,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1539,16,'Little Red Man','There was a little red man who lived in a little red house on a little red street in a little red town. Now this little red man wanted to take a little red shower so he put his little red towel on the little red towel rack. Just as he was about to get in, the little red doorbell rang.\r<BR>\n\r<BR>\nSo he put his little red towel around his little red waist and went to the little red door. He opened the little red door and there stood a woman. Just then a big gust of wind came and blew the little red towel away. The woman screamed, ran accross the road and got hit by a car.\r<BR>\n\r<BR>\nThe moral of the story? Never run accross the road when the little red man is flashing.',NULL,0.00,NULL,209,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1541,16,'Name That Ranch','A New York family bought a ranch out West where they intended to raise cattle. Friends visited and asked if the ranch had a name.\r<BR>\n\r<BR>\n\"Well,\" said the would-be cattleman, \"I wanted to name it the Bar-J. My wife favored Suzy-Q, one son like the Flying-W, and the other wanted the Lazy-Y. So we\'re calling it the Bar-J-Suzy-Q-Flying-W-Lazy-Y.\"\r<BR>\n\r<BR>\n\"But where are all your cattle?\" the friends asked.\r<BR>\n\r<BR>\n\"None survived the branding.\"',NULL,0.00,NULL,167,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1543,16,'No Fishing!','A couple went on vacation to a fishing resort up north. The husband liked to fish at the crack of dawn; the wife preferred to read. One morning the husband returned after several hours of fishing and decided to take a short nap. The wife decided to take the boat out.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\nShe was not familiar with the lake so she rowed out, anchored the boat, and started reading her book. Along comes the sheriff in his boat, pulls up alongside and says, \"Good morning, Ma\'am. What are you doing?\"\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"Reading my book,\" she replies as she thinks to herself, \"Is this guy blind or what?\" \r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"You\'re in a restricted fishing area,\" he informs her.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"But, Officer, I\'m not fishing. Can\'t you see that?\" \r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"But you have all this equipment, Ma\'am. I\'ll have to take you in and write you up.\"\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"If you do that, I will charge you with rape,\" snaps the irate woman.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"I didn\'t even touch you,\" growls the sheriff. \r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"Yes, that\'s true ... but you have all the equipment ...\" \r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\nMoral: Never argue with a woman who knows how to read!',NULL,0.00,NULL,179,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1546,16,'Pillsbury Doughboy Dead at 71!','Veteran Pillsbury spokesman Pop N. Fresh died yesterday of a severe yeast infection.\r<BR>\nHe was 71.\r<BR>\n\r<BR>\nFresh was buried in one of the largest funeral ceremonies in recent years. Dozens of celebrities turned out including Mrs. Butterworth, the California Raisins, Hungry Jack, Betty Crocker and the Hostess Twinkies.\r<BR>\n\r<BR>\nThe graveside was piled high with flours, as long time friend Aunt Jemima delivered the eulogy, describing Fresh as the man who \"never knew how much he was kneaded\". \r<BR>\n\r<BR>\nFresh rose quickly in show business, but his later life was filled with many turnovers. He was not considered a very smart cookie, wasting most of his dough on half-baked schemes. Still, even as a crusty old man, he was a roll model for millions.\r<BR>\n\r<BR>\nFresh is survived by his second wife -- they have two children and one in the oven.\r<BR>\nThe funeral was held at 4:25 for about 20 minutes.',NULL,0.00,NULL,166,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1547,16,'Please Save Her!','Standing at the edge of the lake, a man saw a woman flailing about in the deep water. Unable to swim, the man started to scream for help.\r<BR>\n\r<BR>\nA local fisherman ran up. The man gasped, \"My wife is drowning and I can\'t swim. Please save her. I\"ll give you a hundred dollars.\"\r<BR>\n\r<BR>\nThe fisherman dived into the water. In ten powerful strokes, he reached the woman, put his arm around her, and swam back to shore. \r<BR>\n\r<BR>\nDepositing her at the feet of the man, the fisherman said, \"Okay, buddy, where\'s my hundred?\"\r<BR>\n\r<BR>\nThe man said, \"Look, when I saw her going down for the third time, I thought it was my wife. But this is my mother-in-law.\"\r<BR>\n\r<BR>\nThe fisherman reached into his pocket and said...\r<BR>\n\"Just my luck! So tell me, what do I owe you?\"',NULL,0.00,NULL,198,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1548,16,'Pregnant Maid','A husband and his wife advertised for a live-in maid to cook and do the housework. A likely-looking girl came in from the country, and they hired her. She worked out fine, was a good cook, was polite, and kept the house neat.\r<BR>\n\r<BR>\nOne day, after about six months, she came in and said she would have to quit. \"But why?\" asked the disappointed wife.\r<BR>\n\r<BR>\nShe hemmed and hawed and said she didn\'t want to say, but the wife was\r<BR>\npersistent, so finally she said, \"Well, on my day off a couple of months ago I met this good-looking fellow from over in the next county, and well, I\'m pregnant.\"\r<BR>\n\r<BR>\nThe wife said, \"Look, we don\'t want to lose you. My husband and I don\'t have any children, and we\'ll adopt your baby if you will stay.\"\r<BR>\n\r<BR>\nShe talked to her husband; he agreed, and the maid said she would stay. The baby came, they adopted it, and all went well.\r<BR>\n\r<BR>\nAfter several months though, the maid came in again and said that she would have to quit. The wife questioned her, found out that she was pregnant again, talked to her husband, and offered to adopt the baby if she would stay. She agreed, had the baby, they adopted it, and life went on as usual.\r<BR>\n\r<BR>\nIn a few months, however, she again said she would have to leave. Same thing. She was pregnant. They made the same offer, she agreed, and they adopted the third baby. She worked for a week or two, but then said, \"I am definitely leaving this time.\"\r<BR>\n\r<BR>\n\"Don\'t tell me you\'re pregnant again?\" asked the lady of the house.\r<BR>\n\"No,\" she said, \"there are just too many kids here to pick up after!\"',NULL,0.00,NULL,182,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1549,16,'10 000 dollars For a Kiss','One day this fellow noticed that a new couple had moved into the house next door. He was also quick to notice that the woman liked to sunbathe in the back yard, usually in a skimpy bikini that showed off a magnificent pair of breasts. He made it a point to water and trim his lawn as much as possible, hoping for yet another look.\r<BR>\n\r<BR>\nFinally, he could stand it no more. Walking to the front door of the new neighbor\'s house, he knocked and waited. The husband, a large, burly man, opened the door. \"Excuse me\", our man stammered, \"but I couldn\'t help noticing how beautiful your wife is.\"\r<BR>\n\r<BR>\n\"Yeah? So?\" his hulking neighbor replied.\r<BR>\n\r<BR>\n\"Well, in particular, I am really struck by how beautiful her breasts are. I would gladly pay you ten thousand dollars if I could kiss those breasts.\"\r<BR>\n\r<BR>\nThe burly gorilla is about to deck our poor guy when his wife appears and stops him. She pulls him inside and they discuss the offer for a few moments. Finally, they return and ask our friend to step inside. \"OK,\" the husband says gruffly, \"for ten thousand dollars you can kiss my wife\'s tits.\"\r<BR>\n\r<BR>\nAt this the wife unbuttons her blouse, and the twin objects of desire hang free at last. Our man takes one in each hand, and proceeds to rub his face against them in total ecstasy. This goes on for several minutes, until the husband gets annoyed.\r<BR>\n\r<BR>\n\"Well, come on already, kiss \'em!\" he growls.\r<BR>\n\"I can\'t\" replies our awe-struck hero, still nuzzling away.\r<BR>\n\"Why not?\" demands the husband, getting really angry now.\r<BR>\n\r<BR>\n\"I don\'t have ten thousand dollars!\"',NULL,0.00,NULL,180,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1550,16,'Using The Thermometer!','Upon arriving home in eager anticipation of a leisurely evening, the husband was met at the door by his sobbing wife. Tearfully she explained, \"It\'s the druggist. He insulted me terribly this morning on the phone.\"\r<BR>\n\r<BR>\nImmediately the husband drove downtown to accost the druggist and demand an apology. Before he could say more than a word or two, the druggist told him, \"Now, just a minute. Listen to my side of it. This morning the alarm failed to go off, so I was late getting up. I went without breakfast and hurried out to the car, but I\'ll be damned if I didn\'t lock the house with both house and car keys inside. I had to break a window to get my keys. Driving a little too fast, I got a speeding ticket. Then, about three blocks from the store I had a flat\r<BR>\ntire.\r<BR>\n\r<BR>\nWhen I finally got to the store there was a bunch of people waiting for me to open up. I got the store opened and started waiting on these people and all the time the darn phone was ringing its head off. Then I had to break a roll of nickels against the cash register drawer to make change, and they spilled all over the floor. I got down on my hands and knees to pick up the nickels-the phone is still ringing. \r<BR>\n\r<BR>\nWhen I came up, I cracked my head on the open cash drawer, which made me stagger back against a showcase with a bunch of perfume bottles on it and half of them hit the floor and broke. The phone is still ringing with no let up and I finally got back to answer it. It was your wife -- she wanted to know how to use a rectal thermometer. And Mister, I TOLD HER!\"',NULL,0.00,NULL,144,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1552,16,'Two Statues','There are two statues standing in the woods. They have been there standing on their pedastals for 500 years. A girl statue and a boy statue.\r<BR>\n\r<BR>\nFinally one day the Good Fairy came down. You have been here for five centuries, naked just looking at one another. Now, the Good Fairy said to the statues, you have five full seconds to jump down off your pedastals and run out there in the bushes and do whatever it is that you would like to do.\r<BR>\n\r<BR>\nThe girl statue and the boy statue jumped down, ran into the bushes, came back out brushing the leaves out of their hair and jumped back upon their pedastals.\r<BR>\n\r<BR>\nThe Good Fairy said, \"you used three seconds, you have two more seconds to finish what you were doing.\"\r<BR>\n\r<BR>\nThe boy statue looked at the girl statue and said, \"this time you hold the pigeon and I\'ll poop on it\'s head!\"',NULL,0.00,NULL,145,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1553,16,'Two Statues','For decades, two heroic statues, one male and one female, faced each other in a city park, until one day an angel came down from heaven.\r\n\r\n\"You\'ve been such exemplary statues,\" he announced to them, \"That I\'m going to give you a special gift. I\'m going to bring you both to life for thirty minutes, in which you can do anything you want.\" And with a clap of his hands, the angel brought the statues to life.\r\n\r\nThe two approached each other a bit shyly, but soon dashed for the bushes, from which shortly emerged a good deal of giggling, laughter, and shaking of branches. Fifteen minutes later, the two statues emerged from the bushes, wide grins on their faces.\r\n\r\n\"You still have fifteen more minutes,\" said the angel, winking at them.\r\n\r\nGrinning even more widely the female statue turned to the male statue and said, \"Great! Only this time...\r\nyou hold the pigeon down and I\'ll crap on it\'s head.\"',NULL,0.00,NULL,142,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1555,16,'Two kids meet','A new neigbour arrives. The kids meet.\r\n\r\nThe local kid:\r\n\"My mom was born in California!\r\nWhere was your mom born?\"\r\n\r\nThe other kid answers, \"Alaska\".\r\n\r\nThe first one replies:\r\n\"Gee, then don\'t worry about it... I\'ll ask\'er myself!\"',NULL,0.00,NULL,139,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1556,16,'Try our tricky!','To make this work, do this as fast as you can and don\'t cheat!\r<BR>\n\r<BR>\nSpell Fort 5 times\r<BR>\nSay Fort 4 times\r<BR>\nSpell Fort 4 times\r<BR>\nSay Sort 3 times \r<BR>\nSpell Fort two times\r<BR>\nSay Fort once\r<BR>\n\r<BR>\nQuick!...What do you eat cereal with? (Scroll Down)\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\n*\r<BR>\nYou\'re pretty weird...most people use a Spoon! :)',NULL,0.00,NULL,143,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1557,16,'Toughening Up','My grand-daddy worked in a blacksmith shop when he was a young fella, and he used to tell me, when I was a little nipper, how he had toughened himself up so he could stand the hard work of blacksmithing.\r\n\r\nOne story was how he had developed his arm and shoulder muscles. As he told it, he would stand outside behind the wood shed, with a 5 pound potato sack in each hand, extend his arms straight out from his sides and hold them there as long as he could.\r\n\r\nAfter awhile he tried 10 pound potato sacks, then 50 pound potato sacks and finally he got to where he could lift a 100 pound potato sack in each hand and hold his arms straight out for more than two full minutes. . . .\r\n\r\nThen, he started putting potatoes in the sacks...DOH!',NULL,0.00,NULL,163,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1559,16,'The World of High Finance','A man walks into a New York bank, and says he\'s going to Europe for two weeks and needs to borrow $5000. For collateral, he offers his new Rolls Royce.\r<BR>\n\r<BR>\nThe bank is satisfied and parks it in their secured underground garage. Two weeks later to the day, the man returns to the bank, repays the $5000 and interest of $15.41.\r<BR>\n\r<BR>\nThe loan officer says inquiringly, \"Sir, we were delighted to have your business but, in checking your credit, we learned you are a multimillionaire. Why ever did you need to borrow $5000?\"\r<BR>\n\r<BR>\n\"Where else in New York can I park my car for two weeks for $15.41?\"',NULL,0.00,NULL,146,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1560,16,'Trapped On A Rock','There was a man that was stranded, standing on nothing but a rock in the middle of the sea, waiting for someone to come. Then along comes a boat.\r<BR>\n\r<BR>\nThe man on the boat asks \'do you want any help?\' Man on the rock replies \'no- the Lord will save me\'-so then the man on the boat went away. A helicopter then came and asked him \'do you want any help?\' The man replied \'no - the Lord will save me!\' Then along comes another man on a boat and asks \'do you want any help?\' and he said \'no-the Lord will save me\'.\r<BR>\n\r<BR>\nBy this stage he was up to his neck in water. He then drowned. He was at the holy gates and asked St. Peter \'why didn\'t the Lord save me????\' \r<BR>\n\r<BR>\nSt.Peter said\' he sent you 2 boats a helicpter-what more do you want!?\'',NULL,0.00,NULL,135,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1561,16,'The Race','There are three guys named Manners, Shutup, and Crap.\r<BR>\n\r<BR>\nThey were really bored, so they decided to run a race. During the race, Crap fell down, and Manners stopped to help him. But Shutup ran so fast the police caught him. Here\'s how the conversation went:\r<BR>\n\r<BR>\nPolice Officer #1: \"What\'s your name?\"\r<BR>\nShutup: \"Shutup.\"\r<BR>\n\r<BR>\nPolice Officer #2: \"Where\'s your manners?\"\r<BR>\nShutup: Back there picking up Crap!\"',NULL,0.00,NULL,133,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1562,16,'The Rabid Neighbor!','A neighbor of mine was bit by a stray rabid dog. I went to see how he was and found him scribbling furiously on a notepad.\r<BR>\n\r<BR>\nI told him rabies could be cured and he didn\'t have to worry about writing a will.\r<BR>\n\r<BR>\nHe said, \"Will, will,... WHAT WILL? I\'m making a list of people I\'m gonna bite!!\"',NULL,0.00,NULL,154,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1564,16,'The new warden','A new jail warden was being shown through the jailhouse by the old warden. \r<BR>\n\r<BR>\nSoon, after making rounds around the rest of the jail, they get to the cafeteria. In one corner, he sees a group of elderly men laughing hysterically. \r<BR>\n\r<BR>\nInterested, he watches them while the older warden gets his food. One of the men shouts out \"63!\" and the entire table bursts out laughing. The new warden is totally baffled by the behavior of them. \"74!\", again a chorus of guffaws ring out. \r<BR>\n\r<BR>\nThe old warden comes back to the table where the new warden sits staring, and the new warden asks \"What are those elderly men doing.\" \r<BR>\n\r<BR>\nThe old warden smirks, and says, \"Oh, those are the life timers. They\'ve been in here so long, they just number their jokes.\"\r<BR>\n\r<BR>\nMeanwhile another one calls out \"2!\". Nobody laughs. \r<BR>\n\r<BR>\nThe new warden leans over and asks, \"What happened?\" To this the warden replied, \"Oh, he blew the delivery.\"',NULL,0.00,NULL,152,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1567,16,'The Farmer and his boys...','A farmer had three sons. One day his oldest came to him and said that since he was graduating from high school, he would really like to get a car.\r\n\r\nHis father said, \"Son, come here.\" He took him to the barn and pointed to the tractor and said, \"This tractor is needed for the farm and I promise, as soon as it\'s paid for, we\'ll get you a car\".\r\nThe boy was not too happy, but was understanding.\r\n\r\nA week later, his second son approached him wanting a motorcycle.\r\n\"Well\", the father said, \"as soon as the tractor is paid for we\'ll see about getting you your scooter.\"\r\n\r\nShortly after, his youngest was bugging him for a bike.\r\nAgain, the father gave him the lecture about the tractor needing to be paid off first.\r\n\r\nWhile leaving the barn, the young boy, a little disgusted with his father\'s explanation, saw the farm rooster doing it\'s rooster duty with one of the hens. He promptly went over and kicked the rooster off the hen\'s back, mumbling to himself.\r\n\r\nHis dad asked, \"Son, now why would you do something like that?\r\nHe didn\'t do anything to deserve that.\"\r\n\r\nThe third son replied, \"Hey, nobody around here rides anything until that tractor gets paid off!\"',NULL,0.00,NULL,149,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1569,16,'The inmates last wish!','The inmate on death row was scheduled to be put to death by firing squad the follow morning. Throughout the day, the prison guards were being very nice to him. But when they asked him if he wanted something specific for his last meal, he didn\'t want anything special. When they asked if there was something special he wanted to do, he said nothing. It went on like this all day.\r<BR>\n\r<BR>\nFinally when he was put before the firing squad, the guard asked if he wanted a cigarette and a blindfold.\r<BR>\n\r<BR>\n\"No,\" the inmate said, \"just get it over with.\"\r<BR>\n\r<BR>\n\"Well, is there anything that I can do for you before you go?\" said the guard. \"You didn\'t even want a special last meal!\"\r<BR>\n\r<BR>\nThe inmate thought. \"Actually,\" he said, \"Music is my life. One thing I would really like would be to sing my favorite song, one whole time through, with no interruptions.\"\r<BR>\n\r<BR>\nThe guard nodded and told him to go ahead.\r<BR>\n\r<BR>\nThe inmate started singing, \"One billion bottles of beer on the wall...\"',NULL,0.00,NULL,161,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1572,16,'The cashier','Well, one day, an idiot looking for a job finally came across a cigarette stand that was accepting anyone as there cashier. After being turned down for every job he filed for, he accepts this low paying job.\r<BR>\n\r<BR>\nOne day, a woman comes to the stand, \"Hey, sonny, how much do those cigaretts cost?\"\r<BR>\n\r<BR>\n\"I dont know\", replies the stupid cashier.\r<BR>\n\r<BR>\nThe woman leaves unsatisfied.\r<BR>\n\r<BR>\nTHe boss, having seen this goes up to him and screams \"WHAT DO YOU MEAN YOU DONT KNOW, THEY COST 10 CENTS, GOD!!!!!!\"\r<BR>\n\r<BR>\n\"10 cents? I will have to remember that\" said the cashier.\r<BR>\n\r<BR>\nThe next day, another woman comes \"hey sonny, how much do those cigaretts cost?\"\r<BR>\n\r<BR>\n\"10 cents ma\'am\"\r<BR>\n\r<BR>\n\"Really?, are they fresh?\"\r<BR>\n\r<BR>\n\"I dont know\"\r<BR>\n\r<BR>\nSo the woman leaves.\r<BR>\n\r<BR>\nThe boss, having spied this screams \"WELL OFCOURSE THEY ARE FRESH YOU NINCOMPOOP, WHAT DO YOU THINK? THEY ARE SOUR OR SOMETHING?\"\r<BR>\n\r<BR>\nSo the cashier memorizes \"Yes, very fresh\"\r<BR>\n\r<BR>\nThe next day, another woman comes and says \"Hey sonny, now much do those cigaretts cost?\"\r<BR>\n\r<BR>\n\"10 cents\" He replies.\r<BR>\n\r<BR>\n\"Are they fresh?\"\r<BR>\n\r<BR>\n\"Very fresh\"\r<BR>\n\r<BR>\n\"Should I buy them?\"\r<BR>\n\r<BR>\n\"I dont know\"\r<BR>\n\r<BR>\nSo the woman leaves.\r<BR>\n\r<BR>\nThe boss having seen this goes to scream at him again \"YOU MORON, WHEN SOMEONE SAYS THAT, YOU HAVE TO SAY \'If you dont, somebody else will\' OK?\"\r<BR>\n\r<BR>\n\"ok, gotcha boss\"\r<BR>\n\r<BR>\nSo the next day, the little shop gets robbed by a guy with a gun.\r<BR>\nHe goes up to the cash register and screams \"HEY, how much money is in that cash register?\" \"10 cents sir\"\r<BR>\n\r<BR>\n\"WHAT? ARE YOU BEING FRESH TO ME?\"\r<BR>\n\r<BR>\n\"Yes, very fresh sir\"\r<BR>\n\r<BR>\n\"SHOULD I SHOOT YOU?\"\r<BR>\n\r<BR>\n\"If you dont, somebody else will\"',NULL,0.00,NULL,164,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1573,16,'The Cruise!','Three friends -- two straight guys and a gay guy -- and their significant others were on a cruise. A tidal wave came up and swamped the ship; they all drowned.\r<BR>\n\r<BR>\nThey each had to come before St. Peter to be admitted into heaven.\r<BR>\n\r<BR>\nFirst came one of the straight guys and his wife.\r<BR>\nSt. Peter shook his head sadly.\r<BR>\n\"I can\'t let you in. You loved money too much.\r<BR>\nYou loved it so much, you even married a woman named Penny.\"\r<BR>\n\r<BR>\nThen came the second straight guy.\r<BR>\n\"Sorry, can\'t let you in, either.\" said St. Peter. \"You loved food too much. You loved to eat so much, you even married a woman named Candy!\"\r<BR>\n\r<BR>\nThe gay guy turned to his boyfriend and whispered nervously...\r<BR>\n\"It\'s not looking good for us Dick.\"',NULL,0.00,NULL,149,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1575,16,'Suck It In','I noticed my husband standing on the bathroom scale, sucking in his ample stomach.\r\n\r\nThinking he was trying to weigh less with this maneuver, I quipped, \"I don\'t think that is going to help much, hon?\"\r\n\r\n\"Sure it does,\" he said. \"How else can I can see the numbers!\"',NULL,0.00,NULL,147,1,1,1,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (1579,16,'Real Police Stories','The following are actual incidents reported...\r<BR>\n\r<BR>\n#1\r<BR>\nA policeman had a perfect spot to watch for speeders, but wasn\'t getting many. Then, he discovered the problem - a 10-year old boy was standing up the road with a hand painted sign which read \"RADAR TRAP AHEAD\". The officer then found a young accomplice down the road with a sign reading \"TIPS\" and a bucket full of change.\r<BR>\n\r<BR>\n#2\r<BR>\nA motorist was mailed a picture of his car speeding through an automated radar. A $40 speeding ticket was included. Being cute, he sent the police department a picture of $40. The police responded with another mailed photo of handcuffs.\r<BR>\n\r<BR>\n#3\r<BR>\nA young woman was pulled over for speeding. As the motorcycle officer walked to her car window, flipping open his ticket book, she said, \"I bet you are going to sell me a ticket to the Highway Patrolmen\'s Ball.\"\r<BR>\n\r<BR>\nHe replied, \"Highway patrolmen don\'t have balls.\"\r<BR>\n\r<BR>\nThere was a moment of silence while she smiled, and he realized what he\'d just said. He then closed his book, got back on his motorcycle and left. She was laughing too hard to start her car for several minutes.',NULL,0.00,NULL,133,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1581,16,'Diet Rules','1. If you eat something and no one sees you eat it, it has no calories.\r<BR>\n\r<BR>\n2. If you drink a diet soda with a candy bar, the calories in the candy bar are canceled out by the diet soda.\r<BR>\n\r<BR>\n3. When you eat with someone else, calories don\'t count if you don\'t eat more than they do.\r<BR>\n\r<BR>\n4. Food used for medicinal purposes NEVER count, such as hot chocolate, brandy, toast and Sara Lee Cheesecake.\r<BR>\n\r<BR>\n5. If you fatten up everyone else around you, then you look thinner.\r<BR>\n\r<BR>\n6. Movie related foods (Milk Duds, buttered popcorn, Junior Mints, Red Hots, Tootsie Rolls, etc.) do not have additional calories because they are part of the entertainment package and no part of one\'s personal fuel.\r<BR>\n\r<BR>\n7. Cookie pieces contain no calories -- the process of breaking causes calorie leakage.\r<BR>\n\r<BR>\n8. Things licked off knives and spoons have no calories if you are in the process of preparing something. Examples are peanut butter on a knife making a sandwich and ice cream on a spoon making a sundae.\r<BR>\n\r<BR>\n9. Food that have the same color have the same number of calories. Examples are: spinach and pistachio ice cream; mushrooms and white chocolate. NOTE: Chocolate is a universal color and may be substituted for any other food color.\r<BR>\n\r<BR>\n10. Anything consumed while standing over the kitchen sink, has no calories.',NULL,0.00,NULL,155,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1582,16,'Even more Bumper Stickers!','Heart Attacks...God\'s Revenge for Eating His Animal Friends\r<BR>\nHow many roads must a man travel down before he admits he is lost?\r<BR>\nI\'m an imbecile and I vote\r<BR>\nMoney Isn\'t Everything... But it Sure Keeps the Kids In Touch\r<BR>\nIf you can read this, I can slam on my brakes and sue you!\r<BR>\n100,000 sperm and YOU were the fastest?\r<BR>\nGrow your own dope, plant a man\r<BR>\nAll Men Are Animals, Some Just Make Better Pets\r<BR>\nSome people are only alive because it is illegal to shoot them.\r<BR>\nI used to have a handle on life, but it broke.\r<BR>\nBEER: It\'s not just for breakfast anymore.\r<BR>\nI need someone really bad...Are you really bad?\r<BR>\nBeauty is in the eye of the beer holder.\r<BR>\nAll men are idiots...I married their king.\r<BR>\nReality is a crutch for people who can\'t cope with drugs\r<BR>\nDon\'t drink and drive...You might hit a bump and spill it\r<BR>\nWe are born naked, wet, and hungry....Then things get worse.',NULL,0.00,NULL,141,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1583,16,'Ever Wonder?','Why does Sea World have a seafood restaurant? I\'m halfway through my fish sandwich and I realize, Oh my God...I could be eating a slow learner!\"\r<BR>\n- Lynda Montgomery\r<BR>\n\r<BR>\n\"If life was fair, Elvis would be alive and all the impersonators would be dead.\"\r<BR>\n- Johnny Carson\r<BR>\n\r<BR>\n\"Sometimes I think war is God\'s way of teaching us geography.\"\r<BR>\n- Paul Rodriguez\r<BR>\n\r<BR>\nAnd from George Carlin...\r<BR>\nIf you choke a smurf, what color does it turn?\r<BR>\nIf a no-armed man has a gun, is he armed?\r<BR>\nIf you throw a cat out a car window, does it become kitty litter?\r<BR>\nIf firefighters fight fires and crime fighters fight crime, what do freedom fighters fight?\r<BR>\nIf you put a slinky on an escalator, would it go forever?\r<BR>\nIf all babies are cute why are there so many ugly people in the world?\r<BR>\nWhat\'s another word for thesaurus?\r<BR>\nIf you cross a four leaf clover with poison ivy, would you get a rash of good luck?\r<BR>\nWho is more foolish, the fool, or the fool who follows him?\r<BR>\nWhen Dr. Kevorkian watches ER does he root against the doctors?\r<BR>\nWhy do they have Braille number pads at drive-through bank machines?\r<BR>\nIs it ok to go door-to-door selling \"No Soliciting\" signs?\r<BR>\nIf it was a 3 hour cruise, why did Mrs. Howell have so many clothes?\r<BR>\nWhy do people who know the least know it the loudest?\r<BR>\nDo cemetery workers prefer the graveyard shift?\r<BR>\nIf a book about failures doesn\'t sell, is it a success?\r<BR>\nWhy is back pain medication always on the bottom shelf?\r<BR>\nIf talk is cheap, why is my phone bill so high?\r<BR>\nIf someone comes up to you and tells you that they\'re an obsessive compulsive liar, how do you know they\'re telling the truth?\r<BR>\nHow can you tell if Don King is having a bad hair day?\r<BR>\nShould bankruptcy lawyers expect to be paid?\r<BR>\nIf a word is misspelled in the dictionary, how do you know if it\'s wrong?\r<BR>\nDo bleached blondes just pretend to have more fun?\r<BR>\nDid the early settlers ever go on camping trips?\r<BR>\nWhy are the other lines always moving faster-until you get into one of them?\r<BR>\nHow can a person get a life sentence & be eligible for parole in 15 years?',NULL,0.00,NULL,158,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1585,16,'Facts of Life!','Don\'t sweat the petty things, and don\'t pet the sweaty things.\r<BR>\n\r<BR>\nOne tequila, two tequila, three tequila, floor.\r<BR>\n\r<BR>\nOne nice thing about egotists: they don\'t talk about other people.\r<BR>\n\r<BR>\nTo be intoxicated is to feel sophisticated but not be able to say it.\r<BR>\n\r<BR>\nNever underestimate the power of stupid people in large groups.\r<BR>\n\r<BR>\nThe older you get, the better you realize you were.\r<BR>\n\r<BR>\nI doubt, therefore I might be.\r<BR>\n\r<BR>\nAge is a very high price to pay for maturity.\r<BR>\n\r<BR>\nProcrastination is the art of keeping up with yesterday.\r<BR>\n\r<BR>\nWomen like silent, they think they\'re listening.\r<BR>\n\r<BR>\nMen are from Earth. Women are from Earth. Deal with it.\r<BR>\n\r<BR>\nGive a man a fish and he will eat for a day. Teach him how to fish, and he will sit in a boat and drink beer all day.\r<BR>\n\r<BR>\nA fool and his money are soon partying.',NULL,0.00,NULL,1049,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1588,16,'Confucious say','Confucious say...\r<BR>\n\r<BR>\nAll who fly upside-down have crack up.\r<BR>\n\r<BR>\nHe who stand on toilet high on pot.\r<BR>\n\r<BR>\nHe who shits brick has square hole.\r<BR>\n\r<BR>\nFly who sit on toilet seat get pissed off.',NULL,0.00,NULL,140,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1589,16,'Dairy Queen','How did Dairy Queen (U.S. restaurant) get Pregnant?\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\nBurger King showed her it\'s Whopper.',NULL,0.00,NULL,156,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1590,16,'Defining Confusion!','Q: How do you define confusion??\r\n\r\nA: A blind lesbian in a fish market!',NULL,0.00,NULL,166,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1591,16,'Difference Between Nun and Bathtub','What\'s the difference between a woman in the bath tub and a nun?\r<BR>\nThe nun has a soul full of hope.\r<BR>\n\r<BR>\nWhat\'s the difference between a circus and a Las Vegas Dance Show?\r<BR>\nThe circus is an array of cunning stunts.\r<BR>\n\r<BR>\nHolly Happidays',NULL,0.00,NULL,130,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1592,16,'Erudite Limerick','I, Caesar, when I heard of the fame\r\nTo Cleopatra I straightway laid claim\r\nAhead of my legions\r\nI invaded her regions\r\nI saw, I conquered, I came!',NULL,0.00,NULL,175,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1594,16,'Opinions','Everybody knows there are different opinions to everything. Here are some.\r<BR>\n\r<BR>\n*A smoking section in a restaraunt is like a peeing section in a pool.\r<BR>\n\r<BR>\n*Always look on the negative side, so you\'ll never be dissapointed.\r<BR>\n\r<BR>\n*Men are like snow storms, you never know how many inches you\'ll get, or how long it will last.',NULL,0.00,NULL,189,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1613,16,'It\'s a Bummer to be an egg!','1) You only get laid once.\r<BR>\n2) You only get eaten once.\r<BR>\n3) It takes 7 minutes to get hard.\r<BR>\n4) You have to come in a box with 11 other guys.\r<BR>\n5) The only one who\'ll sit on your face is your mother.',NULL,0.00,NULL,132,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1615,16,'Good/Bad Girls','Good girls say \" thanks for a wonderful dinner\"...\r<BR>\nBad girls say, \" what\'s for breakfast?\"\r<BR>\n\r<BR>\nGood girls never go after another girl\'s man...\r<BR>\nBad girls go after him AND his brother.\r<BR>\n\r<BR>\nGood girls wear white cotton panties\r<BR>\nBad girls don\'t wear any.\r<BR>\n\r<BR>\nGood girls wax their floors...\r<BR>\nBad girls wax their bikini lines.\r<BR>\n\r<BR>\nGood girls loosen a few buttons when it\'s hot\r<BR>\nBad girls make it hot by loosening a few buttons.\r<BR>\n\r<BR>\nGood girls make chicken for dinner...\r<BR>\nBad girls make reservations\r<BR>\n\r<BR>\nGood girls blush during bedrooms scenes in movies...\r<BR>\nBad girls know they could do better\r<BR>\n\r<BR>\nGood girls never consider sleeping with the boss...\r<BR>\nBad girls never do either, unless he\'s very, very rich.\r<BR>\n\r<BR>\nGood girls believe you\'re not fully dressed without a strand of pearls...\r<BR>\nBad girls believe that you are fully dressed with JUST a strand of pearls...\r<BR>\n\r<BR>\nGood girls love Italian food...\r<BR>\nBad girls love Italian waiters.',NULL,0.00,NULL,198,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1616,16,'Good Girls - Bad Girls','Good girls say \"thanks for a wonderful dinner\"...\r<BR>\nBad girls say, \"what\'s for breakfast?\"\r<BR>\n\r<BR>\nGood girls never go after another girl\'s man...\r<BR>\nBad girls go after him AND his brother.\r<BR>\n\r<BR>\nGood girls wear white cotton panties...\r<BR>\nBad girls don\'t wear any.\r<BR>\n\r<BR>\nGood girls wax their floors...\r<BR>\nBad girls wax their bikini lines.\r<BR>\n\r<BR>\nGood girls loosen a few buttons when it\'s hot...\r<BR>\nBad girls make it hot by loosening a few buttons.\r<BR>\n\r<BR>\nGood girls make chicken for dinner...\r<BR>\nBad girls make reservations.\r<BR>\n\r<BR>\nGood girls blush during bedrooms scenes in movies...\r<BR>\nBad girls know they could do better.\r<BR>\n\r<BR>\nGood girls never consider sleeping with the boss...\r<BR>\nBad girls never do either, unless he\'s very, very rich.\r<BR>\n\r<BR>\nGood girls believe you\'re not fully dressed without a strand of pearls...\r<BR>\nBad girls believe that you are fully dressed with JUST a strand of pearls.\r<BR>\n\r<BR>\nGood girls love italian food...\r<BR>\nBad girls love italian waiters.',NULL,0.00,NULL,156,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1622,16,'Cards You Won\'t Find At Hallmark','\"Looking back over the years that we\'ve been together, I can\'t help but wonder:............. What was I thinking?\"\r<BR>\n\r<BR>\n\"Congratulations on your wedding day!............. Too bad no one likes your wife.\"\r<BR>\n\r<BR>\n\"How could two people as beautiful you............ have such an ugly\r<BR>\nbaby?\"\r<BR>\n\r<BR>\n\"I\'ve always wanted to have someone to hold, someone to love......... After having met you, I\'ve changed my mind.\"\r<BR>\n\r<BR>\n\"I must admit, you brought Religion in my life........... I never\r<BR>\nbelieved in Hell until I met you.\"\r<BR>\n\r<BR>\n\"As the days go by, I think of how lucky I am....... that you\'re not\r<BR>\nhere to ruin it for me.\"\r<BR>\n\r<BR>\n\"As you grow older, Mum, I think of all the gifts you\'ve given me. Like the need for therapy...\"\r<BR>\n\r<BR>\n\"Thanks for being a part of my life!!!.......... I never knew what evil was before this!\"\r<BR>\n\r<BR>\n\"Before you go,......... I would like you to take this knife out of my back. You\'ll probably need it again.\"\r<BR>\n\r<BR>\n\"Someday I hope to get married............ but not to you.\"\r<BR>\n\r<BR>\n\"You look great for your age.......Almost Lifelike!\"\r<BR>\n\r<BR>\n\"When we were together, you always said you\'d die for me......... Now that we\'ve broken up, I think it\'s time you kept your promise.\"\r<BR>\n\r<BR>\n\"I knew the day would come when you would leave me for my best friend....... So here\'s his leash, water bowl and chew toys.\"\r<BR>\n\r<BR>\n\"We have been friends for a very long time........... What do you say we call it quits?\"\r<BR>\n\r<BR>\n\"I\'m so miserable without you.................. It\'s almost like you\'re here.\"\r<BR>\n\r<BR>\n\"Congratulations on your new bundle of joy............... Did you ever\r<BR>\nfind out who the father was?\"\r<BR>\n\r<BR>\n\"You are such a good friend that if we were on a sinking ship and there was only one life jacket.... I\'d miss you heaps and think of you often.\"\r<BR>\n\r<BR>\n\"Your friends and I wanted to do something special for your birthday--------- So we\'re having you put to sleep.\"',NULL,1.00,1,173,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1666,16,'Top 5 men in a woman\'s life...','The Top 5 Men in a Woman\'s life are:\r<BR>\n\r<BR>\n1. Doctor.\r<BR>\n2. Dentist\r<BR>\n3. Coal man.\r<BR>\n4. Decorator.\r<BR>\n5. Bank manager.\r<BR>\n\r<BR>\nA Doctor says to take off your clothes.\r<BR>\nA Dentist says open wide.\r<BR>\nA Coal man asks \"where do you want it, front or back?\"\r<BR>\nA Decorator says \"how do you like it now that it’s up?\"\r<BR>\nA Bank manager says \"don’t take it out you’ll lose interest\"!',NULL,0.00,NULL,164,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1736,16,'Top Ten Least Popular Stephen King Novels','10. \"The Man Who Died of Old Age\"\r<BR>\n9. \"How Cujo Got His Groove Back\"\r<BR>\n8. \"Here\'s Another One I Cranked Out In An Afternoon\"\r<BR>\n7. \"Vacuumstarter\"\r<BR>\n6. \"The Scary Windowless Corridor Next To The Oval Office\"\r<BR>\n5. \"The Guy Who Accidentally Put Expired Milk In His Coffee --\r<BR>\nHe Didn\'t Drink It, But What If He Did?\"\r<BR>\n4. \"The Scariest Part of This Book Is My Picture On The Back Cover\"\r<BR>\n3. \"Inside the Kitchen At Your Local T.G.I. Friday\'s\"\r<BR>\n2. \"Hi I\'m Your New Neighbor, Richard Simmons\"\r<BR>\n1. \"Satan\'s Independent Prosecutor\"',NULL,0.00,NULL,144,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1739,12,'A bunch of better idiots!','These \"Weird Reference Questions\" are from the Library Paraprofessionals Listserv. All of these are real and provide proof that a \"better idiot\" can be invented.\r\n\r\n\"Do you have a list of all the books written in the English language?\"\r\n\r\n\"Do you have that book by Rushdie: \'Satanic Nurses\'?\"\r\n(Actual title: \"Satanic Verses\")\r\n\r\n\"I was here about three weeks ago looking at a cookbook that cost $39.95.\r\nDo you know which one it is?\"\r\n\r\n\"Can you tell me why so many famous Civil War battles were fought on National Park Sites?\"\r\nhahahaha...what a bone head!\r\n\r\n\"Do you have any books with photographs of dinosaurs?\"\r\nhmmm...I don\'t recollect any camera-toting cavemen...do you?\r\n\r\n\"I\'m looking for information on carpal tunnel syndrome.\r\nI think I\'m having trouble with it in my neck.\"\r\n(No...that\'s your brain miss-firing.)\r\n\r\n\"I am looking for a list of laws that I can break that would send me back to jail for a couple of months.\"\r\n(I know...how about shooting yourself? That would get you life in prison!)\r\n\r\n\"I need a color photograph of George Washington.\"\r\n(Ok...hold on...I\'ll check with the caveman...)\r\n\r\n\"Is the basement upstairs?\" (Asked at First Floor Reference Desk)\r\nThis one gets the golden stupidity award!',NULL,0.00,NULL,138,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1740,12,'A-fishin\' We Will Go...','Seems about a year ago (1998) some airplane manufacturer employees decided to steal a life raft from one of the 747\'s.\r\n\r\nThey got it off the plane, out the gate and were having a good time fishing on the Stilliquamish. All of a sudden the Coast Guard Chopper came wop-wop-ing in, homing on the emergency frequency locator beacon that was activated when the boys inflated the raft at the river.\r\n\r\n(Note: The boys are no longer with said aircraft company.)',NULL,0.00,NULL,115,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1741,12,'At the crazy farm!','A doctor of psychology was doing his normal morning rounds, and he entered a patient\'s room to find his patient sitting on the floor, sawing at a piece of wood with the side of his hand.\r\n\r\nMeanwhile, another patient was in the room, hanging from the ceiling by his feet.\r\n\r\nThe doctor asked his patient what he was doing, sitting on the floor.\r\nThe patient replied in an irritated fashion, \"Can\'t you see I\'m sawing this piece of wood in half?\"\r\n\r\nThe doctor inquired, \"And what is the fellow hanging from the ceiling doing?\"\r\n\"Oh. He\'s my friend, but he\'s a little crazy. He thinks he\'s a lightbulb.\"\r\n\r\nThe doctor asks, \"If he\'s your friend, don\'t you think you should get him down from there before he hurts himself?\"\r\n\r\n\"What? And work in the dark!?!\"',NULL,0.00,NULL,122,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1743,12,'Betting','There were two guys sitting in a plane. The one guy says lets play a game, I\'ll ask you a question if you get it right I give you 5 dollars.\r\n\r\nSo the other guy says fine if you get it right, I give you 50 dollars, if you get it wrong you give me 5.\r\n\r\nThe guy says ok.\r\n\r\nHe asks him what his name was the guy didn\'t know it so he payed him 5 dollars.\r\n\r\nSo the other guy asks what goes up a hill with 3 legs and comes down with 4.\r\n\r\nHe thinks and thinks but doesn\'t know so he pays him 50 dollars.\r\n\r\nHe asks what does go up ahill with 3 legs and comes down with 4.\r\n\r\nThe guy hands him 5 dollars.',NULL,0.00,NULL,142,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1744,12,'Blind man','I was walking into the store the other day when I saw this blind man an his seeing eye dog. Suddenly, the man grabs the dogs leash, and starts swinging the dog around his head. I walked up and said \" Hey, what the hell are you doin\"?\r\n\r\nThe blind man said \" Oh nothing, just lookin around.\"',NULL,0.00,NULL,131,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1746,12,'Camping with Sherlock Holmes','Sherlock Holmes and Dr. Watson went on a camping trip. After a good\r\nmeal, they lay down and went to sleep. Some hours later, Holmes awoke and nudged his faithful friend. \"Watson, look up at the sky and tell me what you see!\"\r\n\r\n\"I see millions of stars,\" Watson said.\r\n\"What does that tell you?\" Holmes asked.\r\n\r\nWatson replied. \"Astronomically, it tells me that there are millions of galaxies and potentially billions of planets. Astrologically, I observe that Saturn is in Leo. Horologically, I deduce that the time is approximately a quarter past three. Theologically, I can see that God is all-powerful. Meteorologically, I suspect we will have a beautiful day tomorrow. What does it tell you, Holmes?\"\r\n\r\n\"Watson, you idiot,\" he said. \"Someone has stolen our tent!\"',NULL,0.00,NULL,105,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1747,12,'Clear Weather?','As a couple sat in the living room, watching TV, the phone rang.\r\n\r\nThe husband picked it up, listened for a moment and then screamed, \"Damn it! How should I know? Call the weather bureau!\" and hung up.\r\n\r\n\"What was that all about?\" wife asked.\r\n\r\n\"Awww, some idiot wanted to know whether the coast was clear!\"',NULL,0.00,NULL,118,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1748,12,'Cliffhanger','Once upon a time there were two men who had gone cliff climbing.\r\nSuddenly, one man lost his footing and went tumbling down to the bottom. The other man frantically screamed, \"Roger!\", and was relieved to hear a faint reply.\r\n\r\n\"Okay Rodge,\" shouted Barry, \"I\'m gonna throw a rope down to you, so wrap it \'round one of your legs and..\" but before he could finish, he heard Roger call \"But both my legs are broke.\"\r\n\r\nBarry suggested his arms, to which the reply was \"They\'re broken too!\" So finally, Roger held on with his mouth. Barry struggled to pull up the rope, and when he was nearly there, Barry said, \"You right there mate?\" to which Rodger replied,\"YYYYYYYYYEEEEEEEEEEEEESSSSSSSSSSSSSSS........\"',NULL,0.00,NULL,128,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1749,12,'Coach Wants A Raise','The basketball coach stormed into the university president\'s office and demanded a raise right then and there.\r\n\r\n\"Please,\" protested the college President, \"you already make more than the entire History department.\"\r\n\r\n\"Yeah, maybe so, but you don\'t know what I have to put up with,\" the coach blustered. \"Look.\"\r\n\r\nHe went out into the hall and grabbed a jock who was jogging down the hallway. \"Run over to my office and see if I\'m there,\" he ordered.\r\n\r\nTwenty minutes later the jock returned, sweaty and out of breath.\r\n\r\n\"You\'re not there, sir,\" he reported.\r\n\r\n\"Oh, I see what you mean,\" conceded the President, scratching his head. \"I would have phoned.\"',NULL,0.00,NULL,113,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1753,12,'Diving Deep','One day a diver was enjoying the aquatic world 20 ft below sea level. He noticed a guy at the same depth he was, but he had on no scuba gear whatsoever.\r\n\r\nThe diver went below another 20 ft, but the guy joined him a few minutes later. The diver went below 25 ft, but minutes later, the same guy joined him. This confused the diver, so he took out a waterproof chalk-and-board set, and wrote, \"How the hell are you able to stay under this deep without equipment?\"\r\n\r\nThe guy took the board and chalk, erased what the diver had written, and wrote -\r\n\r\n\"I\'M DROWNING, YOU MORON!!!\"',NULL,0.00,NULL,130,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1755,12,'Don\'t eat and drive!','I was in a car dealership a while ago when a large new motor home was towed into the garage. The front of the vehicle was in dire need of repair and the whole thing generally looked like an extra in \"Twister.\"\r\n\r\nI asked the manager what had happened. He told me that the driver had set the cruise control, then went in back to make a sandwich!',NULL,0.00,NULL,124,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1756,12,'Don\'t look down!','A man lay spread out over three seats in the second row of a movie theater.\r\n\r\nAs he lay there breathing heavily, an usher came over and said, \"That\'s very rude of you, sir, taking up three seats. Didn\'t you learn any manners! Where did you come from?\"\r\n\r\nThe man looked up helplessly and said, \"The balcony!\"',NULL,0.00,NULL,120,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1757,12,'Driving Violations','A man who is driving a car is stopped by a police officer. The following exchange takes place....\r\n\r\nThe man says \"What\'s the problem officer?\"\r\nOfficer: You were going at least 75 in a 55 zone.\r\nMan: No sir, I was going 65.\r\nWife: Oh, Harry. You were going 80.\r\n[Man gives his wife a dirty look.]\r\n\r\nOfficer: I\'m also going to give you a ticket for your broken tail light.\r\nMan: Broken tail light? I didn\'t know about a broken tail light!\r\nWife: Oh Harry, you\'ve known about that tail light for weeks.\r\n[Man gives his wife a dirty look.]\r\n\r\nOfficer: I\'m also going to give you a citation for not wearing your\r\nseat belt.\r\nMan: Oh, I just took it off when you were walking up to the car.\r\nWife: Oh, Harry, you never wear your seat belt.\r\nMan turns to his wife and yells: \"Shut your damn mouth!\"\r\n\r\nOfficer turns to the woman and asks, \"Ma\'am, does your husband talk to you like this all the time?\r\nWife says: \"No, only when he\'s drunk!\"',NULL,0.00,NULL,113,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1758,12,'Drunk','A guy is swerving down the road and gets pulled over. The cop says,\r\n\"You have to take a Breathalyzer test.\" The guy says, \"I can\'t. I have asthma, and it\'ll start me on a coughing fit.\"\r\n\r\nThe cop says, \"Then I have to give you a blood test.\" The guy says, \"You can\'t. I\'m a hemophiliac, and if you prick me, I\'ll bleed all over the place.\"\r\n\r\nThe cops says, \"Then you have to get out of the car and walk a straight line.\"\r\nThe guy says, \"I can\'t.\"\r\nThe cop says, \"Why not?\"\r\nThe guy says, \"Because I\'m drunk you idiot... didn\'t you see the way I was driving!\"',NULL,0.00,NULL,115,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1759,12,'Engineers Laying Sod','A painting contractor was speaking with a woman about her job. In the first room she said she would like a pale blue. The contractor wrote this down and went to the window, opened it, and yelled out \"GREEN SIDE UP!\"\r\n\r\nIn the second room she told the painter she would like it painted in a soft yellow. He wrote this on his pad, walked to the window, opened it, and yelled \"GREEN SIDE UP!\" The lady was somewhat curious but she said nothing.\r\n\r\nIn the third room she said she would like it painted a warm rose color. The painter wrote this down, walked to the window, opened it and yelled \"GREEN SIDE UP!\"\r\n\r\nThe lady then asked him, \"Why do you keep yelling \'green side up\'?\"\r\n\r\n\"I\'m sorry,\" came the reply.\"But I have a crew of engineers laying sod across the street.',NULL,0.00,NULL,116,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1760,12,'First Child','A man speaks frantically into the phone, \"My wife is pregnant, and her contractions are only two minutes apart!\"\r\n\r\n\"Is this her first child?\" the doctor queries.\r\n\r\n\"No, you idiot!\" the man shouts. \"This is her husband!\"',NULL,0.00,NULL,115,1,1,2,'2',NULL,NULL);
INSERT INTO `jokes` VALUES (1761,17,'Halloween Funnies!','Halloween Funnies:\r<BR>\n\r<BR>\nWhat do Skeletons say before eating?\r<BR>\nBone Appetite.\r<BR>\n\r<BR>\nWhat do blondes and Jack-O-Lanterns have in common?\r<BR>\nBoth have blank expressions and are hollow inside.\r<BR>\n\r<BR>\nWhy did the Vampire get fired from the Blood Bank?\r<BR>\nHe was caught drinking on the job.\r<BR>\n\r<BR>\nWhy do ghosts have so much trouble dating?\r<BR>\nWomen can see right through them.\r<BR>\n\r<BR>\nWhy are Vampires Democrats?\r<BR>\nThey want Gore in 2000.\r<BR>\n\r<BR>\nWhat kind of clothes do Zombies wear?\r<BR>\nDecay NY.\r<BR>\n\r<BR>\nWhy aren\'t there any famous skeletons?\r<BR>\nThey\'re a bunch of no bodies.\r<BR>\n\r<BR>\nWhat kind of music do Mummies listen to?\r<BR>\nWrap.\r<BR>\n\r<BR>\nWhat do you call a guy turned on by a witch?\r<BR>\nScared stiff.',NULL,0.00,NULL,462,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1766,17,'Christmas and a day at the office?','Q: Why is Christmas just like a day at the office?\r<BR>\n\r<BR>\nA: You do all the work and the fat guy with the suit gets all the credit.',NULL,2.00,2,580,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1773,17,'A Cynics Guide to Life','The journey of a thousand miles begins with a broken fan belt and a leaky tire.\r<BR>\n\r<BR>\nI believe for every drop of rain that falls, a flower grows And a foundation leaks and a ball game gets rained out and a car rusts and...\r<BR>\n\r<BR>\nFollow your dream! Unless it\'s the one where you\'re at work in your underwear during a fire drill.\r<BR>\n\r<BR>\nAlways take time to stop and smell the roses... and sooner or later, you\'ll inhale a bee.\r<BR>\n\r<BR>\nDo not walk behind me, for I may not lead. Do not walk ahead of me, for I may not follow. Do not walk beside me, either, just leave me alone.\r<BR>\n\r<BR>\nIf you don\'t like my driving, don\'t call anyone. Just take another road. That\'s why the highway department made so many of them.\r<BR>\n\r<BR>\nIf a motorist cuts you off, just turn the other cheek. Nothing gets the message across like a good mooning.\r<BR>\n\r<BR>\nWhen I\'m feeling down, I like to whistle. It makes the neighbor\'s dog run to the end of his chain and gag himself.\r<BR>\n\r<BR>\nIt\'s always darkest before dawn. So if you\'re going to steal the neighbor\'s newspaper, that\'s the time to do it.\r<BR>\n\r<BR>\nA handy telephone tip: Keep a small chalkboard near the phone.\r<BR>\nThat way, when a salesman calls, you can hold the receiver up to it and run your fingernails across it until he hangs up.\r<BR>\n\r<BR>\nEach day I try to enjoy something from each of the four food groups: the bonbon group, the salty-snack group, the caffeine group, and the \"whatever-the-thing-in-the-tinfoil-in-the-back-of-the- fridge-is\" group.\r<BR>\n\r<BR>\nInto every life some rain must fall. Usually when your car windows are down.\r<BR>\n\r<BR>\nust remember... You gotta break some eggs to make a real mess on the neighbor\'s car!\r<BR>\n\r<BR>\nWhen you find yourself getting irritated with someone, try to remember that all men are brothers... and just give them a noogie or an Indian burn.\r<BR>\n\r<BR>\nThis morning I woke up to the unmistakable scent of pigs in a blanket. That\'s the price you pay for letting the relatives stay over.\r<BR>\n\r<BR>\nIt\'s a small world. So you gotta use your elbows a lot.\r<BR>\n\r<BR>\nKeep your nose to the grindstone and your shoulder to the wheel...it\'s cheaper than plastic surgery.\r<BR>\n\r<BR>\nThis land is your land. This land is my land. So stay on your land.\r<BR>\n\r<BR>\nLove is like a roller coaster: when it\'s good you don\'t want to get off, and when it isn\'t... you can\'t wait to throw up.',NULL,0.00,NULL,373,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1774,17,'Christmas Punnies!','What do elves learn in school?\r<BR>\nThe ELF-abet.\r<BR>\n\r<BR>\nHow many reindeer does Santa have?\r<BR>\n11 (named below):\r<BR>\nDasher, Dancer, Prancer, Vixen, Comet, Cupid, Donner, Blitzen,\r<BR>\nRudolph (the one with the red nose),\r<BR>\nOlive (all of the other reigndeer)\r<BR>\nand Al (Then Al the reigndeer loved him all).\r<BR>\n\r<BR>\nWhat nationality is Santa Claus?\r<BR>\nNorth Polish\r<BR>\n\r<BR>\nWhat kind of bird can write?\r<BR>\nA PEN-guin\r<BR>\n\r<BR>\nWhy does Santa\'s sled get such good mileage?\r<BR>\nBecause it has long distance-runners on each side.\r<BR>\n\r<BR>\nWhy does Scrooge love Rudolph-the red-nosed reindeer?\r<BR>\nBeacuse every buck is dear to him.\r<BR>\n\r<BR>\nWhat do you get if you deep-fry Santa Claus?\r<BR>\nCrisp Cringle\r<BR>\n\r<BR>\nWhat did the ghosts say to Santa Claus?\r<BR>\nWe\'ll have a \"boo\" Christmas without you.\r<BR>\n\r<BR>\nELF#1: What did Santa shout to his toys on Christmas Eve?\r<BR>\nELF#2: \"OKay everyone, sack time!\"\r<BR>\n\r<BR>\nIf athletes get athlete\'s foot, what do astronauts get?\r<BR>\nMissletoe!!!!!',NULL,5.00,1,1300,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1926,18,'Help from Canada...','PRESS RELEASE:\r<BR>\n\r<BR>\nPrime Minister of Canada to Visit Washington Statement by the Press Secretary \r<BR>\n\r<BR>\nPresident Bush and Prime Minister John Chretien of Canada met on Sept. 24th with the Canadian Leader strongly supporting the war on terrorism. Prime Minister Chretien issued the following statement:\r<BR>\n\r<BR>\nCANADIANS WILL HELP AMERICA WITH THE WAR ON TERRORISM!\r<BR>\n\r<BR>\nWE HAVE PLEDGED:\r<BR>\n- 2 BATTLE SHIPS,\r<BR>\n- 600 GROUND TROOPS,\r<BR>\n- 6 FIGHTER JETS.\r<BR>\n\r<BR>\nAFTER THE AMERICAN EXCHANGE RATE, THEY WILL END UP WITH:\r<BR>\n- 2 CANOES,\r<BR>\n- 6 MOUNTIES,\r<BR>\n- AND A BUNCH OF FLYING SQUIRRELS',NULL,0.00,NULL,264,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1927,18,'Goodbye To Bin Laden','Written by a Viet Nam Vet\r<BR>\nGOD BLESS AMERICA!\r<BR>\n\r<BR>\n\"In Memory of The Twin Towers\"\r<BR>\n\r<BR>\nWarning song to Osama bin Laden\r<BR>\n(the tune of Rawhide)\r<BR>\n\r<BR>\nThe devil came from nowhere\r<BR>\nHe attacked us from the sky.\r<BR>\n\r<BR>\nHe bloodied up our nation\r<BR>\ndidn\'t give a reason why.\r<BR>\n\r<BR>\nNow he\'s placed a spear in our eye\r<BR>\nsaid its done it Allahs name\r<BR>\n\r<BR>\nSo God\'s coming lookin for him\r<BR>\nAnd he\'s got himself to blame.\r<BR>\n\r<BR>\nNo more runnin, no more hiding, there\'s no place for you to go\r<BR>\nFor the wrath of God is coming and he isn\'t movin slow.\r<BR>\n\r<BR>\nYou defiled the love of all mankind without a single thought\r<BR>\nAnd the world is coming for you now with everything its got.\r<BR>\n\r<BR>\nJust go hidin in your hills\r<BR>\nYou\'ll be buried in your caves.\r<BR>\n\r<BR>\nYou\'ll get what you\'ve got comin now\r<BR>\nFor being Satans slaves.\r<BR>\n\r<BR>\nYou\'ve woke the sleeping giant\r<BR>\nFrom his legendary sleep\r<BR>\n\r<BR>\nNow with open roar like lions\r<BR>\nThere\'s one promise he will keep\r<BR>\n\r<BR>\nNo more runnin, no more hiding, there\'s no place for you to go\r<BR>\nFor the wrath of God is coming and he isn\'t movin slow.\r<BR>\n\r<BR>\nYou\'ve defiled the love of all mankind without a single thought\r<BR>\nAnd the world is coming for you now with everything its got.\r<BR>\n\r<BR>\nSo don\'t close your eyes a moment\r<BR>\nCause you surely see death there.\r<BR>\n\r<BR>\nDon\'t waste your time in moanin\r<BR>\nYou just haven\'t got a prayer.\r<BR>\n\r<BR>\nYou chose to terrify the world\r<BR>\nwith your sensely killing spree\r<BR>\n\r<BR>\nBrought violence into our lives\r<BR>\nPlaced hate inside of me.\r<BR>\n\r<BR>\nNo more runnin, no more hiding, there\'s no place for you to go\r<BR>\nFor the wrath of God is coming and he isn\'t movin slow.\r<BR>\n\r<BR>\nYou\'ve defiled the love of all mankind without a single thought\r<BR>\nAnd the world is coming for you now with everything its got.\r<BR>\n\r<BR>\nIn this peaceful loving Nation\r<BR>\nHome of brave and of the free\r<BR>\n\r<BR>\nAll are calling up your number\r<BR>\nover land and over sea\r<BR>\n\r<BR>\nWe have seen the vileness in your soul\r<BR>\nthe horrors you create\r<BR>\n\r<BR>\nNow this angry nations coming\r<BR>\nlook around we\'re at your gate\r<BR>\n\r<BR>\nNo more runnin, no more hiding, there\'s no place for you to go\r<BR>\nFor the wrath of God is coming and he isn\'t movin slow.\r<BR>\n\r<BR>\nYou\'ve defiled the love of all mankind without a single thought\r<BR>\nAnd the world is coming for you now with everything its got.\r<BR>\n\r<BR>\nYes this world is coming for you now (Pause) with everything its got.',NULL,0.33,3,641,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1928,18,'GOD\'s New Commandment!','NEWS FLASH - GOD ANNOUNCES THE 11TH COMMANDMENT!\r<BR>\n\r<BR>\nDuring a recent staff meeting in Heaven, God, Moses, and Saint Peter concluded that the behavior of Ex-President Clinton has brought about the need for an eleventh commandment.\r<BR>\n\r<BR>\nThey worked long and hard in a brain-storming session to try to settle on the wording of the new commandment, because they realized that it should have the same style, majesty and dignity as the original ten. They began their brain-storming and came up with the 11th.\r<BR>\n\r<BR>\nAfter many revisions, they finally agreed that the eleventh commandment should be:\r<BR>\n\r<BR>\n\"Thou shalt not comfort thy rod with thy staff.\"',NULL,0.00,NULL,235,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1929,18,'George W Bush meets Moses!','George W. Bush, in an airport lobby, noticed a man in a long flowing white robe with a long flowing white beard and flowing white hair.\r<BR>\n\r<BR>\nThe man had a staff in one hand and some stone tablets under the other arm. George W. approached the man and inquired, \"Aren\'t you Moses?\" The man ignored George W. and stared at the ceiling.\r<BR>\n\r<BR>\nGeorge W. positioned himself more directly in the man\'s view and asked again, \"Aren\'t you Moses?\" The man continued to peruse the ceiling. George W. tugged at the man\'s sleeve and asked once again, \"Aren\'t you Moses?\"\r<BR>\n\r<BR>\nThe man finally responded in an irritated voice, \"YES, I AM!\"\r<BR>\n\r<BR>\nGeorge W. asked him why he was so uppity and had taken so long to answer him.\r<BR>\n\r<BR>\nThe man replied, \"The last time I spoke to a Bush I ended up stuck in a desert for forty years!',NULL,0.00,NULL,313,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1937,18,'Clinton Strikes again','The Secret Service got a real scare the other day when someone threw a beer at Bill Clinton during his morning jog.\r<BR>\n\r<BR>\nFortunately, it was a draft, so he was able to dodge it.',NULL,0.00,NULL,276,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (1967,18,'Monica Counters Clinton','AP - Monica Lewinsky, in a statement released today, countered President Clinton\'s firm denial:\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"I have had enough. This whole experience has left a bitter taste in my mouth, and I can\'t stomach any more. I feel as if I am getting the shaft, that this ugly matter has come to a head and blown up in my face.\"\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"This may be a load to handle, but when things are hard, that is when I am at my best. I have faced hard things in the past, and I know what is coming. I will meet this challenge the only way that I know how: head on.\"\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"I have licked bigger things than this before, and I will again. No one will ever be able to say that Monica Lewinsky isn\'t a finisher, that she quit before the job was done. I will work non-stop and fight this, blow by blow, until I am wiped clean of this dirty affair. I will not be stained by it.\"\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n\"Thank you.\"\r<BR>\n<BR>\r<BR>\nMonica Lewinsky',NULL,2.00,2,257,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2299,25,'Famous Sports Quotes','Chicago Cubs outfielder Andre Dawson on being a role model: \"I want all the kids to do what I do, to look up to me. I want all the kids to copulate me.\"\r<BR>\n\r<BR>\nNew Orleans Saint RB George Rogers when asked about the upcoming season: \"I want to rush for 1,000 or 1,500 yards, whichever comes\r<BR>\nfirst.\"\r<BR>\n\r<BR>\nAnd, upon hearing Joe Jacoby of the \'Skins say \"I\'d run over my own mother to win the Super Bowl,\" Matt Millen of the Raiders said, \"To win, I\'d run over Joe\'s mom too.\"\r<BR>\n\r<BR>\nFootball commentator and former player Joe Theismann 1996: \"Nobody in football should be called a genius.. A genius is a guy like Norman Einstein.\"\r<BR>\n\r<BR>\nOiler coach Bum Phillips: When asked by Bob Costas why he takes his wife on all the road trips, Phillips responded, \"Because she is too\r<BR>\ndamn ugly to kiss goodbye.\"\r<BR>\n\r<BR>\nSenior basketball player at the University of Pittsburgh: \"I\'m going to graduate on time, no matter how long it takes.\"\r<BR>\n\r<BR>\nClemson recruit Ray Forsythe, who was ineligible as a freshman because of academic requirements: \"I play football. I\'m not trying to be a professor. The tests don\'t seem to make sense to me, measuring your brain on stuff I haven\'t been through in school.\"\r<BR>\n\r<BR>\nBoxing promoter Dan Duva on Mike Tyson hooking up again with promoter Don King: \"Why would anyone expect him to come out smarter? He went to prison for three years, not Princeton.\"\r<BR>\n\r<BR>\nStu Grimson, Chicago Blackhawks left wing, explaining why he keeps a color photo of himself above his locker: \"That\'s so when I forget how to spell my name, I can still find my @#%#%@ clothes.\"\r<BR>\n\r<BR>\nShaquille O\'Neal on whether he had visited the Parthenon during his visit to Greece: \"I can\'t really remember the names of the clubs that we went to.\"\r<BR>\n\r<BR>\nShaquille O\'Neal, on his lack of championships: \"I\'ve won at every level, except college and pro.\"\r<BR>\n\r<BR>\nLou Duva, veteran boxing trainer, on the Spartan training regime of heavyweight Andrew Golota: \"He\'s a guy who gets up at six o\'clock in the morning regardless of what time it is.\"\r<BR>\n\r<BR>\nPat Williams, Orlando Magic general manager, on his team\'s 7-27 record: \"We can\'t win at home. We can\'t win on the road. As general manager, I just can\'t figure out where else to play.\" (1992)\r<BR>\n\r<BR>\nTommy Lasorda, Dodger manager, when asked what terms Mexican-born pitching sensation Fernando Valenzuela might settle for in his upcoming contract negotiations: \"He wants Texas back.\" (1981)\r<BR>\n\r<BR>\nDarrell Royal, Texas football coach, asked if the abnormal number of Longhorn injuries that season resulted from poor physical conditioning: \"One player was lost because he broke his nose. How do you go about getting a nose in condition for football?\" (1966)\r<BR>\n\r<BR>\nSteve Spurrier, Florida football coach, telling Gator fans that a fire at Auburn\'s football dorm had destroyed 20 books: \"But the real tragedy was that 15 hadn\'t been colored yet.\" (1991)\r<BR>\n\r<BR>\nJim Finks, New Orleans Saints G.M., when asked after a loss what he thought of the refs: \"I\'m not allowed to comment on lousy\r<BR>\nofficiating.\" (1986)\r<BR>\n\r<BR>\nAlan Kulwicki, stock car racer, on racing Saturday nights as opposed to Sunday afternoons: \"It\'s basically the same, just darker.\" (1991)\r<BR>\n\r<BR>\nLincoln Kennedy, Oakland Raiders tackle, on his decision not to vote: \"I was going to write myself in, but I was afraid I\'d get shot.\" (1996)\r<BR>\n\r<BR>\nFrank Layden, Utah Jazz president, on a former player: \"I told him, \'Son, what is it with you? Is it ignorance or apathy?\' He said, \'Coach, I don\'t know and I don\'t care.\'\" (1991)\r<BR>\n\r<BR>\nShelby Metcalf, basketball coach at Texas A&M, recounting what he told a player who received four F\'s and one D: \"Son, looks to me like you\'re spending too much time on one subject.\" (1987)',NULL,0.00,NULL,450,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2312,25,'A Chicago man in hell.','A Chicago man dies and goes to hell.\r<BR>\n\r<BR>\nWhen he gets there, the devil comes over to welcome him. The devil then says \"sometimes it gets pretty uncomfortable down here.\" \r<BR>\n\r<BR>\nThe man says, \"No problem. I\'m from Chicago.\"\r<BR>\n\r<BR>\nSo the devil goes over to the thermostat, turns the temperature up to 100, and the humidity up to 80. He then goes back to the Chicago man to see how he\'s doing. To the devil\'s surprise, the man is doing just fine. \r<BR>\n\r<BR>\n\"No problem...just like Chicago in June,\" the man says.\r<BR>\n\r<BR>\nSo the devil goes back over to the thermostat, and turns the temperature up to 150, and the humidity up to 90. He then goes back over to see how the Chicago man is doing. \r<BR>\n\r<BR>\nThe man is sweating a little, but overall looks comfortable.\r<BR>\n\"No problem. Just like Chicago in July,\" the man says.\r<BR>\n\r<BR>\nSo now the devil goes over to the thermostat, turns the temperature up to 200, and the humidity up to 100. When he goes back to see how the man is doing, the man is sweating profusely, and has taken his shirt off. Otherwise, he seems OK. \r<BR>\n\r<BR>\nHe says, \"no problem. Just like Chicago in August.\"\r<BR>\n\r<BR>\nNow the devil is really perplexed. So he goes back to the thermostat, and turns the temperature down to MINUS 150 DEGREES. Immediately, all the humidity in the air freezes up, and the whole place (meaning Hell) becomes a frigid, barren, frozen, deathly cold wasteland.\r<BR>\n\r<BR>\nWhen he goes back now to see how the Chicago man is doing, he is shocked to discover the man is jumping up and down, and cheering in obvious delight. The devil immediately asks the man what\'s going on.\r<BR>\nTo which the Chicago man replies.....\r<BR>\n\r<BR>\n\"THE CUBS WON THE WORLD SERIES!!!\"\r<BR>\n\"THE CUBS WON THE WORLD SERIES!!!\"',NULL,0.00,NULL,345,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2317,25,'Buckeyes vs Wolverines!','In the Ohio State Buckeyes locker room in Columbus, there\'s a sign stating - \"Play like champions today!\"\r<BR>\n\r<BR>\nThere\'s also one in the Michigan Wolverines locker room that says:\r<BR>\n\"Don\'t forget your HELMET!\"',NULL,3.50,2,1230,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2319,25,'Drunk Cheerleader','Michael Irvin was complaining to Calvin Williams about his first trip to the Super Bowl and how hard it was to get any sleep the night before the big game. \"I was awakened at one, two and four in the morning by a drunk cheerleader banging on the door and screaming,\" he recalled.\r<BR>\n\r<BR>\n\"That\'s terrible,\" said Williams. \"How\'d you ever get any sleep?\"\r<BR>\n\r<BR>\n\"At five o\'clock I finally unlocked the door and let her out,\" replied Irvin.',NULL,0.00,NULL,337,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2332,25,'Kid divorces his parents','There was this kid who wanted to divorce his parents, so he takes them to court.\r<BR>\n\r<BR>\nThe judge says, \"do you want to live with your dad?\" the kid says \"no! he beats me!\".\r<BR>\nThe judge says,\"you want to live with your mom?\" \"no! she beats me too!\".\r<BR>\n\r<BR>\nSo the judge says, \"who do you want to live with then?\"\r<BR>\n\r<BR>\nThe kid says, \"The Cleveland Browns...they can\'t beat anybody!\"',NULL,0.00,NULL,258,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2336,25,'Sid and Barney play golf','Sid and Barney head out for a quick round of golf. Since they are short on time, they decide to play only 9 holes. Sid offers Barney, \"let\'s say we make the time worth the while, at least for one of us, and spot $5 on the lowest score for the day.\" Barney agrees and they enjoy a great game. After the 8th hole, Barney is ahead by 1 stroke, but cuts his ball into the rough on the 9th.\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n\"Help me find my ball, you look over there,\" he says to Sid.  fter 5 minutes, neither has had any luck, and since a lost ball carries a four-point penalty, Barney pulls a ball from his pocket and tosses it to the ground. \"I\'ve found my ball!\" he announces triumphantly.\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\nSid looks at him forlornly, \"After all the years we\'ve been friends, you\'d cheat me on golf for a measly five bucks?!?\"\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n\"What do you mean cheat?  I found my ball sitting right here!\"\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n\"And a liar, too!!!\"  Sid says with amazement.\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n<BR>\r<BR>\n\"I\'ll have you know I\'ve been standing on your ball for the last five minutes!\"',NULL,0.00,NULL,830,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2347,25,'The Pessimist!','An optimist sees the best in the world, while a pessimist sees only the worst. An optimist finds the positive in the negative, and a pessimist can only find the negative in the positive.\r<BR>\n\r<BR>\nFor example, an avid duck hunter was in the market for a new bird dog. His search ended when he found a dog that could actually walk on water to retrieve a duck. Shocked by his find, he was sure none of his friends would ever believe him.\r<BR>\n\r<BR>\nHe decided to try to break the news to a friend of his, a pessimist by nature, and invited him to hunt with him and his new dog.\r<BR>\n\r<BR>\nAs they waited by the shore, a flock of ducks flew by. they fired, and a duck fell. The dog responded and jumped into the water. The dog, however, did not sink but instead walked across the water to retrieve the bird, never getting more than his paws wet. This continued all day long; each time a duck fell, the dog walked across the surface of the water to retrieve it.\r<BR>\n\r<BR>\nThe pessimist watched carefully, saw everything, but did not say a single word.\r<BR>\n\r<BR>\nOn the drive home the hunter asked his friend, \"Did you notice anything unusual about my new dog?\"\r<BR>\n\r<BR>\n\"I sure did,\" responded the pessimist. \"Your dog can\'t swim!\"',NULL,0.00,NULL,975,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2351,25,'Where Do We Play?','Pat Williams, general manager of the Orlando Magic, on his team\'s woeful record:\r<BR>\n\r<BR>\n\"We can\'t win at home. We can\'t win on the road. As general manager, I just can\'t figure out where else to play.\"',NULL,10.00,1,1793,1,1,1,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2493,27,'Absent From School Excusess','1. Dear School: Please excuse John from being absent on Jan. 28, 29, 30, 31, 32, and also 33.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n2. Please excuse Dianne from being absent yesterday. She was in bed with gramps.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n3. Please excuse Johnnie for being. It was his father\'s fault.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n4. Chris will not be in school because he has an acre in his side.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n5. John has been absent because he had two teeth taken off his face.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n6. Excuse Gloria. She has been under the doctor.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n7. Lillie was absent from school yesterday because she had a going over.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n8. My son is under the doctor\'s care and should not take fizical ed. Please execute him.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n9. Carlos was absent yesterday because he was playing football. He was hit in the growing part.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n10. My daughter was absent yesterday because she was tired. She spent this weekend with the Marines.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n11. Please excuse Joyce from P.E. for a few days. Yesterday she fell off a tree and misplaced her hip.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n12. Please excuse Ray Friday from school. He has very loose vowels.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n13. Maryann was absent Dec. 11-16, because she had a fever, sore throat, headache, and upset stomach. Her sister was also sick, fever and sore throat, her brother had a low-grade fever. There must be the flu going around, her father even got hot last night.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n14. Please excuse Blanche from jim today. She is administrating.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n15. George was absent yesterday because he had a stomach.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n16. Ralph was absent yesterday because he had a sore trout.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n17. Please excuse Sara for being absent. She was sick and I had her shot.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n18. Please excuse Lupe. She is having problems with her ovals.\r<BR>\n<BR>\r<BR>\n\r<BR>\n<BR>\r<BR>\n19. Please excuse Pedro from being absent yesterday. He had diah(*crossed out*), diahoah(*crossed out*), dyah(*crossed out*) the shits.',NULL,1.40,5,2587,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2496,27,'Less Common Latin Phrases','Quo signo nata es?\r<BR>\nWhat\'s your sign?\r<BR>\n\r<BR>\nRomani quidem artem amatoriam invenerunt.\r<BR>\nYou know, the Romans invented the art of love.\r<BR>\n\r<BR>\nO! Plus! Perge! Aio! Hui! Hem!\r<BR>\nOh! More! Go on! Yes! Ooh! Ummm!\r<BR>\n\r<BR>\nSpero nos familiares mansuros.\r<BR>\nI hope we\'ll still be friends.\r<BR>\n\r<BR>\nMellita, domi adsum.\r<BR>\nHoney, I\'m home.\r<BR>\n\r<BR>\nTam exanimis quam tunica nehru fio.\r<BR>\nI am as dead as the nehru jacket.\r<BR>\n\r<BR>\nVentis secundis, tene cursum.\r<BR>\nGo with the flow.\r<BR>\n\r<BR>\nTotum dependeat.\r<BR>\nLet it all hang out.\r<BR>\n\r<BR>\nTe precor dulcissime supplex!\r<BR>\nPretty please with a cherry on top!\r<BR>\n\r<BR>\nMagister Mundi sum!\r<BR>\nI am the Master of the Universe!\r<BR>\n\r<BR>\nFac me cocleario vomere!\r<BR>\nGag me with a spoon!\r<BR>\n\r<BR>\nTe audire no possum. Musa sapientum fixa est in aure.\r<BR>\nI can\'t hear you. I have a banana in my ear.\r<BR>\n\r<BR>\nEstne volumen in toga, an solum tibi libet me videre?\r<BR>\nIs that a scroll in your toga, or are you just happy to see me?\r<BR>\n\r<BR>\nPrehende uxorem meam, sis!\r<BR>\nTake my wife, please!\r<BR>\n\r<BR>\nQuantum materiae materietur marmota monax si marmota monax materiam possit materiari?\r<BR>\nHow much wood would a woodchuck chuck if a woodchuck could chuck wood?\r<BR>\n\r<BR>\nNihil est-in vita priore ego imperator Romanus fui.\r<BR>\nThat\'s nothing-in a previous life I was a Roman Emperor.\r<BR>\n\r<BR>\nAio, quantitas magna frumentorum est.\r<BR>\nYes, that is a very large amount of corn.\r<BR>\n\r<BR>\nRecedite, plebes! Gero rem imperialem!\r<BR>\nStand aside plebians! I am on imperial business.\r<BR>\n\r<BR>\nOblitus sum perpolire clepsydras!\r<BR>\nI forgot to polish the clocks!\r<BR>\n\r<BR>\nVescere bracis meis.\r<BR>\nEat my shorts.\r<BR>\n\r<BR>\nSic faciunt omnes.\r<BR>\nEveryone is doing it.\r<BR>\n\r<BR>\nVacca foeda\r<BR>\nStupid cow\r<BR>\n\r<BR>\nFac ut vivas.\r<BR>\nGet a life.\r<BR>\n\r<BR>\nRaptus regaliter\r<BR>\nRoyally screwed\r<BR>\n\r<BR>\nAnulos qui animum ostendunt omnes gestemus!\r<BR>\nLet\'s all wear mood rings!\r<BR>\n\r<BR>\nInsula Gilliganis\r<BR>\nGilligan\'s Island',NULL,1.00,1,1512,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2505,27,'Definition of a good date!','These three women were roommates. One night they all had all gone out on dates and all came home at about the same time. \r\n\r\nThe first one said, \"You know you\'ve been on a good date when you come home with your hair all messed up.\" \r\n\r\nThe second one said, \"No, you know you\'ve been on a good date when you come home with your makeup all smeared.\"\r\n\r\nThe third one said nothing, but reached under her skirt, removed her panties and threw them against the wall, where they stuck.\r\nShe said, \"Now THAT\'S a good date!!\"',NULL,3.33,3,1896,1,1,2,'1',NULL,NULL);
INSERT INTO `jokes` VALUES (2508,27,'He shouldn\'t have asked!','MR. SMITH got himself a new secretary.\r<BR>\nShe was young, sweet and pretty.\r<BR>\nOne day, while taking dictation, she noticed his fly was open.\r<BR>\n\r<BR>\nWhen leaving the room she said, \"Oh, Mr. Smith, did you know your barracks door is open?\"\r<BR>\n\r<BR>\nHe did not understand her remark, but later he happened to look down and saw his zipper was open.\r<BR>\n\r<BR>\nHe decided to have some fun with his new secretary. Calling her in he asked, \"By the way Miss Jones, when you saw my barracks door open did you also see a soldier standing at attention?\"\r<BR>\n\r<BR>\nThe secretary who was quite witty said, \"Why no Mr. Smith.\r<BR>\nAll I saw was a little disabled veteran sitting on two duffle bags.\"',NULL,2.00,5,1908,1,1,0,'',NULL,NULL);
INSERT INTO `jokes` VALUES (2527,27,'Shiny New Motorcycle','An engineering student is walking on campus one day, when another engineer student rides up on a shiny new motorcycle.\r<BR>\n\r<BR>\n\"Where did you get such a functional bike?\" asked the first.\r<BR>\n\r<BR>\nThe second engineer replied: \"Well, I was walking along yesterday minding my own business when a beautiful woman rode up on this bike. She threw the bike to the ground, took off all her clothes, spread her arms wide and said: \"Take what you want.\"\r<BR>\n\r<BR>\nThe second engineer nodded approvingly: \"Good choice; the clothes probably wouldn\'t have fit.\"',NULL,2.00,4,2280,1,1,0,'',NULL,NULL);
