INSERT INTO `jokes` VALUES (2597,16,'Italian \'49er ','            He  was  born  in  the  suberb  of  Monza  in  the  North  Italian  city  of  Torino  in  the  year  1820  asnd  was  named  Nogar  Raphie .  In  the  year  1845  Nogar  Raphie  emmigrated  to  the  United  States  and  settled  in  the  State  of  Kentucky .....................Upon  hearing  of  the  San  Francisco  Gold  Rush , he  went  to  Northern  California  in  the  year  1849 , and  had  no  luck  in  finding  gold . His  desire  to  find  gold  could  not  go  away , he  heard  about  the  Australian  Gold  Rush  in  the  year  1851  and  headed straight  towards  Ballarat  Victoria ....................South  of  Ballarat  in  the  suberb  of  Mount  Helen  Nogar  Raphie  had  a  tragic  accident , he  fell  down  a  six  hundred  foot  deep  mine  shaft . Word  gets  around.............at  the  minefeilds , Norgar  Raphie  fell  down  a  mineshaft............at  the  bar, Nogar  Raphie  fell  down  a  mineshaft...........at  the  bordello , Nogar  Raphie  has  fallen  down  a  mineshaft............at the  Post  Office , Nogar  Raphie  has  fallen  down  a  mineshaft   and  finaly  at  the  church , Nogar  Raphie  has  fallen  down  a  mineshaft .  The  caring  Catholic  preist  says............Poor Nogar  Raphie.................pornography . ',NULL,0.00,NULL,135,0,19,0,'0','Andy  Wilmot ','andrewwilmot666@bigpond.com');
