INSERT INTO `jokes` VALUES (2600,16,' In  the  movies  they  don\'t  go  to  the  toilet ','            Have  you  ever  noticed  that  when  you\'re  watching  the  movies , nobody  ever  goes  to  the  toilet , that\'s  right  nobody  ever  goes  to  the  toilet ........................In  the  movie  entitled  \" The  Ten  Commandments \"  the  Jews  are  leaving  Egypt  and are  heading  towards  Isreal  and  not  one  Hebrew  says  \" Hey  Moses , do  you  mind  if  I  go  behind  the  sand  dune  for  a  crap \" . Fifty  Five  days  in  Peking , Around  the  World  in  Eighty  Days  and  not  to  mention  Seven  Years  in Tibet , that\'s  extraordinary .....................In  the  movie  entitled  \" Easy  Rider \" Peter  Fonda  and  Dennis  Hopper  drive  their  motorcycles  all  the  way  from  Los  Angeles  to  New  Orleans , or  should  I  say  what\'s  left  of  New  Orleans .  In  this  movie  Peter  Fonda  and  Dennis  Hopper  eat , they  sleep , they  buy  petrol , they  talk  about  UFOs , they  smoke  marijuana , they  visit  a  hippie  colony  and  a  whorehouse  and  even  snort  cocaine . but  not  once  do  they  go  behind  a  tree  to  release  the  amber  fluid .....................and  finaly  John  Wayne  says  \" A  man\'s  gotta  do , what  a  man\'s  gotta  do  and  as  a  man  gets  older , he  does  it  more  often \" .',NULL,0.00,NULL,116,0,19,0,'0','Andy  Wilmot ','andrewwilmot666@bigpond.com');
INSERT INTO `jokes` VALUES (2601,18,'Dirty  old  men  with  beards .','            Have  you  ever  wondered  where  \" Beware  of  dirty  old  men  with  beards , they  molest  little  girls  came  from ? .  This  was  Anti  Jewish  propaganda  put  into  the  minds  of  little  school  children  in  Nazi  Germany  during  the  1930s ..............In  the  year  1937 in  the  South  Western  city  of  Freiburg  a  little  seven  year  old  girl  sees  an  elderly  bearded  Jewish  man .  And  at  the  top  of  her  voice  she  yelled  \" Don\'t  mollest  me  you  Jewish  vermin \"  and  the  elderly  Jewish  man  says  to  the  little  girl \" Don\'t  worry  be  seventeen \" and  the  little  girl  says  \" In  the  year  1947  I  will  be  seventeen \"  and  the  elderly  Jew  says  \" I  have  extra  sensory  perception , the Nazis  will  soon  murder  me  and  you  won\'t  be  seventeen , because  you  will  be  killed  by  a  B-17 \".and  the  little  girl  says  \" I  don\'t  beleive  you ! \"................................The  years  went  past  and  in  the  year  1939  the  elderly  Jew  was  murdered  by  the  Nazis . And  in  the  Month  of  Febuary 1944   Two  hundred  Boeing  B-17s  protected  and  escorted  by  P-51  Mustangs  are  heading  towards  Freiburg in  South  West  Germany .  All  two  hundred  arrive  above  Freiburg  undamaged ...........................Above  Freiburg  there  is  a  vibrating  roar , followed  by  the  whistling  of  bombs  being  dropped , followed  by  deafening  explosions , followed  by  blinding  cement  dust  and  finaly  at  the  age  of  fourteen  years  the  girl  at  the  start  of  this  joke  with  all  her  classmates  is  killed ....................and  she  and  her  classmates  sing \" Boeing.........Boeing..........Boeing............Boeing..........Gone ! \".',NULL,2.00,5,309,0,19,0,'0','Andy  Wilmot  ','andrewwilmot666@bigpond.com ');
