INSERT INTO `jokes` VALUES (3056,3,'cyber checklist randt (written by bc jones 2009)','Here\\\'s some hints to see if you use the computer too much:\r\n1-The only mouse that clicks more than yours is Mickey while tap dancing with Tic-Tacs in his pocket and speaking Ethiopian. \r\n2-You make Bill Gates look like an Amish Ted Kaczynski. \r\n3-When you meet people in person, you still ask Age, Sex, and Location?\r\n4-You don’t what your best friend sounds like and your talking to them right now.\r\n5-You lower your voice by deactivating CAPS LOCK and whispering in parenthesis.\r\n6-Your colonoscopy is on YouTube.\r\n7-Your drivers license photo was taken by a aiming you camera phone into the mirror because u didn\\\'t like the old one aka DMV default pic.\r\n8-You use nicotine gum to help you ctrl-alt-delete smoking.\r\n9-A girl that\\\'s your type is any girl that can type…or any lying dude with pink font.\r\n10-You say the phrase \\\"login\\\" more than Paul Bunion at a lumberjack convention.\r\n',NULL,0.00,NULL,73,0,25,0,'0','brandon c jones','brandoncraigjones@gmail.com');
